strings = ["\u05e1\u05e2\u05d9\u05e4\u05d9\u05dd \u05e9\u05d5\u05e0\u05d9\u05dd", "", "\u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d5\u05dc\u05e9\u05db\u05ea\u05d5", "\u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d5\u05dc\u05e9\u05db\u05ea\u05d5 (0001)", "\u05d7\u05d1\u05e8\u05d9 \u05d4\u05db\u05e0\u05e1\u05ea", "\u05d4\u05db\u05e0\u05e1\u05ea (0002)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05db\u05e0\u05e1\u05ea", "\u05ea\u05d5\u05e1\u05e4\u05ea \u05de\u05d1\u05e0\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05e9\u05e8\u05d3 \u05dc\u05d9\u05d5\"\u05e8 \u05db\u05e0\u05e1\u05ea \u05dc\u05e9\u05e2\u05d1\u05e8", "\u05d2\u05d9\u05de\u05dc\u05d0\u05d5\u05ea \u05d7\u05d1\u05e8\u05d9 \u05db\u05e0\u05e1\u05ea", "\u05de\u05d5\u05d6\u05d9\u05d0\u05d5\u05df \u05d4\u05db\u05e0\u05e1\u05ea", "\u05d7\u05d1\u05e8\u05d9 \u05de\u05de\u05e9\u05dc\u05d4", "\u05d7\u05d1\u05e8\u05d9 \u05de\u05de\u05e9\u05dc\u05d4 (0003)", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9", "\u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 (0004)", "\u05e8\u05d0\u05e9\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d4 \u05de\u05de\u05dc\u05db\u05ea\u05d9\u05ea", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea", "\u05de\u05d9\u05de\u05d5\u05df \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05ea\u05d5\u05db\u05e0\u05d9\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea", "\u05e8\u05d1\u05e0\u05d5\u05ea \u05e8\u05d0\u05e9\u05d9\u05ea", "\u05e0\u05ea\u05d9\u05d1", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1 \u05d5\u05d4\u05d2\u05dc\u05d9\u05dc", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d0\u05d6\u05d5\u05e8\u05d9", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d0\u05d5\u05e6\u05e8 (0005)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05d8\u05d4 \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05d8\u05d4 \u05db\u05dc\u05dc \u05de\u05e9\u05e7\u05d9\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05e2\u05d6\u05e8 \u05dc\u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05de\u05e9\u05dc\u05d4", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05e2\u05d9\u05d1\u05d5\u05d3\u05d9\u05dd \u05de\u05de\u05d5\u05db\u05e0\u05d9\u05dd (\u05e9\u05e2\"\u05de)", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05e1\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d4\u05de\u05e9\u05e8\u05d3 \u05d5\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05e4\u05e0\u05d9\u05dd (0006)", "\u05e4\u05e7\u05d5\u05d7 \u05d0\u05e8\u05e6\u05d9 \u05e2\u05dc \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea", "\u05e9\u05dc\u05d8\u05d5\u05df \u05de\u05e7\u05d5\u05de\u05d9", "\u05ea\u05db\u05e0\u05d5\u05df \u05e4\u05d9\u05d6\u05d9", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d7\u05d9\u05e8\u05d5\u05dd \u05d5\u05ea\u05e4\u05e7\u05d9\u05d3\u05d9\u05dd", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05de\u05d0\u05d2\u05e8 \u05d1\u05d9\u05d5\u05de\u05d8\u05e8\u05d9", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05d4\u05d0\u05e8\u05e6\u05d9\u05ea \u05dc\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05d1\u05e0\u05d9\u05d4", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05db\u05d1\u05d0\u05d5\u05ea \u05d5\u05d4\u05e6\u05dc\u05d4", "\u05ea\u05e4\u05e2\u05d5\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9-", "\u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e4\u05e0\u05d9\u05dd (0007)", "\u05de\u05e9\u05d8\u05e8\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc- \u05e7\u05e0\u05d9\u05d5\u05ea \u05d5\u05e9\u05db\u05e8", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d4\u05e1\u05d5\u05d4\u05e8", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d4\u05e1\u05d5\u05d4\u05e8", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05e2\u05d3\u05d9\u05dd", "\u05d7\u05e9\u05d1\u05d5\u05df \u05de\u05e2\u05d1\u05e8", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05d5\u05de\u05d8\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05e9\u05e4\u05d8\u05d9\u05dd (0008)", "\u05e4\u05e8\u05e7\u05dc\u05d9\u05d8\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05e8\u05d9\u05e9\u05d5\u05dd \u05d5\u05e0\u05d9\u05d4\u05d5\u05dc \u05e8\u05db\u05d5\u05e9 \u05d5\u05e9\u05d5\u05de\u05d4", "\u05de\u05d9\u05db\u05d5\u05df \u05de\u05e9\u05e4\u05d8\u05d9\u05dd", "\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05d7\u05e7\u05d9\u05e8\u05d5\u05ea \u05e9\u05d5\u05d8\u05e8\u05d9\u05dd", "\u05d1\u05ea\u05d9 \u05d3\u05d9\u05df \u05e9\u05e8\u05e2\u05d9\u05d9\u05dd \u05d5\u05d3\u05e8\u05d5\u05d6\u05d9\u05dd", "\u05d1\u05ea\u05d9 \u05d4\u05d3\u05d9\u05df \u05d4\u05e8\u05d1\u05e0\u05d9\u05d9\u05dd", "\u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8", "\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d5\u05e6\u05d0\u05d4 \u05dc\u05e4\u05d5\u05e2\u05dc \u05d5\u05d4\u05de\u05e8\u05db\u05d6 \u05dc\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d8\u05d4 \u05d1\u05d0\u05e8\u05e5", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5 (0009)", "\u05d9\u05d9\u05e6\u05d5\u05d2 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05d7\u05d5\"\u05dc", "\u05de\u05d8\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05dc\u05d0\u05d5\u05de\u05d9", "\u05de\u05d8\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05dc\u05d0\u05d5\u05de\u05d9 (0010)", "\u05de\u05d1\u05e7\u05e8 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 (0011)", "\u05d1\u05d9\u05e6\u05d5\u05e2 \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05ea\u05dc\u05d5\u05e0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d7\u05d3 \u05e4\u05e2\u05de\u05d9\u05d5\u05ea", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05d5\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd (0012)", "\u05d4\u05e1\u05d3\u05e8 \u05e7\u05e8\u05e0\u05d5\u05ea \u05d4\u05e4\u05e0\u05e1\u05d9\u05d4", "\u05ea\u05e4\u05e2\u05d5\u05dc \u05de\u05e0\u05d4\u05dc\u05ea \u05d4\u05d2\u05de\u05dc\u05d0\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea (0013)", "\u05ea\u05d7\u05d5\u05dd \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea", "\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05d5\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea (0014)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05dc\u05db\u05e0\u05e1\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d8\u05d7\u05d5\u05df", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d8\u05d7\u05d5\u05df (0015)", "\u05de\u05d9\u05d2\u05d5\u05df \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d4 (\u05d0\u05d1\"\u05db)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d7\u05d9\u05e8\u05d5\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d5\u05ea (0016)", "\u05d4\u05e2\u05e8\u05db\u05d5\u05ea \u05d5\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05ea", "\u05de\u05e8\u05db\u05d9\u05d1\u05d9 \u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05e8\u05e9\u05d5\u05ea \u05d7\u05d9\u05e8\u05d5\u05dd \u05dc\u05d0\u05d5\u05de\u05d9\u05ea", "\u05ea\u05d0\u05d5\u05dd \u05d4\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d1\u05e9\u05d8\u05d7\u05d9\u05dd", "\u05ea\u05d0\u05d5\u05dd \u05d4\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d1\u05e9\u05d8\u05d7\u05d9\u05dd (0017)", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea (0018)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d9\u05d5\u05e2\u05d3\u05d9\u05dd \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05db\u05dc\u05dc\u05d9\u05d9\u05dd", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05d3\u05e2 \u05d5\u05d4\u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4 \u05d5\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e8\u05d1\u05d5\u05ea \u05d5\u05d4\u05e1\u05e4\u05d5\u05e8\u05d8 (0019)", "\u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05d3\u05e2", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05e2\u05ea\u05d9\u05e7\u05d5\u05ea", "\u05ea\u05e8\u05d1\u05d5\u05ea", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05e1\u05e4\u05d5\u05e8\u05d8", "\u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05de\u05d8\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da (0020)", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d5\u05e2\u05d5\u05d1\u05d3\u05d9 \u05de\u05e9\u05e8\u05d3", "\u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05d5\u05e8\u05d9\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05e4\u05d3\u05d2\u05d5\u05d2\u05d9-\u05db\u05dc\u05dc\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e7\u05d3\u05dd \u05d9\u05e1\u05d5\u05d3\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05e1\u05d5\u05d3\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e2\u05dc \u05d9\u05e1\u05d5\u05d3\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05ea\u05d9\u05e9\u05d1\u05d5\u05ea\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e2\u05e6\u05de\u05d0\u05d9 \u05d5\u05de\u05d5\u05db\u05e8", "\u05d4\u05e1\u05e2\u05d5\u05ea \u05d4\u05e6\u05d8\u05d9\u05d9\u05d3\u05d5\u05ea \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05e1\u05e4\u05d5\u05e8\u05d8", "\u05d8\u05dc\u05d5\u05d9\u05d6\u05d9\u05d4 \u05d7\u05d9\u05e0\u05d5\u05db\u05d9\u05ea", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05ea\u05d5\u05e8\u05e0\u05d9\u05d9\u05dd", "\u05d4\u05e9\u05db\u05dc\u05d4 \u05d2\u05d1\u05d5\u05d4\u05d4 (0021)", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05ea\u05e7\u05e6\u05d9\u05d1 \u05d4\u05de\u05d5\u05e1\u05d3\u05d5\u05ea", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e2\u05dd \u05de\u05e9\u05e8\u05d3\u05d9\u05dd \u05d5\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05dc\u05d4\u05e9\u05db\u05dc\u05d4 \u05d2\u05d1\u05d5\u05d4\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05e8\u05d5\u05d5\u05d7\u05d4 (0023)", "\u05d0\u05d2\u05e3 \u05d4\u05e9\u05d9\u05e7\u05d5\u05dd", "\u05d0\u05d2\u05e3 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05d0\u05d3\u05dd \u05d4\u05de\u05e4\u05d2\u05e8", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05d0\u05d9\u05e9\u05d9\u05d9\u05dd \u05d5\u05d7\u05d1\u05e8\u05ea\u05d9\u05d9\u05dd", "\u05e0\u05d5\u05e2\u05e8 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05ea\u05e7\u05d5\u05df", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9\u05d9", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea (0024)", "\u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05de\u05e1\u05d5\u05e0\u05e4\u05d5\u05ea \u05dc\u05d1\u05ea\u05d9\u05d4\"\u05d7", "\u05de\u05d9\u05e0\u05d4\u05dc \u05e8\u05e4\u05d5\u05d0\u05d4", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9\u05d9\u05dd", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea", "\u05d7\u05d5\u05e7 \u05d1\u05d9\u05d8\u05d5\u05d7 \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05de\u05dc\u05db\u05ea\u05d9", "\u05d7\u05dc\u05d5\u05e7\u05ea \u05db\u05e1\u05e4\u05d9 \u05e2\u05d6\u05d1\u05d5\u05e0\u05d5\u05ea", "\u05ea\u05d2\u05de\u05d5\u05dc\u05d9\u05dd \u05dc\u05e0\u05db\u05d9\u05dd", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05e0\u05d9\u05e6\u05d5\u05dc\u05d9 \u05d4\u05e9\u05d5\u05d0\u05d4 (0025)", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05d4\u05d2\u05e0\u05ea \u05d4\u05e1\u05d1\u05d9\u05d1\u05d4 (0026)", "\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05d4\u05de\u05e9\u05e8\u05d3", "\u05d9\u05dd \u05d5\u05d7\u05d5\u05e4\u05d9\u05dd", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd", "\u05e6\u05e2\u05e8 \u05d1\u05e2\u05dc\u05d9 \u05d7\u05d9\u05d9\u05dd", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05dc \u05e4\u05d9 \u05d7\u05d5\u05e7 \u05d4\u05d1\u05d9\u05d8\u05d5\u05d7 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9 (\u05e1\u05e2\u05d9\u05e3 32)", "\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9 (0027)", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05dc\u05e7\u05e6\u05d1\u05d0\u05d5\u05ea", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9 \u05e2\u05dc \u05e4\u05d9 \u05d4\u05e1\u05db\u05de\u05d9\u05dd (\u05e1\u05e2\u05d9\u05e3 9)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05d9\u05e0\u05d4\u05dc", "\u05e9\u05db\u05e8", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05d4\u05e9\u05d9\u05db\u05d5\u05df (0029)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea \u05d4\u05e2\u05dc\u05d9\u05d4 (0030)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05e7\u05dc\u05d9\u05d8\u05d4", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd", "\u05e7\u05dc\u05d9\u05d8\u05d4 \u05d7\u05d1\u05e8\u05ea\u05d9\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e7\u05dc\u05d9\u05d8\u05d4 \u05d9\u05e9\u05d9\u05e8\u05d4", "\u05e7\u05dc\u05d9\u05d8\u05ea \u05de\u05d3\u05e2\u05e0\u05d9\u05dd", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05e9\u05db\u05d5\u05e0\u05ea\u05d9 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea \u05d1\u05e0\u05d9 \u05d4\u05e2\u05d3\u05d4 \u05d4\u05d0\u05ea\u05d9\u05d5\u05e4\u05d9\u05ea", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e2\u05dc\u05d9\u05d9\u05d4", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d9\u05d9\u05e6\u05d5\u05e8 \u05d7\u05e7\u05dc\u05d0\u05d9", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea (0032)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7 \u05e6\u05e2\u05e8 \u05d1\u05e2\u05dc\u05d9 \u05d7\u05d9\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d0\u05d7\u05e8\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05de\u05d5\u05e6\u05e8\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05de\u05d7\u05d9\u05e8\u05d9 \u05d4\u05de\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05e9\u05e7 \u05d4\u05d3\u05dc\u05e7", "\u05e4\u05d9\u05e6\u05d5\u05d9 \u05dc\u05d0\u05e1\u05d5\u05e0\u05d5\u05ea \u05d8\u05d1\u05e2", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea (0033)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05dc\u05d7\u05e7\u05dc\u05d0\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05d4\u05d3\u05e8\u05db\u05d4 \u05d5\u05d4\u05de\u05e7\u05e6\u05d5\u05e2", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d9", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05d9\u05d5\u05ea", "\u05d4\u05e1\u05d3\u05e8\u05d9\u05dd \u05dc\u05de\u05d2\u05d6\u05e8 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d9", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea", "\u05d7\u05d8\u05d9\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e9\u05d1\u05d5\u05ea", "\u05d4\u05d7\u05d1\u05e8\u05d4 \u05dc\u05d4\u05e7\u05de\u05ea \u05d4\u05e9\u05d5\u05e7 \u05d4\u05e1\u05d9\u05d8\u05d5\u05e0\u05d0\u05d9", "\u05de\u05d3\u05e2\u05df \u05e8\u05d0\u05e9\u05d9", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05d5\u05ea (0034)", "\u05de\u05d8\u05d4 \u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea", "\u05de\u05d7\u05e9\u05d5\u05d1 \u05d4\u05de\u05e9\u05e8\u05d3", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8 \u05dc\u05de\u05d3\u05e2\u05d9 \u05d4\u05d0\u05d3\u05de\u05d4 \u05d5\u05d4\u05d9\u05dd", "\u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05d0\u05e0\u05e8\u05d2\u05d9\u05d4", "\u05d9\u05e2\u05d5\u05dc \u05d4\u05e9\u05d9\u05de\u05d5\u05e9 \u05d1\u05d0\u05e0\u05e8\u05d2\u05d9\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d9\u05d3\u05e2", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05d9\u05e7\u05d5\u05d7 \u05d1\u05de\u05e9\u05e7 \u05d4\u05d3\u05dc\u05e7", "\u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05ea", "\u05d4\u05d5\u05e2\u05d3\u05d4 \u05dc\u05d0\u05e0\u05e8\u05d2\u05d9\u05d4 \u05d0\u05d8\u05d5\u05de\u05d9\u05ea", "\u05d4\u05d5\u05e2\u05d3\u05d4 \u05dc\u05d0\u05e0\u05e8\u05d2\u05d9\u05d4 \u05d0\u05d8\u05d5\u05de\u05d9\u05ea (0035)", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 \u05d4\u05de\u05e1\u05d7\u05e8 (0036)", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05db\u05dc\u05dc\u05d9\u05d9\u05dd", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05e1\u05d7\u05e8 \u05d7\u05d5\u05e5", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df, \u05d5\u05d7\u05d9\u05e4\u05d4, \u05d0\u05e9\u05e7\u05dc\u05d5\u05df \u05d5\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4\u05d5\u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05d5\u05d0\u05db\u05d9\u05e4\u05d4 \u05d1\u05e9\u05d5\u05e7 \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4", "\u05db\u05d7 \u05d0\u05d3\u05dd \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05d4\u05db\u05d5\u05d5\u05e0\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4", "\u05d0\u05d2\u05e3 \u05dc\u05d4\u05db\u05e9\u05e8\u05d4 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05e2\u05d1\u05d5\u05d3\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea (0037)", "\u05d4\u05db\u05e9\u05e8\u05ea \u05db\u05d7 \u05d0\u05d3\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc \u05dc\u05e9\u05d9\u05d5\u05d5\u05e7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05db\u05dc\u05db\u05dc\u05d4", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05d0\u05e9\u05e8\u05d0\u05d9 \u05dc\u05e2\u05e0\u05e3 \u05d4\u05de\u05dc\u05d5\u05e0\u05d0\u05d5\u05ea", "\u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e2\u05e9\u05d9\u05d9\u05ea\u05d9", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e2\u05e0\u05e4\u05d9 \u05d4\u05de\u05e9\u05e7 (0038)", "\u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d4\u05d5\u05df", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d2\u05d5\u05e4\u05d9\u05dd \u05d4\u05de\u05e7\u05d3\u05de\u05d9\u05dd \u05d9\u05e6\u05d5\u05d0", "\u05ea\u05e7\u05d9\u05e0\u05d4", "\u05d4.\u05de. \u05d7\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05d4\u05d3\u05e8\u05d5\u05dd", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05e2\u05e1\u05e7\u05d9\u05dd \u05e7\u05d8\u05e0\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4", "\u05e2\u05ea\u05d5\u05d3\u05d5\u05ea \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1 \u05db\u05dc\u05dc\u05d9", "\u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea -\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea (0039)", "\u05d4\u05e0\u05d3\u05e1\u05d4 \u05d5\u05e8\u05d9\u05e9\u05d5\u05d9", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05dc\u05e9\u05d9\u05d3\u05d5\u05e8\u05d9 \u05db\u05d1\u05dc\u05d9\u05dd \u05d5\u05dc\u05d5\u05d5\u05d9\u05d9\u05df", "\u05d0\u05d2\u05e3 \u05d4\u05e1\u05e4\u05e7\u05d8\u05e8\u05d5\u05dd", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d1\u05e0\u05e7 \u05d4\u05d3\u05d5\u05d0\u05e8", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc\u05ea \u05dc\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05e9\u05d9\u05d3\u05d5\u05e8\u05d9\u05dd \u05dc\u05e6\u05d9\u05d1\u05d5\u05e8", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05d5\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05ea\u05d7\u05e8\u05d5\u05ea \u05d1\u05ea\u05d7\u05d5\u05dd \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4-\u05e8\u05d0\u05e9\u05d9", "\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 (0040)", "\u05ea\u05e2\u05d5\u05e4\u05d4 \u05d0\u05d6\u05e8\u05d7\u05d9\u05ea", "\u05de\u05d8\u05d0\u05d5\u05e8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4", "\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea \u05d1\u05d3\u05e8\u05db\u05d9\u05dd", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05d9\u05dd", "\u05e8\u05e9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea \u05dc\u05de\u05d9\u05dd \u05d5\u05dc\u05d1\u05d9\u05d5\u05d1 (0041)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd,\u05e1\u05d1\u05e1\u05d5\u05d3 \u05e8\u05d9\u05d1\u05d9\u05ea", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05e9\u05d9\u05db\u05d5\u05df (0042)", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e9\u05db\u05e8 \u05d3\u05d9\u05e8\u05d4", "\u05e2\u05de\u05dc\u05d5\u05ea \u05e0\u05d9\u05d4\u05d5\u05dc \u05d4\u05e1\u05d9\u05d5\u05e2", "\u05d4\u05de\u05e8\u05db\u05d6 \u05dc\u05de\u05d9\u05e4\u05d5\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05de\u05e8\u05db\u05d6 \u05dc\u05de\u05d9\u05e4\u05d5\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc (0043)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05e4\u05e0\u05d9\u05dd", "\u05ea\u05e9\u05dc\u05d5\u05dd \u05e8\u05d9\u05d1\u05d9\u05ea \u05d5\u05e2\u05de\u05dc\u05d5\u05ea (0045)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d7\u05d5\u05e5", "\u05d7\u05d5\u05e7 \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05de\u05e9\u05d5\u05d7\u05e8\u05e8\u05d9\u05dd", "\u05d7\u05d5\u05e7 \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05de\u05e9\u05d5\u05d7\u05e8\u05e8\u05d9\u05dd (0046)", "\u05d1\u05e0\u05d9\u05d9\u05ea \u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05de\u05e9\u05dc\u05d4", "\u05d3\u05d9\u05d5\u05e8 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 (0051)", "\u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8-\u05ea\u05db\u05e0\u05d9\u05ea \u05d7\u05d3\u05e9\u05d4", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 - \u05de\u05e9\u05d8\u05e8\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df- \u05e4\u05e0\u05d9\u05dd (0052)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05ea\u05d9 \u05e1\u05d5\u05d4\u05e8", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 - \u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e4\u05e0\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8", "\u05de\u05e9\u05e4\u05d8\u05d9\u05dd \u05d5\u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8 (0053)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05e9\u05e4\u05d8\u05d9\u05dd", "\u05d1\u05e0\u05d9\u05d9\u05ea \u05d1\u05ea\u05d9-\u05de\u05e9\u05e4\u05d8", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d4\u05d2\u05d1\u05dc\u05d9\u05dd \u05d4\u05e2\u05e1\u05e7\u05d9\u05d9\u05dd", "\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05e4\u05d9\u05e7\u05d5\u05d7 (0054)", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd- \u05d7\u05e9\u05de\u05dc", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d8\u05d1\u05e2 \u05d5\u05d4\u05d2\u05e0\u05d9\u05dd", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d2\u05d6 \u05d4\u05d8\u05d1\u05e2\u05d9", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e1\u05d7\u05e8 \u05d4\u05d5\u05d2\u05df", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05db\u05e0\u05e8\u05ea - \u05d0\u05d9\u05d2\u05d5\u05d3 \u05e2\u05e8\u05d9\u05dd", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05dc\u05e6\u05e8\u05db\u05e0\u05d5\u05ea", "\u05d0\u05d5\u05e6\u05e8", "\u05d0\u05d5\u05e6\u05e8 (0055)", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05e9\u05d5\u05d5\u05d9\u05d5\u05df \u05d6\u05db\u05d5\u05d9\u05d5\u05ea", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05e9\u05d5\u05d5\u05d9\u05d5\u05df \u05d6\u05db\u05d5\u05d9\u05d5\u05ea (0056)", "\u05ea\u05db\u05e0\u05d9\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d7\u05d9\u05e0\u05d5\u05da", "\u05d7\u05d9\u05e0\u05d5\u05da (0060)", "\u05d4\u05e6\u05d8\u05d9\u05d3\u05d5\u05ea \u05de\u05d1\u05e0\u05d9 \u05d7\u05d9\u05e0\u05d5\u05da", "\u05d7\u05d9\u05d3\u05d5\u05e9 \u05de\u05d1\u05e0\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05db\u05dc\u05dc\u05d5\u05ea \u05dc\u05d4\u05db\u05e9\u05e8\u05ea \u05de\u05d5\u05e8\u05d9\u05dd", "\u05d1\u05e0\u05d9\u05ea \u05de\u05d1\u05e0\u05d9\u05dd \u05dc\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea (0067)", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea", "\u05d4\u05e6\u05d8\u05d9\u05d9\u05d3\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05d0\u05d2\u05e3 \u05d0\u05db\u05d9\u05e4\u05d4", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df, \u05d4\u05d4\u05d2\u05d9\u05e8\u05d4 \u05d5\u05de\u05e2\u05d1\u05e8\u05d9 \u05d4\u05d2\u05d1\u05d5\u05dc (0068)", "\u05d0\u05d2\u05e3 \u05ea\u05e9\u05dc\u05d5\u05de\u05d9\u05dd \u05d5\u05d4\u05d9\u05ea\u05e8\u05d9\u05dd", "\u05de\u05d8\u05d4 \u05d5\u05ea\u05d7\u05d5\u05dd \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd", "\u05de\u05e9\u05d8\u05e8\u05ea \u05d4\u05d2\u05d9\u05e8\u05d4", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05d4\u05d2\u05d1\u05d5\u05dc\u05d5\u05ea", "\u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea \u05dc\u05e8\u05db\u05d9\u05e9\u05ea \u05d3\u05d9\u05e8\u05d4", "\u05e9\u05d9\u05db\u05d5\u05df (0070)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d5\u05d8\u05e4\u05d5\u05ea", "\u05d4\u05ea\u05e0\u05ea\u05e7\u05d5\u05ea", "\u05de\u05d9\u05de\u05d5\u05df \u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d4\u05de\u05e9\u05db\u05d9\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e9\u05e7 \u05d4\u05de\u05d9\u05dd", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05de\u05d9\u05dd (0073)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05de\u05d9\u05dd", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e0\u05d9\u05e7\u05d5\u05d6", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05ea\u05d0\u05d2\u05d9\u05d3\u05d9 \u05de\u05d9\u05dd \u05d5\u05dc\u05d1\u05d9\u05d5\u05d1", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05d1\u05d9\u05d5\u05d1", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4", "\u05ea\u05e2\u05e9\u05d9\u05d4 (0076)", "\u05ea\u05db\u05e0\u05d9\u05ea \u05d4\u05d3\u05e8\u05d5\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea (0078)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05db\u05d1\u05d9\u05e9\u05d9\u05dd \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 (0079)", "\u05d4\u05e1\u05e2\u05ea \u05d4\u05de\u05d5\u05e0\u05d9\u05dd \u05d5\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d0\u05d1, \u05e0\u05d9\u05d4\u05d5\u05dc \u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 \u05d5\u05de\u05d7\u05e7\u05e8\u05d9\u05dd", "\u05e0\u05ea\u05d9\u05d1\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d7\u05d5\u05e6\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05db\u05d1\u05d9\u05e9\u05d9\u05dd \u05d1\u05d9\u05e0\u05e2\u05d9\u05e8\u05d5\u05e0\u05d9\u05d9\u05dd", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d7\u05e8", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d7\u05e8\u05d5\u05ea (0083)", "\u05de\u05e8\u05db\u05d1\"\u05d4 \u05d5\u05de\u05de\u05e9\u05dc \u05d6\u05de\u05d9\u05df", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d1\u05d7\u05d1\u05e8\u05d5\u05ea", "\u05de\u05d9\u05de\u05d5\u05df \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d4\u05d1\u05e8\u05d0\u05d4 \u05d2\u05d5\u05e4\u05d9\u05dd \u05d1\u05de\u05e9\u05d1\u05e8", "\u05ea\u05e9\u05dc\u05d5\u05dd \u05d7\u05d5\u05d1\u05d5\u05ea (0084)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 (0098)", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d4\u05de\u05e9\u05e8\u05d3 \u05d5\u05db\u05d7 \u05d0\u05d3\u05dd", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d8\u05d4 \u05d1\u05d0\u05e8\u05e5 (000908)", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05de\u05d8\u05d4", "\u05de\u05d8\u05d4 \u05dc\u05e0\u05e6\u05d9\u05d2\u05d5\u05d9\u05d5\u05ea", "\u05e9\u05db\u05e8 \u05d5\u05e0\u05d9\u05dc\u05d5\u05d5\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05d9\u05d9\u05e6\u05d5\u05d2 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05d7\u05d5\"\u05dc (000909)", "\u05ea\u05e7\u05e9\u05d5\u05d1", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d5\u05e0\u05db\u05e1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05d7\u05d5\"\u05dc", "\u05d0\u05d1\u05d8\u05d7\u05ea \u05d4\u05e0\u05e6\u05d9\u05d2\u05d5\u05d9\u05d5\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05d0\u05d2\u05e3 \u05d0\u05d5\"\u05dd \u05d5\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd \u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9\u05d9\u05dd", "\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d3\u05d9\u05e4\u05dc\u05d5\u05de\u05d8\u05d9\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05d0\u05d2\u05e3 \u05dc\u05e1\u05d9\u05d5\u05e2 \u05d7\u05d5\u05e5 (\u05de\u05e9\"\u05d1)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e0\u05db\u05e1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05d7\u05d5\"\u05dc", "\u05ea\u05e9\u05d5\u05de\u05d5\u05ea \u05db\u05d7 \u05d0\u05d3\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05db\u05dc\u05dc\u05d9\u05d9\u05dd (003701)", "\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05de\u05d9\u05d3\u05e2 \u05d5\u05d1\u05e7\u05e8\u05d4", "\u05d7\u05d1\u05e8\u05d5\u05ea \u05ea\u05e9\u05ea\u05d9\u05ea \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea\u05d9\u05ea", "\u05ea\u05e7\u05d9\u05e0\u05d4, \u05ea\u05e4\u05e2\u05d5\u05dc \u05d5\u05d0\u05d9\u05db\u05d5\u05ea \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea", "\u05d4\u05db\u05e9\u05e8\u05ea \u05db\u05d7 \u05d0\u05d3\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc (003702)", "\u05d4\u05de\u05e8\u05db\u05d6 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05de\u05e7\u05d5\u05de\u05d5\u05ea \u05d4\u05e7\u05d3\u05d5\u05e9\u05d9\u05dd", "\u05e9\u05d9\u05d5\u05d5\u05e7 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc \u05dc\u05e9\u05d9\u05d5\u05d5\u05e7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc (003703)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05db\u05dc\u05dc\u05d9\u05d5\u05ea, \u05e9\u05db\u05e8 \u05d5\u05de\u05e0\u05d4\u05dc\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d9\u05d5\u05d5\u05e7 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05d4\u05de\u05ea\u05d1\u05e6\u05e2\u05d5\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05d7\u05d5\u05e0\u05db\u05d5\u05ea \u05e2\u05e1\u05e7\u05d9\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05db\u05dc\u05db\u05dc\u05d4 (003704)", "\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4, \u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea, \u05e1\u05e7\u05e8\u05d9\u05dd \u05d5\u05de\u05d7\u05e7\u05e8\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05e2\u05dc \u05e4\u05d9 \u05d7\u05d5\u05e7", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea (003707)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d9\u05e0\u05d4\u05dc\u05d9\u05d9\u05dd", "\u05e9\u05db\u05e8 (002906)", "\u05e9\u05db\u05e8 \u05e8\u05e9\u05d5\u05ea \u05d4\u05d1\u05d3\u05d5\u05d0\u05d9\u05dd", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d4\u05de\u05e9\u05e8\u05d3", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea (002908)", "\u05d7\u05e9\u05d1\u05d5\u05ea", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05de\u05d3\u05e2\u05df \u05d4\u05e8\u05d0\u05e9\u05d9", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05e2\u05d9\u05d1\u05d5\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd", "\u05d0\u05d2\u05e3 \u05d0\u05db\u05dc\u05d5\u05e1", "\u05e0\u05db\u05e1\u05d9\u05dd \u05d5\u05d3\u05d9\u05d5\u05e8", "\u05e9\u05d9\u05e7\u05d5\u05dd \u05e9\u05db\u05d5\u05e0\u05d5\u05ea", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05e8\u05e9\u05dd \u05d4\u05e7\u05d1\u05dc\u05e0\u05d9\u05dd", "\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05d4\u05ea\u05d9\u05d9\u05e9\u05d1\u05d5\u05ea \u05d4\u05d1\u05d3\u05d5\u05d0\u05d9\u05ea \u05d1\u05e0\u05d2\u05d1", "\u05d1\u05e0\u05d9\u05d9\u05ea \u05db\u05d9\u05ea\u05d5\u05ea \u05dc\u05d9\u05de\u05d5\u05d3", "\u05ea\u05db\u05e0\u05d9\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d7\u05d9\u05e0\u05d5\u05da (006002)", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d4\u05d9\u05e7\u05e4\u05d9\u05d5\u05ea \u05dc\u05de\u05d1\u05e0\u05d9 \u05d7\u05d9\u05e0\u05d5\u05da", "\u05d1\u05d9\u05d4\"\u05d7 \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd", "\u05d1\u05e0\u05d9\u05ea \u05de\u05d1\u05e0\u05d9\u05dd \u05dc\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd (006702)", "\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05dc\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d7\u05d5\u05dc\u05d9 \u05e0\u05e4\u05e9 \u05d1\u05e7\u05d4\u05d9\u05dc\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05d0\u05e9\u05e7\u05dc\u05d5\u05df", "\u05ea\u05db\u05e0\u05d5\u05df", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea (006703)", "\u05e1\u05e7\u05d8\u05d5\u05e8 \u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e7\u05d5\u05e4\"\u05d7 \u05db\u05dc\u05dc\u05d9\u05ea \u05e2\u05e4\"\u05d9\u05d4\u05e1\u05db\u05dd \u05d4\u05d4\u05d1\u05e8\u05d0\u05d4", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd (006719)", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea", "\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d0\u05db\u05d9\u05e4\u05d4", "\u05d0\u05d2\u05e3 \u05d0\u05db\u05d9\u05e4\u05d4 (006801)", "\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05de\u05d5\u05e8\u05d7\u05e7\u05d9\u05dd", "\u05de\u05d9\u05db\u05d5\u05df", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05ea\u05d5\u05d1\u05e2\u05d9\u05dd", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05dc\u05de\u05ea\u05df \u05d4\u05d9\u05ea\u05e8\u05d9\u05dd", "\u05de\u05d8\u05d4", "\u05de\u05d8\u05d4 \u05d5\u05ea\u05d7\u05d5\u05dd \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df (006804)", "\u05de\u05d7\u05e9\u05d5\u05d1", "\u05d5\u05e2\u05d3\u05d5\u05ea \u05d4\u05e9\u05d2\u05d4", "\u05dc\u05e9\u05db\u05d5\u05ea \u05de\u05e0\u05d4\u05dc \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d0\u05db\u05d9\u05e4\u05d4 \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd", "\u05ea\u05e2\u05d5\u05d3\u05d5\u05ea \u05d6\u05d4\u05d5\u05ea \u05d5\u05d3\u05e8\u05db\u05d5\u05e0\u05d9\u05dd", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd (006805)", "\u05d0\u05e8\u05db\u05d9\u05d1 \u05de\u05de\u05d5\u05d7\u05e9\u05d1", "\u05de\u05d8\u05d4 \u05d9\u05d9\u05e2\u05d5\u05d3\u05d9 \u05dc\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8", "\u05de\u05e8\u05db\u05d1\"\u05d4", "\u05de\u05e8\u05db\u05d1\"\u05d4 \u05d5\u05de\u05de\u05e9\u05dc \u05d6\u05de\u05d9\u05df (008305)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05d5\u05ea", "\u05de\u05de\u05e9\u05dc \u05d6\u05de\u05d9\u05df", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9 \u05de\u05d7\u05e9\u05d5\u05d1 \u05e8\u05d5\u05d7\u05d1\u05d9\u05d9\u05dd", "\u05e8\u05db\u05d1\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d1\u05d7\u05d1\u05e8\u05d5\u05ea (008306)", "\u05d2\u05d5\u05e4\u05d9\u05dd \u05d1\u05de\u05e9\u05d1\u05e8 - \u05de\u05d9\u05de\u05d5\u05df", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (003401)", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d5\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05de\u05db\u05e8\u05d5\u05ea", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8 \u05dc\u05de\u05d3\u05e2\u05d9 \u05d4\u05d0\u05d3\u05de\u05d4 \u05d5\u05d4\u05d9\u05dd (003406)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05de\u05d7\u05e7\u05e8", "\u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05ea (003417)", "\u05ea\u05e9\u05ea\u05d9\u05ea \u05de\u05d9\u05d3\u05e2 \u05dc\u05d7\u05e4\u05d5\u05e9\u05d9 \u05e0\u05e4\u05d8", "\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05de\u05dc\u05d5\u05d5\u05ea \u05e4\u05e0\u05d9\u05dd (008405)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05e1\u05d7\u05d9\u05e8\u05d9\u05dd", "\u05de\u05dc\u05d5\u05d5\u05ea \u05dc\u05d0 \u05e1\u05d7\u05d9\u05e8\u05d9\u05dd", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d4\u05e2\u05e6\u05de\u05d0\u05d5\u05ea \u05d5\u05d4\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d7\u05d5\u05e5 (008406)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05e2\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea \u05d0\u05e8\u05d4\"\u05d1", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05de\u05e8\u05db\u05d9\u05d1\u05d9 \u05e9\u05db\u05e8 \u05d7\u05d1\u05e8\u05d9 \u05d4\u05db\u05e0\u05e1\u05ea", "\u05d7\u05d1\u05e8\u05d9 \u05d4\u05db\u05e0\u05e1\u05ea (000202)", "\u05ea\u05e0\u05d0\u05d9 \u05d7\u05d1\u05e8\u05d9 \u05d4\u05db\u05e0\u05e1\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05d9\u05dd", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05db\u05e0\u05e1\u05ea (000203)", "\u05e7\u05e9\u05e8\u05d9 \u05d7\u05d5\u05e5 \u05d8\u05e7\u05e1\u05d9\u05dd \u05d5\u05e7\u05e8\u05e0\u05d5\u05ea", "\u05e9\u05db\u05e8 \u05e6\u05d5\u05d5\u05ea \u05e4\u05e8\u05dc\u05de\u05e0\u05d8\u05d9 - \u05e1\u05d9\u05e2\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e2\u05d5\u05d1\u05d3\u05d9 \u05d4\u05db\u05e0\u05e1\u05ea", "\u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d7\u05e9\u05d1", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (002601)", "\u05d3\u05d9\u05d5\u05e8 \u05d4\u05de\u05e9\u05e8\u05d3", "\u05d0\u05e9\u05db\u05d5\u05dc \u05de\u05e9\u05d0\u05d1\u05d9 \u05d8\u05d1\u05e2", "\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05d4\u05de\u05e9\u05e8\u05d3 (002603)", "\u05e1\u05e7\u05e8\u05d9\u05dd \u05d5\u05de\u05d7\u05e7\u05e8\u05d9\u05dd", "\u05d0\u05e9\u05db\u05d5\u05dc \u05e9\u05dc\u05d8\u05d5\u05df \u05de\u05e7\u05d5\u05de\u05d9 \u05d5\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd", "\u05d0\u05e9\u05db\u05d5\u05dc \u05d9\u05d9\u05e9\u05d5\u05dd \u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea \u05d5\u05d0\u05db\u05d9\u05e4\u05d4", "\u05d0\u05e9\u05db\u05d5\u05dc \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea", "\u05d0\u05e9\u05db\u05d5\u05dc \u05ea\u05e2\u05e9\u05d9\u05d5\u05ea", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05e1\u05d1\u05d9\u05d1\u05ea\u05d9\u05d9\u05dd", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d4\u05de\u05e9\u05e8\u05d3 \u05d5\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea (000601)", "\u05d9\u05e2\u05d5\u05e5 \u05de\u05e9\u05e4\u05d8\u05d9", "\u05e4\u05e7\u05d5\u05d7 \u05d0\u05e8\u05e6\u05d9 \u05e2\u05dc \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea (000602)", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea \u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05dc\u05ea\u05d9\u05db\u05e0\u05d5\u05df", "\u05ea\u05db\u05e0\u05d5\u05df \u05e4\u05d9\u05d6\u05d9 (000605)", "\u05ea\u05db\u05e0\u05d9\u05d5\u05ea \u05de\u05ea\u05d0\u05e8", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05d0\u05d9\u05db\u05d5\u05ea \u05d4\u05d1\u05e0\u05d9\u05d4", "\u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea \u05d5\u05e0\u05d4\u05dc\u05d9 \u05ea\u05db\u05e0\u05d5\u05df", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d1\u05de\u05d2\u05d6\u05e8\u05d9 \u05d4\u05de\u05d9\u05e2\u05d5\u05d8\u05d9\u05dd", "\u05d5\u05e2\u05d3\u05ea \u05ea\u05db\u05e0\u05d5\u05df \u05dc\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05dc\u05d0\u05d5\u05de\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea \u05dc\u05e2\u05d3\u05d5\u05ea \u05dc\u05d0 \u05d9\u05d4\u05d5\u05d3\u05d9\u05d5\u05ea", "\u05ea\u05e4\u05e2\u05d5\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea (000615)", "\u05de\u05d1\u05e0\u05d9 \u05d3\u05ea \u05dc\u05d0 \u05d9\u05d4\u05d5\u05d3\u05d9\u05d9\u05dd", "\u05e9\u05d9\u05d0 \u05db\u05d7 \u05d0\u05d3\u05dd", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9- (000701)", "\u05e7\u05e8\u05df \u05d1\u05dc\u05d0\u05d9 \u05e8\u05db\u05d1", "\u05e8\u05e9\u05d5\u05ea \u05dc\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e1\u05de\u05d9\u05dd \u05d5\u05d0\u05dc\u05db\u05d5\u05d4\u05d5\u05dc", "\u05db\u05d7 \u05d0\u05d3\u05dd", "\u05de\u05e9\u05d8\u05e8\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc- \u05e7\u05e0\u05d9\u05d5\u05ea \u05d5\u05e9\u05db\u05e8 (000702)", "\u05d4\u05de\u05d8\u05d4 \u05d4\u05d0\u05e8\u05e6\u05d9", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05de\u05e9\u05d8\u05e8\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05e2\u05d9\u05d1\u05d5\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea", "\u05e8\u05db\u05d9\u05e9\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05db\u05d7 \u05d0\u05d3\u05dd", "\u05de\u05e2\u05e8\u05db\u05ea \u05e8\u05d9\u05e9\u05d5\u05dd \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05d2\u05d1\u05d5\u05dc\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d4 \u05dc\u05e4\u05d5\u05e2\u05dc \u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05d0\u05d1\u05d8\u05d7\u05ea \u05de\u05ea\u05e7\u05e0\u05d9\u05dd, \u05e0\u05de\u05dc\u05d9", "\u05d0\u05d1\u05d8\u05d7\u05ea \u05de\u05ea\u05e7\u05e0\u05d9\u05dd \u05d5\u05e4\u05dc\u05d5\u05d2\u05d5\u05ea- \u05e9\u05db\u05e8", "\u05d0\u05d1\u05d8\u05d7\u05ea \u05de\u05ea\u05e7\u05e0\u05d9\u05dd \u05d5\u05e4\u05dc\u05d5\u05d2\u05d5\u05ea- \u05e7\u05e0\u05d9\u05d5\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05de\u05d0\u05d1\u05e7 \u05d1\u05e4\u05e9\u05d9\u05e2\u05d4 \u05d4\u05d7\u05de\u05d5\u05e8\u05d4 \u05d5\u05d4\u05de\u05d0\u05d5\u05e8\u05d2\u05e0\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d4\u05e1\u05d5\u05d4\u05e8 (000710)", "\u05e9\u05de\u05d9\u05e8\u05d4 \u05d5\u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4 \u05d5\u05d9\u05e6\u05d5\u05e8", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05e1\u05d5\u05d4\u05e8\u05d9\u05dd", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05de\u05e9\u05d8\u05e8\u05d4", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d4\u05e1\u05d5\u05d4\u05e8 (000715)", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d4\u05e1\u05d5\u05d4\u05e8", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05e2\u05d3\u05d9\u05dd (000720)", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (000401)", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc\u05d4 \u05dc\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd", "\u05de\u05e0\u05d4\u05dc\u05ea \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9", "\u05de\u05d8\u05d4 \u05d4\u05e1\u05d1\u05e8\u05d4 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05d4\u05e2\u05e6\u05de\u05ea \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05de\u05d5\u05e8\u05e9\u05ea \u05dc\u05d0\u05d5\u05de\u05d9\u05ea", "\u05d5\u05e2\u05d3\u05ea \u05d8\u05d9\u05e8\u05e7\u05dc", "\u05de\u05e2\u05e8\u05da \u05d4\u05d2\u05d9\u05d5\u05e8", "\u05d4\u05d5\u05d5\u05e2\u05d3\u05d4 \u05d4\u05d1\u05d9\u05e0\u05de\u05e9\u05e8\u05d3\u05d9\u05ea \u05dc\u05d4\u05d9\u05e2\u05e8\u05db\u05d5\u05ea \u05dc\u05e8\u05e2\u05d9\u05d3\u05d5\u05ea \u05d0\u05d3\u05de\u05d4", "\u05d0\u05e8\u05db\u05d9\u05d5\u05df \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d0\u05e8\u05db\u05d9\u05d5\u05df \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05de\u05e8\u05db\u05d6 \u05d1\u05d2\u05d9\u05df", "\u05de\u05e8\u05db\u05d6 \u05e8\u05d1\u05d9\u05df", "\u05de\u05e8\u05db\u05d6 \u05d4\u05e1\u05d1\u05e8\u05d4", "\u05d7\u05dc\u05e7\u05ea \u05d2\u05d3\u05d5\u05dc\u05d9 \u05d4\u05d0\u05d5\u05de\u05d4", "\u05e1\u05d9\u05d5\u05e2 \u05e0\u05e4\u05d2\u05e2\u05d5\u05ea \u05ea\u05e7\u05d9\u05e4\u05d4 \u05de\u05d9\u05e0\u05d9\u05ea", "\u05de\u05d6\u05db\u05d9\u05e8\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05e8\u05d0\u05e9\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05d4 (000402)", "\u05d9\u05e2\u05d5\u05e5 \u05dc\u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05dc\u05e9\u05db\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05e9\u05e2\u05d1\u05e8 -\u05e9\u05de\u05d9\u05e8", "\u05dc\u05e9\u05db\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05e9\u05e2\u05d1\u05e8 \u05d0\u05d4\u05d5\u05d3 \u05d0\u05d5\u05dc\u05de\u05e8\u05d8", "\u05dc\u05e9\u05db\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05e9\u05e2\u05d1\u05e8 - \u05d0\u05e8\u05d9\u05d0\u05dc \u05e9\u05e8\u05d5\u05df", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05e8\u05d0\u05e9\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e7\u05d9\u05d3\u05d5\u05dd \u05de\u05e2\u05de\u05d3 \u05d4\u05d0\u05e9\u05d4", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e2\u05dc\u05d9\u05d9\u05d4", "\u05de\u05d7\u05e9\u05d1 \u05dc\u05db\u05dc \u05d9\u05dc\u05d3", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05dc\u05d4\u05e0\u05e6\u05d7\u05d4", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9 \u05d4\u05e0\u05e6\u05d7\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d9\u05e9\u05d5\u05d1\u05d9 \u05d4\u05de\u05d2\u05d6\u05e8 \u05d4\u05e2\u05e8\u05d1\u05d9", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05db\u05dc\u05db\u05dc\u05d9 \u05e9\u05dc \u05d4\u05de\u05d2\u05d6\u05e8 \u05d4\u05e2\u05e8\u05d1\u05d9", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05d0\u05d1\u05d9\u05e9\u05d9 \u05d1\u05e8\u05d5\u05d5\u05e8\u05de\u05df", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05d9\u05e2\u05e7\u05d1 \u05de\u05e8\u05d2'\u05d9", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05d1\u05e0\u05d9 \u05d1\u05d2\u05d9\u05df", "\u05dc\u05e9\u05db\u05ea \u05e1\u05d2\u05df \u05d4\u05e9\u05e8 \u05d0\u05d9\u05d5\u05d1 \u05e7\u05e8\u05d0", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05d9\u05d5\u05e1\u05d9 \u05e4\u05dc\u05d3", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8\u05d4 \u05d2\u05d9\u05dc\u05d4 \u05d2\u05de\u05dc\u05d9\u05d0\u05dc \u05d2\u05de\u05dc\u05d9\u05d0\u05dc", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d4\u05e1\u05d1\u05e8\u05d4 \u05d5\u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05de\u05e9\u05d5\u05dc\u05dd \u05e0\u05d4\u05e8\u05d9", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05de\u05d9\u05db\u05d0\u05dc \u05d0\u05d9\u05ea\u05df", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9 \u05d2\u05d9\u05de\u05dc\u05d0\u05d9\u05dd", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9 \u05d2\u05de\u05dc\u05d0\u05d9\u05dd", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9\u05dd \u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d9\u05dd", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9 \u05de\u05d5\u05d3\u05d9\u05e2\u05d9\u05df", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05dc\u05e7\u05d5\u05d7\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea", "\u05dc\u05e9\u05db\u05d4 \u05de\u05e8\u05db\u05d6\u05d9\u05ea \u05dc\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d4", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d4 \u05de\u05de\u05dc\u05db\u05ea\u05d9\u05ea (000403)", "\u05de\u05e4\u05e7\u05d3 \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df", "\u05e1\u05e7\u05e8 \u05d0\u05e8\u05d5\u05da \u05d8\u05d5\u05d5\u05d7", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d4\u05dc\u05e9\u05db\u05d4", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea (000405)", "\u05e9\u05db\u05e8 \u05de\u05e0\u05d4\u05dc\u05ea \u05ea\u05e0\u05d5\u05e4\u05d4", "\u05de\u05d9\u05de\u05d5\u05df \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05ea\u05d5\u05db\u05e0\u05d9\u05ea (000406)", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05de\u05e0\u05d4\u05dc\u05ea \u05ea\u05e0\u05d5\u05e4\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e0\u05d4\u05dc\u05ea \u05ea\u05e0\u05d5\u05e4\u05d4", "\u05d4\u05e1\u05db\u05de\u05d9\u05dd \u05dc\u05e7\u05d1\u05d5\u05e6\u05d5\u05ea \u05e2\u05dc \u05e4\u05d9 \u05e1\u05e2\u05d9\u05e3 85 \u05dc\u05d7\u05d5\u05e7 \u05d9\u05d9\u05e9\u05d5\u05dd \u05ea\u05db\u05e0\u05d9\u05ea \u05d4\u05d4\u05ea\u05e0\u05ea\u05e7\u05d5\u05ea", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e4\u05e8\u05d8\u05d9\u05dd - \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d5\u05de\u05e2\u05e0\u05e7\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e4\u05e8\u05d8\u05d9\u05dd - \u05ea\u05e2\u05e1\u05d5\u05e7\u05d4", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e2\u05e1\u05e7\u05d9\u05dd", "\u05de\u05d9\u05de\u05d5\u05df \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e9\u05e8\u05d3\u05d9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05de\u05d5\u05e2\u05e6\u05d5\u05ea \u05d3\u05ea\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea (000408)", "\u05e4\u05ea\u05d5\u05d7 \u05d1\u05ea\u05d9 \u05e2\u05dc\u05de\u05d9\u05df", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05d1\u05e0\u05d9 \u05d3\u05ea", "\u05e9\u05db\u05e8 \u05d5\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05e8\u05d1\u05e0\u05d5\u05ea \u05e8\u05d0\u05e9\u05d9\u05ea (000409)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05db\u05d5\u05d7 \u05d0\u05d3\u05dd \u05d5\u05d9\u05d9\u05e2\u05d5\u05e5", "\u05d4\u05e1\u05d1\u05e8\u05d4 \u05d0\u05d9\u05e8\u05d5\u05e2\u05d9\u05dd", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05dc\u05de\u05e2\u05df \u05d4\u05db\u05e9\u05e8\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05e8\u05d1\u05e0\u05d5\u05ea \u05d4\u05e8\u05d0\u05e9\u05d9\u05ea", "\u05e9\u05db\u05e8 \u05e2\u05d5\u05d1\u05d3\u05d9 \u05e0\u05ea\u05d9\u05d1", "\u05e0\u05ea\u05d9\u05d1 (000415)", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8 \u05d4\u05e7\u05dc\u05d3\u05d4", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8 \u05de\u05d9\u05d7\u05e9\u05d5\u05d1", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e9\u05db\u05e8", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 (000416)", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05de\u05d9\u05db\u05d5\u05df", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8 \u05e2\u05ea\u05d9\u05d3\u05d9\u05dd \u05dc\u05de\u05d2\u05d6\u05e8 \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8\u05d9", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1 \u05d5\u05d4\u05d2\u05dc\u05d9\u05dc (000421)", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05e0\u05d2\u05d1 \u05d5\u05d4\u05d2\u05dc\u05d9\u05dc", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d0\u05d6\u05d5\u05e8\u05d9 (000423)", "\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (000501)", "\u05d0\u05d2\u05e3 \u05e0\u05db\u05e1\u05d9 \u05e0\u05e4\u05e7\u05d3\u05d9\u05dd", "\u05dc\u05e9\u05db\u05ea \u05e1\u05d2\u05df \u05d4\u05e9\u05e8 \u05d9\u05e6\u05d7\u05e7 \u05db\u05d4\u05df", "\u05d0\u05d2\u05e3 \u05d4\u05ea\u05e7\u05e6\u05d9\u05d1\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05d8\u05d4 \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd (000502)", "\u05d0\u05d2\u05e3 \u05d4\u05d7\u05e9\u05d1 \u05d4\u05db\u05dc\u05dc\u05d9", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d1\u05e6\u05d5\u05e2 \u05ea\u05e7\u05e6\u05d9\u05d1", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05de\u05e9\u05e7 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2 \u05d5\u05de\u05d9\u05db\u05d5\u05df", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d7\u05e9\u05db\"\u05dc", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05db\u05dc\u05db\u05dc\u05d9\u05d9\u05dd \u05d1\u05d0\u05e8\u05d4\"\u05d1", "\u05d7\u05d1\u05e8\u05ea \u05e2\u05e0\u05d1\u05dc", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05d1\u05d5\u05d5\u05e9\u05d9\u05e0\u05d2\u05d8\u05d5\u05df", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e4\u05e0\u05d9\u05de\u05d9\u05ea", "\u05de\u05e0\u05d4\u05dc \u05d4\u05e8\u05db\u05e9", "\u05d0\u05d2\u05e3 \u05e9\u05db\u05e8 \u05d5\u05d4\u05e1\u05db\u05de\u05d9 \u05e2\u05d1\u05d5\u05d3\u05d4", "\u05d0\u05d2\u05e3 \u05dc\u05e7\u05e9\u05e8\u05d9\u05dd \u05d1\u05d9\u05e0\"\u05dc", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05d8\u05d4 \u05db\u05dc\u05dc \u05de\u05e9\u05e7\u05d9\u05d9\u05dd (000503)", "\u05e0\u05e6\u05d9\u05d2\u05d5\u05ea \u05d1-OECD \u05e4\u05e8\u05d9\u05d6", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d0\u05d2\u05e3 \u05e9\u05d5\u05e7 \u05d4\u05d4\u05d5\u05df \u05d1\u05d9\u05d8\u05d5\u05d7", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d5\u05ea (000509)", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05e2\u05d9\u05d1\u05d5\u05d3\u05d9\u05dd \u05de\u05de\u05d5\u05db\u05e0\u05d9\u05dd (\u05e9\u05e2\"\u05de) (000510)", "\u05ea\u05e4\u05e2\u05d5\u05dc \u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 - \u05db\u05d7 \u05d0\u05d3\u05dd", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05de\u05d7\u05e9\u05d1 \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05ea\u05e4\u05e2\u05d5\u05dc", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05e1\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc (000520)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05d5\u05d8\u05e4\u05d5\u05ea", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e0\u05e6\u05d9\u05d2\u05d5\u05d9\u05d5\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05d0\u05d7\u05d6\u05e7\u05ea \u05de\u05d1\u05e0\u05d9\u05dd", "\u05de\u05d1\u05e6\u05e2\u05d9\u05dd \u05d5\u05d0\u05d9\u05e1\u05d5\u05e3 \u05de\u05d9\u05d3\u05e2", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e4\u05e9\u05d9\u05e2\u05d4 \u05d4\u05de\u05d0\u05d5\u05e8\u05d2\u05e0\u05ea", "\u05de\u05d8\u05d4 \u05d4\u05de\u05e9\u05e8\u05d3 - \u05db\u05d5\u05d7 \u05d0\u05d3\u05dd", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (002301)", "\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05de\u05e9\u05e8\u05d3", "\u05d4\u05d0\u05d2\u05e3 \u05dc\u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2, \u05de\u05d9\u05db\u05d5\u05df \u05d5\u05d0\u05e8\u05d2\u05d5\u05df", "\u05e7\u05e8\u05df \u05e1\u05d9\u05d5\u05e2", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e0\u05d9\u05e6\u05d5\u05dc\u05d9 \u05e9\u05d5\u05d0\u05d4", "\u05d1\u05d9\u05ea \u05d4\u05e1\u05e4\u05e8 \u05d4\u05de\u05e8\u05db\u05d6\u05d9 \u05dc\u05d4\u05db\u05e9\u05e8\u05ea \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd \u05d1\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d9\u05e2\u05d5\u05e5 \u05dc\u05d0\u05d6\u05e8\u05d7", "\u05d5\u05e2\u05d3\u05d5\u05ea \u05e2\u05e8\u05e8", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05d4\u05ea\u05e0\u05d3\u05d1\u05d5\u05ea", "\u05d4\u05d3\u05e8\u05db\u05d4 \u05d5\u05d4\u05e9\u05ea\u05dc\u05de\u05d5\u05d9\u05d5\u05ea", "\u05de\u05d7\u05e7\u05e8 \u05d5\u05e7\u05d9\u05d3\u05d5\u05dd \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05de\u05e9\u05e7 \u05d1\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d4\u05e8\u05d5\u05d5\u05d7\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d0\u05d9\u05d1\u05d7\u05d5\u05df", "\u05d0\u05d2\u05e3 \u05d4\u05e9\u05d9\u05e7\u05d5\u05dd (002306)", "\u05e0\u05db\u05d9\u05dd \u05d1\u05de\u05e1\u05d2\u05e8\u05d5\u05ea \u05d7\u05d5\u05e5 \u05d1\u05d9\u05ea\u05d9\u05d5\u05ea", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05d5\u05d1\u05d9\u05ea\u05d9", "\u05e9\u05d9\u05e7\u05d5\u05dd \u05d5\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05e2\u05d5\u05d5\u05e8", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd - \u05db\u05d5\u05d7 \u05d0\u05d3\u05dd", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd \u05dc\u05e0\u05db\u05d9\u05dd (\u05de\u05e2\u05d5\u05df \u05e0\u05db\u05d9\u05dd \u05e0\u05ea\u05e0\u05d9\u05d4 \u05d5\u05de\u05e2\u05d5\u05df \u05e1\u05df \u05e1\u05d9\u05de\u05d5\u05df)", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e9\u05d9\u05d7\u05d5\u05ea \u05d8\u05dc\u05e4\u05d5\u05df \u05dc\u05e2\u05d9\u05d5\u05d5\u05e8\u05d9\u05dd", "\u05d0\u05d1\u05d7\u05d5\u05df \u05d0\u05e0\u05e9\u05d9\u05dd \u05e2\u05dd \u05e4\u05d9\u05d2\u05d5\u05e8 \u05e9\u05db\u05dc\u05d9", "\u05d0\u05d2\u05e3 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05d0\u05d3\u05dd \u05d4\u05de\u05e4\u05d2\u05e8 (002308)", "\u05d8\u05e4\u05d5\u05dc \u05d7\u05d5\u05e5 \u05d1\u05d9\u05ea\u05d9", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05e0\u05d4\u05d5\u05dc", "\u05e7\u05e8\u05df \u05e7\u05d9\u05e6\u05d1\u05ea \u05e0\u05db\u05d5\u05ea", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05d7\u05d5\u05e5 \u05d1\u05d9\u05ea\u05d9 \u05d1\u05d0\u05d5\u05d8\u05d9\u05e1\u05d8\u05d9\u05dd", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05d1\u05d0\u05d5\u05d8\u05d9\u05e1\u05d8\u05d9\u05dd", "\u05e4\u05e8\u05d8 \u05d7\u05d3\u05e9 \u05d1\u05ea\u05d4\u05dc\u05d9\u05da \u05d4\u05d5\u05e1\u05e4\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05d0\u05d9\u05e9\u05d9\u05d9\u05dd \u05d5\u05d7\u05d1\u05e8\u05ea\u05d9\u05d9\u05dd (002310)", "\u05db\u05d5\u05d7 \u05d0\u05d3\u05dd \u05d1\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05d0\u05d9\u05e8\u05d2\u05d5\u05df \u05d5\u05de\u05d9\u05e0\u05d4\u05dc \u05d1\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea", "\u05e4\u05e8\u05d8 \u05d5\u05de\u05e9\u05e4\u05d7\u05d4 - \u05e6\u05e8\u05db\u05d9\u05dd \u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd \u05d5\u05d7\u05d9\u05e8\u05d5\u05dd", "\u05e4\u05e8\u05d8 \u05d5\u05de\u05e9\u05e4\u05d7\u05d4 - \u05d8\u05d9\u05e4\u05d5\u05dc \u05d5\u05de\u05e0\u05d9\u05e2\u05d4", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05d9\u05d5\u05dd \u05d5\u05de\u05e9\u05e4\u05d7\u05ea\u05d5\u05e0\u05d9\u05dd", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \"\u05e7\u05e8\u05df \u05e8\u05e9\"\u05d9\"", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e4\u05e0\u05d9\u05de\u05d9\u05d5\u05ea", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d9\u05dc\u05d3 \u05d5\u05e0\u05d5\u05e2\u05e8 \u05d7\u05d5\u05e5- \u05d1\u05d9\u05ea\u05d9", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d9\u05dc\u05d3 \u05d5\u05e0\u05d5\u05e2\u05e8 \u05d8\u05d9\u05e4\u05d5\u05dc \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d9\u05dc\u05d3 \u05d5\u05dc\u05e0\u05d5\u05e2\u05e8 - \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05e0\u05d9\u05d4\u05d5\u05dc", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d6\u05e7\u05df - \u05ea\u05db\u05e0\u05d5\u05df", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d6\u05e7\u05df- \u05d8\u05d9\u05e4\u05d5\u05dc \u05d7\u05d5\u05e5 \u05d1\u05d9\u05ea\u05d9", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d6\u05e7\u05df \u05d8\u05d9\u05e4\u05d5\u05dc \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05de\u05e2\u05df \u05d4\u05d9\u05dc\u05d3 (\u05d0\u05d9\u05de\u05d5\u05e5)", "\u05e2\u05d1\u05d5\u05d3\u05d4 \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05e2\u05d5\u05dc\u05d9\u05dd \u05d7\u05d3\u05e9\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05de\u05e4\u05d5\u05e0\u05d9 \u05d7\u05d1\u05dc \u05e2\u05d6\u05d4 \u05d5\u05e6\u05e4\u05d5\u05df \u05d4\u05e9\u05d5\u05de\u05e8\u05d5\u05df", "\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4", "\u05e7\u05e6\u05d9\u05e0\u05d9 \u05de\u05d1\u05d7\u05df \u05e0\u05d5\u05e2\u05e8 \u05d5\u05de\u05d1\u05d5\u05d2\u05e8\u05d9\u05dd", "\u05e0\u05d5\u05e2\u05e8 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05ea\u05e7\u05d5\u05df (002311)", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd - \u05e8\u05e9\u05d5\u05ea \u05d7\u05e1\u05d5\u05ea \u05d4\u05e0\u05d5\u05e2\u05e8", "\u05d7\u05d5\u05e7\u05e8\u05d9 \u05d9\u05dc\u05d3\u05d9\u05dd", "\u05e9\u05e8\u05d5\u05ea \u05d4\u05de\u05d1\u05d7\u05df \u05dc\u05e0\u05d5\u05e2\u05e8", "\u05e9\u05e8\u05d5\u05ea \u05d4\u05de\u05d1\u05d7\u05df \u05dc\u05de\u05d1\u05d5\u05d2\u05e8\u05d9\u05dd", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05d4\u05ea\u05de\u05db\u05e8\u05d5\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05e7\u05d5\u05dd \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05e9\u05d9\u05e7\u05d5\u05dd \u05e0\u05d5\u05e2\u05e8 \u05de\u05e4\u05ea\u05e0\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05e9\u05d9\u05e7\u05d5\u05dd \u05e0\u05d5\u05e2\u05e8", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05e6\u05e2\u05d9\u05e8\u05d5\u05ea \u05d5\u05de\u05ea\u05d1\u05d2\u05e8\u05d9\u05dd", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d8\u05e4\u05d5\u05dc \u05d1\u05e0\u05e2\u05e8\u05d5\u05ea", "\u05e8\u05e9\u05d5\u05ea \u05d7\u05e1\u05d5\u05ea \u05d4\u05e0\u05d5\u05e2\u05e8 - \u05d8\u05d9\u05e4\u05d5\u05dc \u05d7\u05d5\u05e5 \u05d1\u05d9\u05ea\u05d9", "\u05e8\u05e9\u05d5\u05ea \u05d7\u05e1\u05d5\u05ea \u05d4\u05e0\u05d5\u05e2\u05e8 -", "\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d5\u05dc\u05e9\u05db\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 (002312)", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05d5\u05de\u05e4\u05ea\u05e0\u05d9\u05dd", "\u05d4\u05ea\u05e7\u05e0\u05d5\u05ea \u05d4\u05de\u05e9\u05e8\u05d3", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05dc\u05d6\u05e7\u05df", "\u05e9\u05e8\u05d5\u05ea\u05d9 \u05e9\u05d9\u05e7\u05d5\u05dd", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05de\u05d2\u05d6\u05e8 \u05d4\u05d3\u05e8\u05d5\u05d6\u05d9 \u05d5\u05d4\u05e6'\u05e8\u05e7\u05e1\u05d9", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05d5\u05de\u05d8\u05d4 (000801)", "\u05d9\u05d9\u05e2\u05d5\u05e5 \u05de\u05e9\u05e4\u05d8\u05d9 \u05dc\u05de\u05de\u05e9\u05dc\u05d4", "\u05e1\u05d9\u05d5\u05e2 \u05de\u05e9\u05e4\u05d8\u05d9", "\u05e8\u05e9\u05d5\u05ea \u05dc\u05de\u05e9\u05e4\u05d8 \u05d5\u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4", "\u05e1\u05e0\u05d9\u05d2\u05d5\u05e8\u05d9\u05d4 \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05ea", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05d9\u05d9\u05e9\u05d5\u05dd \u05d7\u05d5\u05e7 \u05d0\u05d9\u05e1\u05d5\u05e8", "\u05ea\u05dc\u05d5\u05e0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05e2\u05dc \u05e9\u05d5\u05e4\u05d8\u05d9\u05dd", "\u05e8\u05d9\u05e9\u05d5\u05dd \u05d5\u05d4\u05e1\u05d3\u05e8 \u05d4\u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05e8\u05d9\u05e9\u05d5\u05dd \u05d5\u05e0\u05d9\u05d4\u05d5\u05dc \u05e8\u05db\u05d5\u05e9 \u05d5\u05e9\u05d5\u05de\u05d4 (000803)", "\u05d4\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1 \u05d4\u05db\u05dc\u05dc\u05d9 \u05d5\u05db\u05d5\u05e0\u05e1", "\u05e9\u05d5\u05de\u05ea \u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05d1\u05ea\u05d9 \u05d4\u05d3\u05d9\u05df \u05d4\u05e8\u05d1\u05e0\u05d9\u05d9\u05dd (000808)", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d1\u05ea\u05d9 \u05d4\u05d3\u05d9\u05df \u05d4\u05e8\u05d1\u05e0\u05d9\u05d9\u05dd", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8", "\u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8 (000820)", "\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df", "\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d4\u05de\u05d7\u05d5\u05d6\u05d9", "\u05d1\u05d9\u05ea \u05de\u05e9\u05e4\u05d8 \u05d4\u05e9\u05dc\u05d5\u05dd", "\u05d1\u05ea\u05d9 \u05d3\u05d9\u05df \u05dc\u05e2\u05d1\u05d5\u05d3\u05d4", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05db\u05dc\u05dc\u05d9\u05d5\u05ea", "\u05d5\u05e2\u05d3\u05ea \u05d7\u05e7\u05d9\u05e8\u05d4 \u05d1\u05e0\u05d5\u05e9\u05d0 \u05e0\u05d9\u05d4\u05d5\u05dc \u05de\u05e9\u05e7 \u05d4\u05de\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc", "\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d5\u05e6\u05d0\u05d4 \u05dc\u05e4\u05d5\u05e2\u05dc \u05d5\u05d4\u05de\u05e8\u05db\u05d6 \u05dc\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea (000821)", "\u05e7\u05e0\u05d9\u05d5\u05ea", "\u05de\u05dc\u05d5\u05d5\u05ea \u05e4\u05e0\u05d9\u05dd (004505)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d7\u05d5\u05e5 (004506)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05e2\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea", "\u05e2\u05d5\u05dc\u05d9\u05dd \u05d7\u05d3\u05e9\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd,\u05e1\u05d1\u05e1\u05d5\u05d3 \u05e8\u05d9\u05d1\u05d9\u05ea (004209)", "\u05d5\u05ea\u05d9\u05e7\u05d9\u05dd \u05d7\u05e1\u05e8\u05d9 \u05d3\u05d9\u05e8\u05d4", "\u05e1\u05d9\u05d5\u05e2 \u05de\u05d9\u05d5\u05d7\u05d3", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05d0\u05d6\u05d5\u05e8\u05d9 \u05e2\u05d3\u05d9\u05e4\u05d5\u05ea \u05dc\u05d0\u05d5\u05de\u05d9\u05ea", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e9\u05db\u05e8 \u05d3\u05d9\u05e8\u05d4 (004212)", "\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd \u05d5\u05ea\u05d9\u05e7\u05d9\u05dd", "\u05e2\u05de\u05dc\u05d5\u05ea \u05e0\u05d9\u05d4\u05d5\u05dc \u05ea\u05d9\u05e7\u05d9 \u05e9\u05db\u05e8 \u05d3\u05d9\u05e8\u05d4", "\u05e2\u05de\u05dc\u05d5\u05ea \u05e0\u05d9\u05d4\u05d5\u05dc \u05d4\u05e1\u05d9\u05d5\u05e2 (004213)", "\u05e2\u05de\u05dc\u05d5\u05ea \u05ea\u05d9\u05e7\u05d9 \u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4- \u05ea\u05e4\u05e2\u05d5\u05dc", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4-\u05e8\u05d0\u05e9\u05d9 (004003)", "\u05d0\u05d2\u05e3 \u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05ea\u05e0\u05d5\u05e2\u05d4", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05e1\u05e4\u05e0\u05d5\u05ea \u05d5\u05d4\u05e0\u05de\u05dc\u05d9\u05dd", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05d9\u05dd (004101)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d1\u05de\u05e9\u05e7 \u05d4\u05de\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7 \u05d4\u05d2\u05dc\u05d9\u05dc", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d9\u05d9\u05e6\u05d5\u05e8 \u05d7\u05e7\u05dc\u05d0\u05d9 (003202)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05de\u05d5\u05e6\u05e8\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05e9\u05d5\u05e7 \u05de\u05e7\u05d5\u05de\u05d9", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d9\u05d9\u05e6\u05d5\u05d0 \u05ea\u05d5\u05e6\u05e8\u05ea", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d1\u05d9\u05d8\u05d5\u05d7 \u05e4\u05d2\u05e2\u05d9 \u05d8\u05d1\u05e2", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea \u05d1\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea", "\u05de\u05e8\u05db\u05d6\u05d9 \u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d6\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d0\u05d7\u05e8\u05d5\u05ea (003204)", "\u05de\u05dc\u05d0\u05d9 \u05d7\u05d9\u05e8\u05d5\u05dd (\u05de\u05dc\"\u05d7)", "\u05e9\u05d9\u05e4\u05d5\u05d9 \u05d9\u05e6\u05d5\u05d0\u05e0\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05de\u05d7\u05d9\u05e8\u05d9 \u05d4\u05de\u05d9\u05dd (003206)", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d7\u05e7\u05dc\u05d0\u05d9\u05dd \u05d1\u05d2\u05d9\u05df", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e1\u05e4\u05e7\u05d9 \u05de\u05d9\u05dd", "\u05e8\u05db\u05d9\u05e9\u05ea \u05de\u05d9\u05dd \u05de\u05dc\u05d9\u05d7\u05d9\u05dd \u05d5\u05de\u05d9 \u05d9\u05dd \u05de\u05d5\u05ea\u05e4\u05dc\u05d9\u05dd", "\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05e0\u05d7\u05d5\u05ea \u05dc\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd \u05d1\u05d8\u05d9\u05e1\u05d5\u05ea \u05e4\u05e0\u05d9\u05dd \u05d0\u05e8\u05e6\u05d9\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 (003208)", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d9\u05e9\u05d9\u05e8\u05d4 \u05d1\u05ea\u05e2\u05e8\u05d9\u05e4\u05d9\u05dd", "\u05de\u05d9\u05de\u05d5\u05df \u05e8\u05db\u05d9\u05e9\u05ea \u05d0\u05d5\u05d8\u05d5\u05d1\u05d5\u05e1\u05d9\u05dd \u05dc\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05ea", "\u05e1\u05d5\u05d1\u05e1\u05d9\u05d3\u05d9\u05d4 \u05dc\u05e8\u05db\u05d1\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05de\u05e9\u05e7 \u05dc\u05e9\u05e2\u05ea \u05d7\u05d9\u05e8\u05d5\u05dd", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05e9\u05e7 \u05d4\u05d3\u05dc\u05e7 (003210)", "\u05e9\u05db\u05e8 \u05de\u05d8\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9\u05d9 (002402)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea - \u05db\"\u05d0", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05de\u05e9\u05d0\u05d1\u05d9 \u05d0\u05e0\u05d5\u05e9", "\u05de\u05ea\u05de\u05d7\u05d9\u05dd \u05d1\u05e4\u05e1\u05d9\u05db\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4", "\u05d7\u05d8\u05d9\u05d1\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05d4\u05de\u05e8\u05db\u05d6 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9 \u05dc\u05d1\u05e7\u05e8\u05ea \u05de\u05d7\u05dc\u05d5\u05ea", "\u05d4\u05de\u05db\u05d5\u05df \u05d4\u05e8\u05e4\u05d5\u05d0\u05d9 \u05dc\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea \u05d1\u05d3\u05e8\u05db\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d7\u05d9\u05e8\u05d5\u05dd", "\u05e9\u05e2\u05ea \u05d7\u05d9\u05e8\u05d5\u05dd", "\u05d4\u05db\u05e9\u05e8\u05ea \u05d0\u05d7\u05d9\u05d5\u05ea", "\u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05de\u05e1\u05d5\u05e0\u05e4\u05d5\u05ea \u05dc\u05d1\u05ea\u05d9\u05d4\"\u05d7 (002404)", "\u05d4\u05e2\u05e1\u05e7\u05ea \u05e2\u05d5\u05dc\u05d9\u05dd", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05d9\u05d5\u05ea \u05d1\u05ea\u05db\u05e0\u05d9\u05d5\u05ea", "\u05d4\u05de\u05db\u05d5\u05df \u05dc\u05e8\u05e4\u05d5\u05d0\u05d4 \u05de\u05e9\u05e4\u05d8\u05d9\u05ea", "\u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea \u05e6\u05e4\u05ea", "\u05de\u05e8\u05db\u05d6 \u05d4\u05d3\u05e8\u05db\u05d4 \u05dc\u05d0\u05d6\u05d5\u05e8 \u05d4\u05e6\u05e4\u05d5\u05df", "\u05d1\u05d9\u05d4\u05e1 \u05dc\u05d8\u05db\u05e0\u05d0\u05d9 \u05e8\u05e0\u05d8\u05d2\u05df-\u05e8\u05de\u05d1\"\u05dd", "\u05e2\u05d9\u05e8\u05d5\u05e0\u05d9 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05d7\u05d9\u05e4\u05d4 \u05e2\"\u05e9 \u05d6\u05d9\u05d9\u05d3\u05d4 \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea", "\u05e2\"\u05e9 \u05de\u05d8\u05d9\u05d5\u05e1 \u05d7\u05d3\u05e8\u05d4 - \u05d1\u05d9\"\u05e1 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea", "\u05e2\"\u05e9 \u05e9\u05d9\u05e0\u05d1\u05d5\u05e8\u05df-\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05ea\u05dc-\u05d0\u05d1\u05d9\u05d1 \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea", "\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05ea\"\u05d0 \u05d1\u05d9\"\u05e1 \u05dc\u05d8\u05db\u05e0\u05d0\u05d9 \u05e8\u05e0\u05d8\u05d2\u05df", "\u05d1\u05d9\u05d4\"\u05d7 \u05ea\u05dc-\u05d4\u05e9\u05d5\u05de\u05e8 \u05d1\u05d9\"\u05e1 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea", "\u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05ea\u05dc \u05d2\u05d9\u05d1\u05d5\u05e8\u05d9\u05dd \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea", "\u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05d1\u05d9\"\u05e1 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea", "\u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05d8\u05db\u05e0\u05d0\u05d9 \u05e8\u05e0\u05d8\u05d2\u05df", "\u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0- \u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8 \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05e4\u05d9\u05d6\u05d9\u05d5\u05d8\u05e8\u05e4\u05d9\u05d4", "\u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05dc\u05d0\u05d7\u05d9\u05d5\u05ea \u05d0\u05e9\u05e7\u05dc\u05d5\u05df", "\u05d4\u05de\u05d5\u05e4\u05d9\u05dc\u05d9\u05d4", "\u05d4\u05e1\u05d3\u05e8 \u05d4\u05ea\u05de\u05d7\u05d5\u05ea \u05e8\u05d5\u05e4\u05d0\u05d9\u05dd", "\u05de\u05d9\u05d3\u05e2 \u05e2\u05dc \u05d4\u05e8\u05e2\u05dc\u05d5\u05ea", "\u05de\u05db\u05d5\u05df \u05dc\u05e8\u05e2\u05dc\u05d9\u05dd \u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05e8\u05e4\u05d5\u05d0\u05d4", "\u05de\u05d9\u05e0\u05d4\u05dc \u05e8\u05e4\u05d5\u05d0\u05d4 (002407)", "\u05d4\u05e2\u05e1\u05e7\u05ea \u05de\u05ea\u05de\u05d7\u05d9\u05dd", "\u05d4\u05d0\u05d2\u05e3 \u05dc\u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e9\u05df", "\u05e4\u05dc\u05d9\u05de\u05df \u05d7\u05d9\u05e4\u05d4 - \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd (150+20) \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9\u05d9\u05dd (002410)", "\u05e4\u05e8\u05d3\u05e1 \u05d7\u05e0\u05d4 - \u05de\u05e8\u05db\u05d6 \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9( 970 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05de\u05e8\u05db\u05d6 \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9 (495+10 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea\u05d9 \u05de\u05db\u05d1\u05e1\u05d4-\u05dc\u05d9\u05d3\u05de\u05e8\u05db\u05d6 \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9", "\u05e9\u05de\u05d5\u05d0\u05dc \u05d4\u05e8\u05d5\u05e4\u05d0, \u05d1\u05d0\u05e8 \u05d9\u05e2\u05e7\u05d1 \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd (355+12 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05e9\u05de\u05d5\u05d0\u05dc \u05d4\u05e8\u05d5\u05e4\u05d0 - \u05e9\u05e8\u05d5\u05ea\u05d9 \u05de\u05db\u05d1\u05e1\u05d4 \u05e2\"\u05d9 \u05d1\u05d9\u05d4\"\u05d7", "\u05e8\u05d0\u05e9\u05d5\u05df \u05dc\u05e6\u05d9\u05d5\u05df - \u05de\u05e8\u05db\u05d6 \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9 (340+25\u05de\u05d9\u05d8\u05d5\u05ea)", "\u05de\u05d6\u05e8\u05e2 - \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05dc\u05d7\u05d5\u05dc\u05d9 \u05e0\u05e4\u05e9 (300+20 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (002413)", "\u05e2\u05db\u05d5 \u05d5\u05e0\u05d4\u05e8\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d8\u05d9\u05e8\u05ea \u05d4\u05db\u05e8\u05de\u05dc - \u05ea\u05d7\u05e0\u05d4 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d7\u05d9\u05e4\u05d4-\u05e2\u05dc \u05d9\u05d3 \u05d1\u05d9\"\u05d7 \u05e8\u05de\u05d1\"\u05dd \u05ea\u05d7\u05e0\u05d5\u05ea \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d8\u05d9\u05e8\u05ea \u05d4\u05db\u05e8\u05de\u05dc - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (228+25 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d7\u05d9\u05e4\u05d4 - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05dc\u05d8\u05e4\u05d5\u05dc \u05d1\u05d9\u05dc\u05d3 \u05d5\u05d1\u05e0\u05d5\u05e2\u05e8 \u05d7\u05d9\u05e4\u05d4", "\u05e9\u05e2\u05e8 \u05de\u05e0\u05e9\u05d4 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (420 + 20 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d7\u05d3\u05e8\u05d4 - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05dc\u05d1 \u05d4\u05e9\u05e8\u05d5\u05df - \u05d1\u05d9\u05ea-\u05d7\u05d5\u05dc\u05d9\u05dd \u05dc\u05d7\u05d5\u05dc\u05d9 \u05e0\u05e4\u05e9 (260+20 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05e9\u05d9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d1\u05ea-\u05d9\u05dd - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (296+40 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d9\u05e4\u05d5 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d2\u05de\u05d9\u05dc\u05d4 \u05de\u05e1\u05de\u05d9\u05dd\u05dc\u05d9\u05d3 \u05de\u05e8\u05db\u05d6 \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 (12 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05de\u05e2\u05d5\u05df \u05d9\u05e4\u05d5 (18 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d9\u05e4\u05d5 - \u05de\u05e8\u05db\u05d6 \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05db\u05d5\u05dc\u05dc\u05e0\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (50 \u05de\u05d9\u05d8\u05d5\u05ea \u05d9\u05d5\u05dd)", "\u05d2\u05d5\u05e9 \u05d3\u05df - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05d1\u05d0\u05e8 \u05d9\u05e2\u05e7\u05d1 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (360+40 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05e8\u05de\u05dc\u05d4 \u05dc\u05d5\u05d3 - \u05ea\u05d7\u05e0\u05d5\u05ea \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05e8\u05d0\u05e9\u05dc\"\u05e6 \u05d5\u05d9\u05d1\u05e0\u05d4- \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9", "\u05e8\u05de\u05dc\u05d4 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 \u05d0\u05e8\u05e6\u05d9 \u05dc\u05d9\u05d3 \u05d1\u05d9\u05ea \u05d4\u05e1\u05d5\u05d4\u05e8 (70 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05db\u05e4\u05e8 \u05e9\u05d0\u05d5\u05dc - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9\u05d9\u05dd \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd", "\u05de\u05e8\u05db\u05d6 \u05d2\u05de\u05d9\u05dc\u05d4 \u05de\u05e1\u05de\u05d9\u05dd -\u05d9-\u05dd", "\u05d1\u05d9\"\u05d7 \u05de\u05d0\u05d5\u05d7\u05d3 \u05dc\u05d7\u05d5\u05dc\u05d9 \u05e0\u05e4\u05e9 \u05d0\u05d9\u05ea\u05e0\u05d9\u05dd - \u05db\u05e4\u05e8 \u05e9\u05d0\u05d5\u05dc (330+30)", "\u05d0\u05d9\u05ea\u05e0\u05d9\u05dd - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9\u05d9\u05dd \u05d1\u05d1\u05d9\u05d4\"\u05d7", "\u05ea\u05d7\u05e0\u05d4 \u05dc\u05d9\u05dc\u05d3 \u05d5\u05e0\u05d5\u05e2\u05e8 \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd", "\u05d1\u05d0\u05e8-\u05e9\u05d1\u05e2 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 (270+60+25 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d0\u05e8 \u05e9\u05d1\u05e2 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d2\u05de\u05d9\u05dc\u05d4 \u05de\u05e1\u05de\u05d9\u05dd", "\u05ea\u05d7\u05e0\u05d4 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 \u05d0\u05d9\u05dc\u05ea", "\u05de\u05d8\u05d4 \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8", "\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 (002416)", "\u05de\u05e2\u05d1\u05d3\u05d5\u05ea \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1", "\u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8 - \u05de\u05e2\u05d1\u05d3\u05d4 \u05de\u05e8\u05db\u05d6\u05d9\u05ea\u05dc\u05e0\u05d2\u05d9\u05e4\u05d9\u05dd", "\u05de\u05e2\u05d1\u05d3\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd", "\u05dc\u05e9\u05db\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05e6\u05e4\u05d5\u05df", "\u05dc\u05e9\u05db\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05d7\u05d9\u05e4\u05d4", "\u05d7\u05d9\u05e4\u05d4 - \u05ea\u05d7\u05e0\u05d4 \u05dc\u05d4\u05ea\u05e4\u05ea\u05d7\u05d5\u05ea \u05d4\u05d9\u05dc\u05d3", "\u05dc\u05e9\u05db\u05ea \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05ea\"\u05d0", "\u05dc\u05e9\u05db\u05ea \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05de\u05e8\u05db\u05d6", "\u05dc\u05e9\u05db\u05ea \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05d9-\u05dd", "\u05dc\u05e9\u05db\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05d0\u05e9\u05e7\u05dc\u05d5\u05df", "\u05dc\u05e9\u05db\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6 \u05d3\u05e8\u05d5\u05dd", "\u05ea\u05dc\u05de\"\u05e8 \u05dc\u05e9\u05db\u05ea \u05d3\u05e8\u05d5\u05dd", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d5\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea (002419)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05d4\u05e9\u05dc\u05de\u05ea \u05e2\u05dc\u05d5\u05ea \u05e1\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05e2\u05e4\"\u05d9 \u05e1\u05e2\u05d9\u05e3 13 (\u05d0) \u05dc\u05d7\u05d5\u05e7 \u05d1\u05d9\u05d8\u05d5\u05d7 \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05de\u05dc\u05db\u05ea\u05d9", "\u05d7\u05d5\u05e7 \u05d1\u05d9\u05d8\u05d5\u05d7 \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05de\u05dc\u05db\u05ea\u05d9 (002420)", "\u05d4\u05e0\u05d4\u05dc\u05d4", "\u05ea\u05d2\u05de\u05d5\u05dc\u05d9\u05dd \u05dc\u05e0\u05db\u05d9\u05dd (002501)", "\u05ea\u05d2\u05de\u05d5\u05dc\u05d9\u05dd \u05d5\u05d4\u05e2\u05e0\u05e7\u05d5\u05ea \u05e0\u05db\u05d9 \u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e0\u05d0\u05e6\u05d9\u05dd", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05d5\u05e9\u05d9\u05e7\u05d5\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e0\u05db\u05d9 \u05e8\u05d3\u05d9\u05e4\u05d5\u05ea \u05d4\u05e0\u05d0\u05e6\u05d9\u05dd", "\u05ea\u05d2\u05de\u05d5\u05dc\u05d9\u05dd \u05d5\u05d4\u05e2\u05e0\u05e7\u05d5\u05ea \u05e0\u05db\u05d9", "\u05d9\u05d9\u05e9\u05d5\u05dd \u05d7\u05d5\u05e7 \u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e0\u05d9\u05e6\u05d5\u05dc\u05d9 \u05e9\u05d5\u05d0\u05d4 \u05e0\u05d6\u05e7\u05e7\u05d9\u05dd", "\u05d4\u05e7\u05dc\u05d5\u05ea \u05d1\u05de\u05d9\u05e1\u05d9\u05dd", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea (001301)", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05dc\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05e9\u05e4\u05d8\u05d9\u05d5\u05ea \u05d5\u05e9\u05d5\u05e0\u05d5\u05ea \u05d5\u05dc\u05e7\u05e8\u05df \u05e4\u05d5\u05e8\u05d3", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05d7\u05d1\u05e8\u05d4 \u05dc\u05de\u05e4\u05e2\u05dc\u05d9", "\u05e9\u05d9\u05e4\u05d5\u05d9 \u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05db\u05d7 \u05d4\u05e8\u05d1 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d5\u05d4\u05e4\u05e2\u05dc\u05ea \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05e8\u05d5\u05d5\u05d7\u05d4 \u05dc\u05e2\u05d5\u05d1\u05d3\u05d9 \u05d5\u05d2\u05de\u05dc\u05d0\u05d9 \u05e9\u05e8\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d4\u05e4\u05e8\u05d8\u05ea \u05d1\u05e0\u05e7\u05d9\u05dd", "\u05e4\u05d3\u05d9\u05d5\u05df \u05d0\u05d2\"\u05d7 \u05d5\u05e0\u05d9\u05d4\u05d5\u05dc \u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8 \u05e0\u05d9\u05d4\u05d5\u05dc \u05d4\u05ea\u05d7\u05d9\u05d9\u05d1\u05d5\u05d9\u05d5\u05ea \u05d5\u05e1\u05d9\u05db\u05d5\u05e0\u05d9\u05dd \u05d5\u05e2\u05d5\u05e9\u05d9 \u05e9\u05d5\u05e7 \u05e8\u05d0\u05e9\u05d9\u05d9\u05dd", "\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05e1\u05db\u05de\u05d9\u05dd \u05e7\u05d5\u05d3\u05de\u05d9\u05dd", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05dc \u05e4\u05d9 \u05ea\u05e7\u05d1\u05d5\u05dc\u05d9 \u05d4\u05de\u05d5\u05e1\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05dc \u05e4\u05d9 \u05d7\u05d5\u05e7 \u05d4\u05d1\u05d9\u05d8\u05d5\u05d7 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9 (\u05e1\u05e2\u05d9\u05e3 32) (002701)", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05de\u05d9\u05de\u05d5\u05df \u05e7\u05e6\u05d1\u05d0\u05d5\u05ea", "\u05d7\u05d5\u05e7 \u05d4\u05d1\u05d8\u05d7\u05ea \u05d4\u05db\u05e0\u05e1\u05d4", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05dc\u05e7\u05e6\u05d1\u05d0\u05d5\u05ea (002702)", "\u05d7\u05d5\u05e7\u05d9\u05dd \u05dc\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea \u05d0\u05d7\u05e8\u05d5\u05ea", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05dc\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea \u05e9\u05d0\u05d9\u05e0\u05df \u05de\u05d1\u05d5\u05d8\u05d7\u05d5\u05ea", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9 \u05e2\u05dc \u05e4\u05d9 \u05d4\u05e1\u05db\u05de\u05d9\u05dd (\u05e1\u05e2\u05d9\u05e3 9) (002703)", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e0\u05db\u05d9\u05dd", "\u05d4\u05e1\u05db\u05de\u05d9\u05dd \u05dc\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea \u05d0\u05d7\u05e8\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d1\u05d9\u05d5\u05d1", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05d1\u05d9\u05d5\u05d1 (007322)", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05e1\u05d9\u05d5\u05e2 \u05de\u05d9\u05d5\u05d7\u05d3\u05d5\u05ea", "\u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea \u05dc\u05e8\u05db\u05d9\u05e9\u05ea \u05d3\u05d9\u05e8\u05d4 (007009)", "\u05e8\u05db\u05d9\u05e9\u05ea \u05d3\u05d9\u05e8\u05d5\u05ea \u05e0\u05db\u05e1\u05d9 \u05e8\u05db\u05d9\u05e9\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d5\u05d8\u05e4\u05d5\u05ea (007069)", "\u05e9\u05d9\u05e7\u05d5\u05dd \u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d5\u05d4\u05e9\u05dc\u05de\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d5\u05ea\u05d9\u05e7\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d1\u05d9\u05e9\u05d5\u05d1\u05d9 \u05de\u05e2\u05d5\u05d8\u05d9\u05dd", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05e7\u05de\u05ea \u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8 \u05d5\u05de\u05d1\u05e0\u05d9 \u05d3\u05ea", "\u05e4\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05d5\u05e4\u05d3\u05d9\u05d5\u05df \u05d6\u05db\u05d5\u05d9\u05d5\u05ea", "\u05d7\u05d9\u05d3\u05d5\u05e9, \u05d0\u05d7\u05d6\u05e7\u05d4, \u05d5\u05d4\u05e8\u05d7\u05d1\u05ea \u05d3\u05d9\u05e8\u05d5\u05ea \u05d1\u05e0\u05d9\u05d4\u05d5\u05dc \u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05e9\u05db\u05e0\u05d5\u05ea \u05d5\u05de\u05d0\u05db\u05dc\u05e1\u05d5\u05ea", "\u05d1\u05e0\u05d9\u05d9\u05d4 \u05db\u05e4\u05e8\u05d9\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d0\u05d1\u05d8\u05d7\u05d4", "\u05e1\u05d1\u05e1\u05d5\u05d3 \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8\u05d9 \u05e2\u05d3\u05d9\u05e4\u05d5\u05ea \u05dc\u05d0\u05d5\u05de\u05d9\u05ea", "\u05de\u05d1\u05e6\u05e2 \u05de\u05db\u05d9\u05e8\u05ea \u05d3\u05d9\u05e8\u05d5\u05ea \u05d4\u05d3\u05d9\u05d5\u05e8 \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8\u05d9 \u05dc\u05d3\u05d9\u05d9\u05e8\u05d9\u05d4\u05df", "\u05d4\u05e1\u05db\u05dd \u05e2\u05de\u05d9\u05d3\u05e8", "\u05d4\u05e1\u05db\u05dd \u05e9\u05d9\u05e7\u05de\u05d5\u05e0\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df \u05e2\u05e4\"\u05d9 \u05d4\u05d7\u05dc\u05d8\u05ea \u05de\u05de\u05e9\u05dc\u05d4 \u05de\u05e1' 561", "\u05d4\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1 \u05d4\u05db\u05dc\u05dc\u05d9", "\u05ea\u05db\u05e0\u05d9\u05ea \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1 \u05e2\u05dc", "\"\u05e8\u05d9\u05db\u05d5\u05d6 \u05de\u05d0\u05de\u05e5\" - \u05e9\u05d9\u05e7\u05d5\u05dd \u05de\u05e8\u05e7\u05dd \u05e7\u05d9\u05d9\u05dd \u05d1\u05e4\u05e8\u05d9\u05e4\u05e8\u05d9\u05d4", "\u05d4\u05ea\u05e0\u05ea\u05e7\u05d5\u05ea- \u05db\u05dc\u05dc\u05d9", "\u05d4\u05ea\u05e0\u05ea\u05e7\u05d5\u05ea (007071)", "\u05d9\u05e9\u05d5\u05d1\u05d9 \u05d7\u05d5\u05dc\u05d5\u05ea \u05d7\u05dc\u05d5\u05e6\u05d4", "\u05e0\u05d9\u05e6\u05e0\u05d9\u05dd", "\u05de\u05d6\u05e8\u05d7 \u05dc\u05db\u05d9\u05e9", "\u05e2\u05d5\u05d1\u05d3\u05d9 \u05de\u05e9\u05e8\u05d3", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d5\u05e2\u05d5\u05d1\u05d3\u05d9 \u05de\u05e9\u05e8\u05d3 (002022)", "\u05d4\u05e9\u05ea\u05dc\u05de\u05d5\u05ea \u05d5\u05d4\u05d3\u05e8\u05db\u05d4", "\u05d0\u05d7\u05d6\u05e7\u05ea \u05d4\u05de\u05e9\u05e8\u05d3", "\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d5\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea \u05d1\u05de\u05d5\u05e1\u05d3\u05d5\u05ea", "\u05ea\u05e0\u05d0\u05d9 \u05e9\u05e8\u05d5\u05ea", "\u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05d5\u05e8\u05d9\u05dd (002023)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05d5\u05ea \u05dc\u05de\u05d5\u05e8\u05d9\u05dd", "\u05ea\u05de\u05e8\u05d9\u05e6\u05d9\u05dd \u05dc\u05de\u05d5\u05e8\u05d9\u05dd", "\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05dc\u05d4\u05db\u05e9\u05e8\u05ea \u05de\u05d5\u05e8\u05d9\u05dd", "\u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea \u05de\u05d5\u05ea\u05e0\u05d5\u05ea \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9 \u05e1\u05de\u05d9\u05e0\u05e8\u05d9\u05dd", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e4\u05d3\u05d2\u05d5\u05d2\u05d9\u05d9\u05dd", "\u05d4\u05e9\u05ea\u05dc\u05de\u05d5\u05ea \u05de\u05d5\u05e8\u05d9\u05dd \u05d5\u05d2\u05e0\u05e0\u05d5\u05ea", "\u05e7\u05d5\u05e8\u05e1\u05d9\u05dd \u05d5\u05d9\u05de\u05d9 \u05e2\u05d9\u05d5\u05df \u05dc\u05e2\u05d5\"\u05d4 \u05d1\u05db\u05d9\u05e8\u05d9\u05dd", "\u05e7\u05e8\u05e0\u05d5\u05ea \u05d5\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05ea\u05dc\u05de\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05e0\u05d4\u05d9\u05d2\u05d5\u05ea \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8\u05d9\u05ea", "\u05ea\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05dc\u05de\u05d9\u05e2\u05d5\u05d8\u05d9\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05e4\u05d3\u05d2\u05d5\u05d2\u05d9-\u05db\u05dc\u05dc\u05d9 (002024)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d7\u05d9\u05e0\u05d5\u05da \u05d5\u05e8\u05d5\u05d5\u05d7\u05d4", "\u05de\u05e2\u05e0\u05e7 \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d4\u05d1\u05d9\u05e8\u05d4", "\u05d4\u05d5\u05e8\u05d0\u05ea \u05d4\u05de\u05e7\u05e6\u05d5\u05e2\u05d5\u05ea \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d1\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05d3\u05e8\u05d5\u05d6\u05d9", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05e4\u05e1\u05d9\u05db\u05d5\u05dc\u05d5\u05d2\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05d4\u05d5\u05d3\u05d9 \u05d1\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05d5\u05ea", "\u05db\u05d7 \u05e2\u05d6\u05e8 \u05e4\u05d3\u05d2\u05d5\u05d2\u05d9", "\u05de\u05ea\u05e0\u05e1\"\u05d9\u05dd", "\u05d7\u05d9\u05e0\u05d5\u05da \u05dc\u05d0 \u05e4\u05d5\u05e8\u05de\u05d0\u05dc\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05de\u05d1\u05d5\u05d2\u05e8\u05d9\u05dd", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d5\u05d9\u05d5\u05d6\u05de\u05d5\u05ea", "\u05d7\u05d9\u05e0\u05d5\u05da \u05dc\u05d3\u05de\u05d5\u05e7\u05e8\u05d8\u05d9\u05d4 \u05d5\u05d9\u05d4\u05d3\u05d5\u05ea", "\u05d4\u05d8\u05de\u05e2\u05ea \u05d4\u05e8\u05e4\u05d5\u05e8\u05de\u05d4 \u05d1\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d1\u05d7\u05d9\u05e0\u05d5\u05da \u05e7\u05d3\u05dd \u05d9\u05e1\u05d5\u05d3\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e7\u05d3\u05dd \u05d9\u05e1\u05d5\u05d3\u05d9 (002025)", "\u05d2\u05e0\u05d9 \u05d7\u05d5\u05d1\u05d4", "\u05d2\u05e0\u05d9 \u05d8\u05e8\u05d5\u05dd \u05d7\u05d5\u05d1\u05d4", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05e1\u05d5\u05d3\u05d9 (002026)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05e2\u05d6\u05e8 \u05d1\u05de\u05e2\u05e8\u05db\u05ea", "\u05e9\u05e2\u05d5\u05ea \u05ea\u05e7\u05df-\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05e1\u05d5\u05d3\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05de\u05d9\u05d5\u05d7\u05d3", "\u05d9\u05dc\u05d3\u05d9\u05dd \u05de\u05d7\u05d5\u05e0\u05e0\u05d9\u05dd", "\u05d9\u05d9\u05e9\u05d5\u05dd \u05d7\u05d5\u05e7 \u05d9\u05d5\u05dd \u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05dd", "\u05e9\u05e2\u05d5\u05ea \u05ea\u05e7\u05df \u05d7\u05d8\"\u05d1", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e2\u05dc \u05d9\u05e1\u05d5\u05d3\u05d9 (002027)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05e2\u05d6\u05e8 \u05d1\u05d7\u05d8\"\u05d1", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9 \u05d5\u05de\u05d3\u05e2\u05d9", "\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d1\u05e4\u05e0\u05d9\u05de\u05d9\u05d5\u05ea \u05d5\u05de\u05e8\u05db\u05d6\u05d9\u05e0\u05d5\u05e2\u05e8", "\u05e9\u05db\u05e8 \u05dc\u05d9\u05de\u05d5\u05d3 \u05e2\u05dc \u05d9\u05e1\u05d5\u05d3\u05d9", "\u05d0\u05d2\u05e3 \u05d4\u05d1\u05d7\u05d9\u05e0\u05d5\u05ea", "\u05de\u05dc\u05d2\u05d5\u05ea \u05d5\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05d5\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05e2\u05dc", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e0\u05d5\u05e2\u05e8 \u05de\u05d7\u05d5\u05e0\u05df", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d9\u05d5\u05d6\u05de\u05d5\u05ea \u05d1\u05d7\u05d9\u05e0\u05d5\u05da", "\u05e2\u05d5\u05d1\u05d3\u05d9 \u05d4\u05d0\u05d2\u05e3", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05ea\u05d9\u05e9\u05d1\u05d5\u05ea\u05d9 (002028)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05dd", "\u05d0\u05d7\u05d6\u05e7\u05ea \u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d1\u05e4\u05e0\u05d9\u05de\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05e2\u05d6\u05e8 \u05d1\u05d9\u05e1\u05d5\u05d3\u05d9 \u05d6'-\u05d8'", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d5\u05d4\u05d5\u05e8\u05d0\u05d4-\u05e9\u05db\u05e8 \u05de\u05d5\u05e8\u05d9\u05dd", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8", "\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05de\u05d9 \u05ea\u05de\u05d9\u05db\u05d4", "\u05d1\u05d9\u05d4\"\u05e1 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05d0\u05e9\u05dc", "\u05d9\u05d5\u05d6\u05de\u05d5\u05ea \u05d5\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05d5\u05ea", "\u05d4\u05d5\u05e8\u05d0\u05ea \u05d4\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea \u05d5\u05de\u05e7\u05e6\u05d5\u05e2\u05d5\u05ea", "\u05de\u05e8\u05db\u05d6\u05d9 \u05e0\u05d5\u05e2\u05e8 \u05d5\u05d1\u05ea\u05d9\"\u05e1", "\u05e9\u05e2\u05d5\u05e8\u05d9 \u05e2\u05d6\u05e8 \u05d5\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d8\u05e4\u05d5\u05d7", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e2\u05e6\u05de\u05d0\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05e2\u05e6\u05de\u05d0\u05d9 \u05d5\u05de\u05d5\u05db\u05e8 (002029)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05e2\u05e6\u05de\u05d0\u05d9", "\u05d7\u05d9\u05e0\u05d5\u05da \u05de\u05d5\u05db\u05e8 \u05d0\u05d7\u05e8", "\u05de\u05e2\u05d9\u05d9\u05df \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05ea\u05d5\u05e8\u05e0\u05d9", "\u05d9\u05e9\u05d5\u05d1\u05d9\u05dd \u05e0\u05ea\u05de\u05db\u05d9\u05dd", "\u05d4\u05e1\u05e2\u05d5\u05ea \u05d4\u05e6\u05d8\u05d9\u05d9\u05d3\u05d5\u05ea \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 (002030)", "\u05d9\u05d9\u05e2\u05d5\u05e5 \u05d5\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05d1\u05e0\u05d9\u05d4 \u05d1\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05d4\u05e1\u05e2\u05ea \u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd", "\u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8 \u05d7\u05e7\u05dc\u05d0\u05d9\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05dc\u05d8\u05dc\u05d5\u05d9\u05d6\u05d9\u05d4 \u05d4\u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05ea", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05d1\u05e0\u05d9 \u05ea\u05e8\u05d1\u05d5\u05ea \u05e1\u05e4\u05d5\u05e8\u05d8 \u05de\u05ea\u05e0\"\u05e1\u05d9\u05dd \u05d5\u05e0\u05d5\u05e2\u05e8", "\u05e9\u05d9\u05e4\u05d5\u05e5 \u05de\u05d1\u05e0\u05d9 \u05d7\u05d9\u05e0\u05d5\u05da", "\u05e9\u05d9\u05e4\u05d5\u05e6\u05d9\u05dd \u05d5\u05d4\u05e6\u05d8\u05d9\u05d9\u05d3\u05d5\u05ea \u05d1\u05d1\u05d9\"\u05e1", "\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05dc\u05d4\u05e9\u05db\u05dc\u05d4", "\u05ea\u05e8\u05d1\u05d5\u05ea (002031)", "\u05ea\u05e8\u05d1\u05d5\u05ea \u05d9\u05d4\u05d5\u05d3\u05d9\u05ea", "\u05d8\u05dc\u05d5\u05d9\u05d6\u05d9\u05d4 \u05d7\u05d9\u05e0\u05d5\u05db\u05d9\u05ea (002033)", "\u05d4\u05e4\u05e7\u05d5\u05ea \u05e2\u05e6\u05de\u05d9\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05d9\u05d3\u05d5\u05e8", "\u05d4\u05e0\u05d4\u05dc\u05d4 \u05d5\u05db\u05dc\u05dc\u05d9\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05db\u05d5\u05dc\u05dc\u05d9\u05dd", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05ea\u05d5\u05e8\u05e0\u05d9\u05d9\u05dd (002038)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d5\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05ea\u05d5\u05e8\u05d4", "\u05de\u05dc\u05d2\u05ea \u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05dd \u05dc\u05d0\u05d1\u05e8\u05db\u05d9\u05dd \u05d4\u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05d1\u05db\u05d5\u05dc\u05dc", "\u05db\u05d1\u05d9\u05e9\u05d9\u05dd \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9\u05d9\u05dd (007930)", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e6\u05e4\u05d5\u05df \u05d4\u05d7\u05dc\u05d8\u05d4 561", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05d3\u05e8\u05d5\u05dd \u05d4\u05d7\u05dc\u05d8\u05d4 747", "\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd - \u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05e1\u05e2\u05ea", "\u05d4\u05e1\u05e2\u05ea \u05d4\u05de\u05d5\u05e0\u05d9\u05dd \u05d5\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 (007931)", "\u05de\u05d8\u05e8\u05d5\u05e4\u05d5\u05dc\u05d9\u05df \u05ea\u05dc-\u05d0\u05d1\u05d9\u05d1 -", "\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea\u05d9\u05d5\u05ea \u05e2\u05dc \u05e4\u05d9 \u05de\u05d5\u05d3\u05dc \u05d4\u05e7\u05e6\u05d0\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05ea (007801)", "\u05ea\u05e7\u05e6\u05d5\u05d1 \u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05e2\u05e4\"\u05d9 \u05d4\u05d7\u05dc\u05d8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05d4", "\u05d4\u05d2\u05e0\u05d5\u05ea \u05d9\u05dd \u05d4\u05de\u05dc\u05d7", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05d5\u05de\u05d8\u05d4 (001101)", "\u05ea\u05db\u05e0\u05d5\u05df \u05e2\u05e8\u05d9\u05db\u05d4 \u05d5\u05d9\u05e2\u05d5\u05e5", "\u05d0\u05d5\u05e8\u05d7\u05d9\u05dd \u05d5\u05e9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9", "\u05d4\u05d3\u05e8\u05db\u05d4", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05e9\u05d9\u05d0 \u05db\"\u05d0", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05e8\u05db\u05d9\u05e9\u05d5\u05ea", "\u05d1\u05e7\u05d5\u05e8\u05ea \u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05de\u05e9\u05dc\u05d4 \u05d5\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05de\u05d3\u05d9\u05e0\u05d4", "\u05d1\u05d9\u05e6\u05d5\u05e2 \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea (001102)", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d1\u05d8\u05d7\u05d5\u05df", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e2.\u05e0.\u05d0", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05ea\u05dc\u05d5\u05e0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 (001103)", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05ea\u05dc\u05d5\u05e0\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d7\u05d3 \u05e4\u05e2\u05de\u05d9\u05d5\u05ea (001104)", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e2\u05dc \u05de\u05d9\u05de\u05d5\u05df \u05d1\u05d7\u05d9\u05e8\u05d5\u05ea - \u05ea\u05e9\u05dc\u05d5\u05dd \u05dc\u05e8\u05d5\u05d0\u05d9 \u05d7\u05e9\u05d1\u05d5\u05df", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05de\u05d9\u05de\u05d5\u05df \u05d1\u05d7\u05d9\u05e8\u05d5\u05ea", "\u05d3\u05d9\u05d5\u05e8 \u05d5\u05d1\u05d9\u05e0\u05d5\u05d9", "\u05e8\u05db\u05d9\u05e9\u05ea \u05db\u05dc\u05d9 \u05e8\u05db\u05d1", "\u05d4\u05e7\u05de\u05ea \u05dc\u05e9\u05db\u05d4 \u05d1\u05e8\u05de\u05dc\u05d4 \u05d5\u05e9\u05dc\u05d5\u05d7\u05d4 \u05d1\u05e0\u05e6\u05e8\u05ea \u05e2\u05d9\u05dc\u05d9\u05ea", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (003901)", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05d0\u05e8\u05d2\u05d5\u05df", "\u05db\u05dc\u05db\u05dc\u05d4 \u05d5\u05ea\u05e7\u05e6\u05d9\u05d1\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e2\u05e4\"\u05d9 \u05d7\u05d5\u05e7 \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05de\u05d5\"\u05e4 \u05d1\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4", "\u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e2\u05e9\u05d9\u05d9\u05ea\u05d9 (003802)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e9\u05dc\u05d1\u05d9 \u05de\u05d5\"\u05e4 \u05de\u05d5\u05e7\u05d3\u05de\u05d9\u05dd", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05de\u05d5\"\u05e4 \u05d5\u05de\u05db\u05d5\u05e0\u05d9 \u05de\u05d7\u05e7\u05e8", "\u05de\u05d5\"\u05e4 \u05d1\u05d9\u05df \u05dc\u05d0\u05d5\u05de\u05d9", "\u05d1\u05d3\u05d9\u05e7\u05ea \u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9\u05dd \u05d5\u05de\u05e0\u05d4\u05dc\u05d5\u05ea", "\u05d7\u05d5\u05e0\u05db\u05d5\u05ea", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05e2\u05e1\u05e7\u05d9\u05dd \u05e7\u05d8\u05e0\u05d9\u05dd (003812)", "\u05de\u05d9\u05de\u05d5\u05e9\u05d9 \u05e2\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea \u05de\u05d3\u05d9\u05e0\u05d4 \u05d5\u05d1\u05e7\u05e8\u05d4 \u05e2\u05dc \u05e2\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea - \u05e2\u05e1\u05e7\u05d9\u05dd \u05e7\u05d8\u05e0\u05d9\u05dd", "\u05e7\u05e8\u05df \u05e1\u05d9\u05d5\u05e2 \u05dc\u05e2\u05e1\u05e7\u05d9\u05dd \u05e7\u05d8\u05e0\u05d9\u05dd", "\u05de\u05db\u05e8\u05d6\u05d9 \u05d4\u05e2\u05e1\u05e7\u05d4 \u05d1\u05de\u05e4\u05e2\u05dc\u05d9\u05dd", "\u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea -\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4 (003819)", "\u05e2\u05ea\u05d5\u05d3\u05d4 \u05dc\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05ea\u05e2\u05e1\u05d5\u05e7\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d6\u05d5\u05e8\u05d9 \u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 \u05d7\u05d3\u05e9\u05d9\u05dd \u05d1\u05d0\u05d9\u05d6\u05d5\u05e8\u05d9 \u05e4\u05d9\u05ea\u05d5\u05d7", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 (007601)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d6\u05d5\u05e8\u05d9 \u05ea\u05e2\u05e9\u05d9\u05d9\u05d4", "\u05d4\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d7\u05d9\u05e4\u05d4 \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05d4\u05e0\u05d2\u05d1", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05db\u05dc\u05dc\u05d9\u05d9\u05dd (001901)", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05e7\u05e9\u05e8\u05d9\u05dd \u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9\u05d9\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05d3\u05e2 (001904)", "\u05de\u05d7\u05e7\u05e8\u05d9\u05dd, \u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05d5\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05de\u05d3\u05e2", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05de\u05d3\u05e2\u05d9\u05d5\u05ea", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d6\u05e8\u05d7\u05d9", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e0\u05d4\u05d9\u05d2\u05d4 \u05e1\u05e4\u05d5\u05e8\u05d8\u05d9\u05d1\u05d9\u05ea", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05e1\u05e4\u05d5\u05e8\u05d8 (001937)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d5\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e1\u05e4\u05d5\u05e8\u05d8", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e8\u05d2\u05d9\u05dc", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d8\u05d1\u05e2 \u05d5\u05d4\u05d2\u05e0\u05d9\u05dd (005403)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d2\u05d6 \u05d4\u05d8\u05d1\u05e2\u05d9 (005405)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05e8\u05e9\u05d5\u05ea", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (003001)", "\u05d4\u05e0\u05d4\u05dc\u05ea \u05d4\u05de\u05e9\u05e8\u05d3 - \u05d4\u05e1\u05d1\u05e8\u05d4", "\u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05de\u05d7\u05e7\u05e8", "\u05de\u05d9\u05d3\u05e2 \u05dc\u05e2\u05d5\u05dc\u05d9\u05dd", "\u05e7\u05d1\u05dc\u05ea \u05e2\u05d5\u05dc\u05d9\u05dd \u05d5\u05d4\u05e1\u05e2\u05ea\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05e7\u05dc\u05d9\u05d8\u05d4 (003002)", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea \u05d9\u05d7\u05d5\u05d3\u05d9\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e2\u05dd \u05e0\u05d5\u05e2\u05e8 \u05e2\u05d5\u05dc\u05d4", "\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05dc\u05e2\u05d5\u05dc\u05d9\u05dd \u05e7\u05e9\u05d9\u05e9\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05e2\u05e1\u05e7\u05d4 \u05d1\u05e1\u05e7\u05d8\u05d5\u05e8 \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8\u05d9", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05ea\u05e2\u05e1\u05d5\u05e7\u05ea \u05e2\u05d5\u05dc\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05d0\u05de\u05e0\u05d9\u05dd \u05d5\u05e1\u05e4\u05d5\u05e8\u05d8\u05d0\u05d9\u05dd \u05e2\u05d5\u05dc\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05ea\u05e2\u05e1\u05d5\u05e7\u05ea \u05e2\u05d5\u05dc\u05d9\u05dd \u05e2\u05e6\u05de\u05d0\u05d9\u05d9\u05dd - \u05d9\u05d6\u05de\u05d5\u05ea \u05e2\u05e1\u05e7\u05d9\u05ea", "\u05e7\u05dc\u05d9\u05d8\u05ea \u05d4\u05d1\u05d0\u05d9\u05dd \u05de\u05d0\u05ea\u05d9\u05d5\u05e4\u05d9\u05d4 \u05d1\u05d0\u05ea\u05e8\u05d9\u05dd \u05d6\u05de\u05e0\u05d9\u05d9\u05dd \u05d5\u05d1\u05d3\u05d9\u05d5\u05e8 \u05e7\u05d1\u05e2", "\u05d3\u05de\u05d9 \u05e7\u05d9\u05d5\u05dd \u05d1\u05e7\u05d5\u05e8\u05e1\u05d9\u05dd, \u05d1\u05de\u05e8\u05db\u05d6\u05d9 \u05d4\u05db\u05d5\u05d5\u05e0\u05d4, \u05d1\u05d0\u05d5\u05dc\u05e4\u05e0\u05d9\u05dd, \u05d4\u05d1\u05d8\u05d7\u05d4 \u05d5\u05d4\u05e9\u05dc\u05de\u05ea \u05d4\u05db\u05e0\u05e1\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e7\u05dc\u05d9\u05d8\u05d4 \u05d1\u05e7\u05d4\u05d9\u05dc\u05d4 \u05d5\u05e9\u05d9\u05dc\u05d5\u05d1 \u05ea\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea", "\u05e7\u05dc\u05d9\u05d8\u05d4 \u05d7\u05d1\u05e8\u05ea\u05d9\u05ea (003004)", "\u05dc\u05d9\u05de\u05d5\u05d3\u05d9 \u05d9\u05d4\u05d3\u05d5\u05ea", "\u05e7\u05dc\u05d9\u05d8\u05d4 \u05d9\u05e9\u05d9\u05e8\u05d4 \u05de\u05d0\u05e8\u05e6\u05d5\u05ea \u05de\u05e6\u05d5\u05e7\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e7\u05dc\u05d9\u05d8\u05d4 \u05d9\u05e9\u05d9\u05e8\u05d4 (003005)", "\u05de\u05e7\u05d1\u05e6\u05d9 \u05d3\u05d9\u05d5\u05e8 - \u05d4\u05e9\u05dc\u05de\u05ea \u05e9\u05db\u05e8 \u05d3\u05d9\u05e8\u05d4 \u05dc\u05e0\u05d6\u05e7\u05e7\u05d9\u05dd", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05e0\u05d4\u05d5\u05dc \u05d5\u05de\u05d8\u05d4", "\u05e7\u05dc\u05d9\u05d8\u05ea \u05de\u05d3\u05e2\u05e0\u05d9\u05dd (003006)", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05de\u05dc\u05d2\u05d5\u05ea \u05dc\u05de\u05d3\u05e2\u05e0\u05d9\u05dd \u05e2\u05d5\u05dc\u05d9\u05dd", "\u05ea\u05db\u05e0\u05d9\u05ea \u05e7\u05dc\u05d9\u05d8\u05ea \u05de\u05d3\u05e2\u05e0\u05d9\u05dd \u05e2\u05d5\u05dc\u05d9\u05dd (\u05e7\u05de\"\u05e2)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea", "\u05d1\u05e0\u05d9\u05d9\u05ea \u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05de\u05e9\u05dc\u05d4 (005101)", "\u05d1\u05e0\u05d9\u05d9\u05ea \u05e7\u05e8\u05d9\u05ea \u05d4\u05dc\u05d0\u05d5\u05dd", "\u05d1\u05e0\u05d9\u05d9\u05ea \u05e7\u05e8\u05d9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05d4", "\u05e8\u05db\u05d9\u05e9\u05d4 \u05d5\u05de\u05db\u05d9\u05e8\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd (003601)", "\u05de\u05e2\u05e8\u05da \u05d4\u05e1\u05d1\u05e8\u05d4 \u05d5\u05d9\u05d7\u05e1\u05d9 \u05e6\u05d9\u05d1\u05d5\u05e8", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05de\u05de\u05d5\u05e0\u05d4 \u05e2\u05dc \u05d4\u05ea\u05e7\u05d9\u05e0\u05d4", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05db\u05dc\u05dc\u05d9\u05d9\u05dd (003602)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05de\u05e0\u05d4\u05dc\u05d9 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 \u05d5\u05e7\u05e8\u05df \u05d4\u05e9\u05d9\u05d5\u05d5\u05e7", "\u05d4\u05de\u05e2\u05d1\u05d3\u05d4 \u05dc\u05e4\u05d9\u05e1\u05d9\u05e7\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05de\u05e8\u05db\u05d6 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05e1\u05d7\u05e8 \u05e4\u05e0\u05d9\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05dc\u05e6\u05e8\u05db\u05df", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05dc\u05de\u05d7\u05e7\u05e8 \u05ea\u05e2\u05e9\u05d9\u05d9\u05ea\u05d9 - \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd", "\u05de\u05d8\u05d4 \u05dc\u05e7\u05d9\u05d3\u05d5\u05dd \u05e2\u05e1\u05e7\u05d9\u05dd", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05e1\u05d7\u05e8 \u05d7\u05d5\u05e5 (003606)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d9\u05e0\u05d4\u05dc \u05e1\u05d7\u05e8 \u05d7\u05d5\u05e5", "\u05e0\u05e6\u05d9\u05d2\u05d5\u05d9\u05d5\u05ea \u05de\u05e1\u05d7\u05e8\u05d9\u05d5\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05de\u05de\u05d5\u05e0\u05d4 \u05e2\u05dc \u05d4\u05d4\u05d9\u05e6\u05e3", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d9\u05e6\u05d5\u05d0", "\u05e8\u05e9\u05d5\u05ea \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05ea\u05e2\u05e9\u05d9\u05d9\u05ea\u05d9", "\u05d9\u05d7\u05e1\u05d9 \u05e2\u05d1\u05d5\u05d3\u05d4", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05d5\u05d0\u05db\u05d9\u05e4\u05d4 \u05d1\u05e9\u05d5\u05e7 \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4 (003613)", "\u05d0\u05d9\u05d2\u05d5\u05d3 \u05e9\u05d9\u05ea\u05d5\u05e4\u05d9", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d1\u05d8\u05d9\u05d7\u05d5\u05ea", "\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea \u05ea\u05e2\u05e1\u05d5\u05e7\u05ea\u05d9\u05ea", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d7\u05d5\u05e7\u05d9 \u05e2\u05d1\u05d5\u05d3\u05d4", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05dc\u05e9\u05d5\u05d5\u05d9\u05d5\u05df \u05d1\u05e2\u05d1\u05d5\u05d3\u05d4", "\u05e9\u05d9\u05dc\u05d5\u05d1 \u05de\u05d5\u05d2\u05d1\u05dc\u05d9\u05dd \u05e9\u05d5\u05e7 \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4", "\u05db\u05d7 \u05d0\u05d3\u05dd \u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05d4\u05db\u05d5\u05d5\u05e0\u05d4 (003614)", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05ea\u05db\u05e0\u05d5\u05df \u05db\u05d7 \u05d0\u05d3\u05dd", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05db\u05d7 \u05d0\u05d3\u05dd \u05d1\u05e9\u05e2\u05ea \u05d7\u05d9\u05e8\u05d5\u05dd", "\u05d4\u05d0\u05d2\u05e3 \u05dc\u05ea\u05e2\u05e1\u05d5\u05e7\u05ea \u05e0\u05e9\u05d9\u05dd", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05ea\u05e2\u05e1\u05d5\u05e7\u05d4 \u05d7\u05d3 \u05d4\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05e9\u05d9\u05dc\u05d5\u05d1 \u05de\u05e7\u05d1\u05dc\u05d9 \u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05d1\u05e2\u05d1\u05d5\u05d3\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea \u05d1\u05e9\u05d5\u05e7 \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4 (003615)", "\u05dc\u05e9\u05db\u05d5\u05ea \u05e9\u05e8\u05d5\u05ea \u05d4\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea", "\u05db\u05dc\u05d9\u05dd \u05ea\u05d5\u05de\u05db\u05d9 \u05d4\u05e9\u05de\u05d4", "\u05d4\u05db\u05e9\u05e8\u05d4 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05ea \u05dc\u05de\u05d5\u05d1\u05d8\u05dc\u05d9\u05dd \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05e9\u05d5\u05d1\u05e8\u05d9\u05dd", "\u05de\u05d8\u05d4 \u05d4\u05d0\u05d2\u05e3", "\u05d0\u05d2\u05e3 \u05dc\u05d4\u05db\u05e9\u05e8\u05d4 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05ea (003617)", "\u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e4\u05d3\u05d2\u05d5\u05d2\u05d9\u05d9\u05dd", "\u05e8\u05e9\u05d5\u05dd \u05d7\u05e9\u05de\u05dc\u05d0\u05d9\u05dd", "\u05de\u05d8\u05d4 \u05d4\u05db\u05e9\u05e8\u05ea \u05d8\u05db\u05e0\u05d0\u05d9\u05dd", "\u05de\u05d8\u05d4 \u05d4\u05db\u05e9\u05e8\u05ea \u05e0\u05d5\u05e2\u05e8", "\u05de\u05e8\u05db\u05d6\u05d9 \u05d4\u05db\u05e9\u05e8\u05d4 \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd", "\u05e7\u05d5\u05e8\u05e1\u05d9\u05dd \u05dc\u05de\u05d1\u05d5\u05d2\u05e8\u05d9\u05dd", "\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05de\u05d1\u05d5\u05d2\u05e8\u05d9\u05dd", "\u05d4\u05db\u05e9\u05e8\u05ea \u05d4\u05e0\u05d3\u05e1\u05d0\u05d9\u05dd \u05d5\u05d8\u05db\u05e0\u05d0\u05d9\u05dd", "\u05d4\u05db\u05e9\u05e8\u05d4 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05ea - \u05e0\u05d5\u05e2\u05e8", "\u05d4\u05db\u05e9\u05e8\u05ea \u05e0\u05d5\u05e2\u05e8 \u05e4\u05e8 \u05ea\u05dc\u05de\u05d9\u05d3", "\u05d0\u05d9\u05de\u05d5\u05df \u05de\u05e7\u05e6\u05d5\u05e2\u05d9 \u05dc\u05e0\u05d5\u05e2\u05e8", "\u05e8\u05db\u05d9\u05e9\u05d4 \u05d5\u05e4\u05ea\u05d5\u05d7 \u05d0\u05de\u05e6\u05e2\u05d9\u05dd", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 - \u05de\u05e9\u05d8\u05e8\u05d4 (005201)", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05d1\u05de\u05d7\u05e9\u05d5\u05d1", "\u05d4\u05e7\u05de\u05d4 \u05d5\u05e9\u05d9\u05e4\u05d5\u05e5 \u05de\u05d1\u05e0\u05d9 \u05de\u05e9\u05d8\u05e8\u05d4", "\u05e7\u05e9\u05e8 \u05d5\u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05ea\u05d9 \u05e1\u05d5\u05d4\u05e8 (005203)", "\u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9\u05dd \u05d1\u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e4\u05e0\u05d9\u05dd", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 - \u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e4\u05e0\u05d9\u05dd (005210)", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05dc\u05d1\u05d9\u05e0\u05d5\u05d9 \u05d1\u05de\u05e9\u05d8\u05e8\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd \u05de\u05db\u05d7 \u05d4\u05e1\u05de\u05db\u05d5\u05ea \u05d4\u05e9\u05d9\u05d5\u05e8\u05d9\u05ea", "\u05e4\u05d9\u05e6\u05d5\u05d9 \u05dc\u05d0\u05e1\u05d5\u05e0\u05d5\u05ea \u05d8\u05d1\u05e2 (003312)", "\u05e4\u05d9\u05e6\u05d5\u05d9 \u05e2\u05e4\"\u05d9 \u05d7\u05d5\u05e7 \u05e0\u05e4\u05d2\u05e2\u05d9 \u05d0\u05e1\u05d5\u05e0\u05d5\u05ea \u05d8\u05d1\u05e2 \u05d1\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea", "\u05de\u05d8\u05d4 \u05d4\u05de\u05e9\u05e8\u05d3", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (003321)", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05db\u05e4\u05e8", "\u05d4\u05d2\u05e0\u05ea \u05d4\u05e6\u05d5\u05de\u05d7", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05dc\u05d7\u05e7\u05dc\u05d0\u05d9\u05dd (003322)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05d5\u05d8\u05e8\u05d9\u05e0\u05e8\u05d9\u05dd", "\u05d3\u05d9\u05d9\u05d2", "\u05e9\u05de\u05d5\u05e8 \u05d4\u05e7\u05e8\u05e7\u05e2", "\u05de\u05d7\u05d5\u05d6\u05d5\u05ea", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05e6\u05d5\u05de\u05d7 \u05d5\u05d4\u05d7\u05d9 (\u05e4\u05d9\u05e6\u05d5\"\u05d7)", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05d4\u05d3\u05e8\u05db\u05d4 \u05d5\u05d4\u05de\u05e7\u05e6\u05d5\u05e2 (003323)", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05d9\u05d5\u05ea \u05de\u05e9\u05e8\u05d3\u05d9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05d9\u05d5\u05ea (003325)", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05de\u05d2\u05d6\u05e8\u05d9 \u05d4\u05de\u05e2\u05d5\u05d8\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea (003327)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05e9\u05dc\u05d9\u05de\u05d9\u05dd", "\u05d1\u05d3\u05d9\u05e7\u05ea \u05ea\u05db\u05e0\u05d9\u05d5\u05ea", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e8\u05e4\u05d5\u05e8\u05de\u05d4 \u05d1\u05e8\u05e4\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e9\u05d9\u05e7\u05d5\u05dd \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05d4\u05d3\u05e8\u05d5\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05d4\u05ea\u05d9\u05d9\u05e2\u05dc\u05d5\u05ea \u05d1\u05e2\u05e0\u05e3 \u05d4\u05d8\u05dc\u05ea \u05d1\u05d9\u05e6\u05d9 \u05d4\u05de\u05d0\u05db\u05dc", "\u05de\u05e8\u05d7\u05d1 \u05d4\u05e6\u05e4\u05d5\u05df", "\u05d7\u05d8\u05d9\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e9\u05d1\u05d5\u05ea (003328)", "\u05de\u05e8\u05d7\u05d1 \u05de\u05e8\u05db\u05d6", "\u05de\u05e8\u05d7\u05d1 \u05e6\u05e4\u05d5\u05df - \u05d0\u05d6\u05d5\u05e8 \u05d4\u05d2\u05dc\u05d9\u05dc", "\u05de\u05e8\u05d7\u05d1 \u05de\u05e8\u05db\u05d6 - \u05d4\u05e8 \u05d7\u05d1\u05e8\u05d5\u05df", "\u05de\u05e8\u05d7\u05d1 \u05d3\u05e8\u05d5\u05dd - \u05d0\u05d6\u05d5\u05e8 \u05e0\u05d2\u05d1", "\u05de\u05d8\u05d4 \u05d5\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea", "\u05de\u05d3\u05e2\u05df \u05e8\u05d0\u05e9\u05d9 - \u05de\u05d7\u05e7\u05e8\u05d9\u05dd", "\u05de\u05d3\u05e2\u05df \u05e8\u05d0\u05e9\u05d9 (003331)", "\u05e7\u05e8\u05df \u05e7\u05de\"\u05d7 - \u05e7\u05e8\u05df \u05dc\u05de\u05d7\u05e7\u05e8", "\u05de\u05d3\u05e2\u05df \u05e8\u05d0\u05e9\u05d9 - \u05de\u05d7\u05e7\u05e8\u05d9\u05dd \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05d9\u05dd", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05d5\u05ea (003334)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05db\u05e4\u05e8 - \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05de\u05d5\u05e8 \u05e7\u05e8\u05e7\u05e2 - \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05d4\u05d3\u05e8\u05db\u05d4 \u05d5\u05d4\u05de\u05e7\u05e6\u05d5\u05e2 - \u05e0\u05d9\u05e1\u05d5\u05d9\u05d9\u05dd \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05d9\u05dd", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05d0\u05d7\u05d6\u05e7\u05ea \u05de\u05d1\u05e0\u05d9\u05dd - \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05d0\u05d7\u05d6\u05e7\u05ea \u05de\u05d1\u05e0\u05d9\u05dd - \u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d9", "\u05e1\u05d5\u05e4\u05ea \u05d7\u05d5\u05dc", "\u05de\u05d9\u05d2\u05d5\u05df \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d4 (\u05d0\u05d1\"\u05db) (001602)", "\u05e8\u05db\u05e9 \u05e6\u05d9\u05d5\u05d3 \u05d0\u05d1\"\u05db", "\u05de\u05e2\u05e0\u05d4 \u05e8\u05e4\u05d5\u05d0\u05d9", "\u05de\u05e8\u05db\u05d6 \u05d7\u05d5\u05de\u05e8\u05d9\u05dd \u05de\u05e1\u05d5\u05db\u05e0\u05d9\u05dd", "\u05ea\u05e7\u05df \u05e7\u05d1\u05e2 \u05d9\u05e2\u05d5\u05d3\u05d9 \u05d5\u05ea\u05e4\u05e2\u05d5\u05dc", "\u05de\u05e8\u05db\u05d9\u05d1\u05d9 \u05d1\u05d9\u05d8\u05d7\u05d5\u05df (001610)", "\u05ea\u05db\u05e0\u05d9\u05d5\u05ea \u05de\u05d9\u05e7\u05dc\u05d5\u05d8, \u05de\u05d9\u05d2\u05d5\u05df", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d2\u05d0\u05d5\u05ea \u05d5\u05e9\u05e4\u05dc-\u05de\u05d9\u05d2\u05d5\u05df", "\"\u05d0\u05d6\u05d5\u05e8\u05d9\u05dd \u05d1\u05d8\u05d7\u05d5\u05e0\u05d9\u05d9\u05dd", "\u05d0\u05d7\u05d6\u05e7\u05ea \u05de\u05e8\u05db\u05d9\u05d1\u05d9 \u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05de\u05d9\u05d2\u05d5\u05df \u05d9\u05d9\u05e9\u05d5\u05d1\u05d9 \u05e1\u05d5\u05d1\u05d1 \u05e2\u05d6\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d7\u05e7\u05e8 \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea (002103)", "\u05d4\u05e7\u05e8\u05df \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05de\u05d3\u05e2", "\u05de\u05db\u05d9\u05e0\u05d5\u05ea \u05e7\u05d3\u05dd \u05d0\u05e7\u05d3\u05de\u05d9\u05d5\u05ea", "\u05de\u05e8\u05db\u05d6 \u05d4\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05e9\u05d5\u05d8\u05e4\u05d9\u05dd \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea (001801)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05d4\u05ea\u05d9\u05e9\u05d1\u05d5\u05ea \u05e6\u05e2\u05d9\u05e8\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d4\u05d1\u05e8\u05d0\u05d4", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea \u05d1\u05e6\u05e4\u05d5\u05df \u05d5\u05d1\u05d0\u05d6\u05d5\u05e8 \u05e9\u05d3\u05e8\u05d5\u05ea \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d4\u05d7\u05dc\u05d8\u05ea \u05de\u05de\u05e9\u05dc\u05d4 561", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d9\u05d5\u05e2\u05d3\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d9\u05d5\u05e2\u05d3\u05d9\u05dd \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea (001803)", "\u05d1\u05d8\u05d7\u05d5\u05df \u05d1\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05d4\u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05d4\u05d3\u05e8\u05db\u05d4 \u05de\u05d7\u05e7\u05e8\u05d9\u05dd \u05d5\u05d9\u05d9\u05e2\u05d5\u05e5", "\u05d0\u05d9\u05d2\u05d5\u05d3\u05d9 \u05db\u05d1\u05d0\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e7\u05e8\u05d9\u05d5\u05ea \u05d7\u05d9\u05e0\u05d5\u05da", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05de\u05e7\u05d5\u05e4\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea (001211)", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05e2\u05e4\"\u05d9 \u05d4\u05e1\u05db\u05de\u05d9\u05dd", "\u05e8\u05d6\u05e8\u05d1\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05e9\u05e8\u05d3 \u05dc\u05d9\u05d5\"\u05e8 \u05db\u05e0\u05e1\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e1\u05e2\u05d9\u05e3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e9\u05e8\u05d3", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05e2\u05d9\u05d1\u05d5\u05d3\u05d9\u05dd \u05de\u05de\u05d5\u05db\u05e0\u05d9\u05dd", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05d4\u05d0\u05e8\u05e6\u05d9\u05ea \u05dc\u05e4\u05d9\u05e7\u05d5\u05d7", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05db\u05d5\u05dc\u05dc\u05ea", "\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d5\u05e6\u05d0\u05d4 \u05dc\u05e4\u05d5\u05e2\u05dc", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea \u05e8\u05d6\u05e8\u05d1\u05d4", "\u05d1\u05d8\u05d7\u05d5\u05df", "\u05e4\u05d9\u05e0\u05d5\u05d9 \u05de\u05d5\u05e7\u05e9\u05d9\u05dd", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd", "\u05de\u05e2\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05dc\u05e0\u05d2\u05d1", "\u05db\u05d9\u05d1\u05d5\u05d9 \u05d0\u05e9 \u05de\u05d4\u05d0\u05d5\u05d9\u05e8", "\u05e2\u05d5\u05e8\u05e3 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05d4\u05d2\u05e0\u05ea \u05d4\u05e2\u05d5\u05e8\u05e3", "\u05de\u05e4\u05e7\u05d3\u05ea \u05ea\u05d9\u05d0\u05d5\u05dd \u05d5\u05e7\u05d9\u05e9\u05d5\u05e8", "\u05d4\u05de\u05e0\u05d4\u05dc \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9 \u05d1\u05d0\u05d6\u05d5\u05e8", "\u05de\u05e0\u05d4\u05dc\u05ea \u05ea\u05d9\u05d0\u05d5\u05dd \u05d4\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea", "\u05de\u05e4\u05e7\u05d3\u05ea \u05ea\u05d9\u05d0\u05d5\u05dd \u05d5\u05e7\u05d9\u05e9\u05d5\u05e8 \u05d7\u05d1\u05dc", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05d3\u05e2, \u05d4\u05ea\u05e8\u05d1\u05d5\u05ea (0019)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e2\u05dd \u05de\u05e9\u05e8\u05d3\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05dc\u05d4\u05e9\u05db\u05dc\u05d4", "\u05e0\u05d5\u05e2\u05e8 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea", "\u05e2\u05ea\u05d5\u05d3\u05d4 \u05dc\u05d4\u05e1\u05db\u05de\u05d9 \u05ea\u05e7\u05d9\u05e0\u05d4", "\u05ea\u05d2\u05de\u05d5\u05dc\u05d9\u05dd \u05dc\u05e0\u05db\u05d9\u05dd (0025)", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05dc \u05e4\u05d9", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05e9\u05db\u05d5\u05e0\u05ea\u05d9 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7 \u05e6\u05e2\u05e8", "\u05e9\u05d9\u05ea\u05d5\u05e4\u05d9 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d1\u05d9\u05df", "\u05d4\u05d7\u05d1\u05e8\u05d4 \u05dc\u05d4\u05e7\u05de\u05ea \u05d4\u05e9\u05d5\u05e7", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8 \u05dc\u05de\u05d3\u05e2\u05d9", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df,", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05d5\u05d0\u05db\u05d9\u05e4\u05d4 \u05d1\u05e9\u05d5\u05e7", "\u05d4\u05db\u05e9\u05e8\u05ea \u05db\u05d7 \u05d0\u05d3\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc \u05dc\u05e9\u05d9\u05d5\u05d5\u05e7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05ea\u05de\u05d9\u05db\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d2\u05d5\u05e4\u05d9\u05dd \u05d4\u05de\u05e7\u05d3\u05de\u05d9\u05dd", "\u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05dc\u05e9\u05d9\u05d3\u05d5\u05e8\u05d9 \u05db\u05d1\u05dc\u05d9\u05dd", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc\u05ea \u05dc\u05d4\u05e1\u05d3\u05e8\u05ea", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05d5\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05ea\u05d7\u05e8\u05d5\u05ea", "\u05e8\u05e9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea \u05dc\u05de\u05d9\u05dd (0041)", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05db\u05dc\u05dc\u05d9\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05db\u05dc\u05dc\u05d9\u05ea (0047)", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e2\u05de\u05d9\u05d3\u05d4 \u05d1\u05d9\u05e2\u05d3", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df- (0052)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 - \u05de\u05e9\u05e8\u05d3", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea", "\u05d0\u05d5\u05e6\u05e8-\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 - \u05d0\u05d5\u05e6\u05e8", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05d9\u05e1\u05d9\u05dd", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05db\u05dc\u05dc\u05d5\u05ea \u05dc\u05d4\u05db\u05e9\u05e8\u05ea", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8 \u05de\u05d9\u05d7\u05e9\u05d5\u05d1 \u05de\u05e8\u05db\u05d6\u05d9", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05dd", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df, \u05d4\u05d4\u05d2\u05d9\u05e8\u05d4 (0068)", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d0\u05d1, \u05e0\u05d9\u05d4\u05d5\u05dc", "\u05de\u05d9\u05de\u05d5\u05df \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d4\u05d1\u05e8\u05d0\u05d4", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 (0089)", "\u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05dd", "\u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05dd (0094)", "\u05e0\u05de\u05dc \u05d7\u05d3\u05e8\u05d4", "\u05e0\u05de\u05dc \u05d7\u05d3\u05e8\u05d4 (0095)", "\u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea \u05d5\u05e0\u05db\u05e1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d0\u05d2\u05e3 \u05d0\u05d5\"\u05dd \u05d5\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05d5\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d5\u05d1\u05d9\u05e0\u05d5\u05d9 \u05e0\u05e6\u05d9\u05d2\u05d5\u05d9\u05d5\u05ea", "\u05ea\u05e7\u05d9\u05e0\u05d4, \u05ea\u05e4\u05e2\u05d5\u05dc \u05d5\u05d0\u05d9\u05db\u05d5\u05ea", "\u05d4\u05db\u05e9\u05e8\u05ea \u05db\u05d7 \u05d0\u05d3\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 (003702)", "\u05d4\u05de\u05e8\u05db\u05d6 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05de\u05e7\u05d5\u05de\u05d5\u05ea", "\u05d4\u05de\u05d9\u05e0\u05d4\u05dc \u05dc\u05e9\u05d9\u05d5\u05d5\u05e7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea (003703)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05db\u05dc\u05dc\u05d9\u05d5\u05ea, \u05e9\u05db\u05e8", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d9\u05d5\u05d5\u05e7 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05ea\u05db\u05e0\u05d5\u05df, \u05e4\u05d9\u05ea\u05d5\u05d7", "\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4, \u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea,", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05d4\u05ea\u05d9\u05d9\u05e9\u05d1\u05d5\u05ea", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d4\u05d9\u05e7\u05e4\u05d9\u05d5\u05ea \u05dc\u05de\u05d1\u05e0\u05d9", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05dc\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d7\u05d5\u05dc\u05d9 \u05e0\u05e4\u05e9", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e7\u05d5\u05e4\"\u05d7 \u05db\u05dc\u05dc\u05d9\u05ea \u05e2\u05e4\"\u05d9", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05dd (006719)", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea (008304)", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e8\u05e4\u05d5\u05e8\u05de\u05d4 \u05d1\u05ea\u05db\u05e0\u05d5\u05df", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8 \u05dc\u05de\u05d3\u05e2\u05d9 (003406)", "\u05d5\u05e2\u05d3\u05ea \u05d4\u05d9\u05d2\u05d5\u05d9 \u05dc\u05d1\u05d5\u05e8\u05d5\u05ea \u05d9\u05dd", "\u05e9\u05db\u05e8 \u05e6\u05d5\u05d5\u05ea \u05e4\u05e8\u05dc\u05de\u05e0\u05d8\u05d9 -", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1", "\u05d0\u05e9\u05db\u05d5\u05dc \u05e9\u05dc\u05d8\u05d5\u05df \u05de\u05e7\u05d5\u05de\u05d9", "\u05d0\u05e9\u05db\u05d5\u05dc \u05d9\u05d9\u05e9\u05d5\u05dd \u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea", "\u05e0\u05e9\u05d9\u05d0", "\u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d5\u05dc\u05e9\u05db\u05ea\u05d5 (000101)", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0 \u05dc\u05e9\u05e2\u05d1\u05e8 \u05e0\u05d1\u05d5\u05df", "\u05dc\u05e9\u05db\u05ea \u05d0\u05e9\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0 \u05dc\u05e9\u05e2\u05d1\u05e8", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0 \u05dc\u05e9\u05e2\u05d1\u05e8 - \u05de\u05e9\u05d4", "\u05d8\u05d9\u05e1\u05d5\u05ea \u05dc\u05d7\u05d5\"\u05dc", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea \u05e8\u05e9\u05d5\u05d9\u05d5\u05ea", "\u05e7\u05d9\u05d3\u05d5\u05dd \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05d1\u05de\u05d2\u05d6\u05e8\u05d9", "\u05d5\u05e2\u05d3\u05ea \u05ea\u05db\u05e0\u05d5\u05df \u05dc\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05d4\u05d0\u05e8\u05e6\u05d9\u05ea \u05dc\u05e4\u05d9\u05e7\u05d5\u05d7 (000609)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05db\u05d1\u05d0\u05d5\u05ea", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05db\u05d1\u05d0\u05d5\u05ea \u05d5\u05d4\u05e6\u05dc\u05d4 (000610)", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea \u05dc\u05e2\u05d3\u05d5\u05ea \u05dc\u05d0", "\u05e8\u05e9\u05d5\u05ea \u05dc\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e1\u05de\u05d9\u05dd", "\u05de\u05e2\u05e8\u05db\u05ea \u05e8\u05d9\u05e9\u05d5\u05dd \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d4 \u05dc\u05e4\u05d5\u05e2\u05dc \u05db\u05d7 \u05d0\u05d3\u05dd", "\u05e9\u05d5\u05d8\u05e8\u05d9\u05dd \u05d1\u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05de\u05e9\u05dc\u05d4 -", "\u05e9\u05d5\u05d8\u05e8\u05d9\u05dd \u05d1\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8 -", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea (000715)", "\u05d4\u05e2\u05e6\u05de\u05ea \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05de\u05d5\u05e8\u05e9\u05ea", "\u05d4\u05d5\u05d5\u05e2\u05d3\u05d4 \u05d4\u05d1\u05d9\u05e0\u05de\u05e9\u05e8\u05d3\u05d9\u05ea", "\u05de\u05d8\u05d4 \u05e7\u05d9\u05d1\u05e8\u05e0\u05d8\u05d9 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05dc\u05e9\u05db\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05e9\u05e2\u05d1\u05e8 -", "\u05dc\u05e9\u05db\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05e9\u05e2\u05d1\u05e8", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3", "\u05d4\u05de\u05d8\u05d4 \u05dc\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05ea\u05d9\u05d9\u05e9\u05d1\u05d5\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d9\u05e9\u05d5\u05d1\u05d9", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05db\u05dc\u05db\u05dc\u05d9 \u05e9\u05dc", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8\u05d4 \u05d2\u05d9\u05dc\u05d4 \u05d2\u05de\u05dc\u05d9\u05d0\u05dc", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e9\u05e8 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9\u05dd", "\u05d4\u05d5\u05d5\u05e2\u05d3\u05d4 \u05dc\u05d1\u05d3\u05d9\u05e7\u05ea \u05ea\u05d7\u05dc\u05d9\u05e4\u05d9", "\u05e1\u05e7\u05e8 \u05e4\u05d9\u05d0\u05d0\u05e7-\u05ea\u05e2\u05e1\u05d5\u05e7\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05de\u05e4\u05e7\u05d3 \u05e9\u05d5\u05d8\u05e3", "\u05d4\u05e1\u05db\u05de\u05d9\u05dd \u05dc\u05e7\u05d1\u05d5\u05e6\u05d5\u05ea \u05e2\u05dc \u05e4\u05d9", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e4\u05e8\u05d8\u05d9\u05dd - \u05de\u05d2\u05d5\u05e8\u05d9\u05dd", "\u05de\u05d9\u05de\u05d5\u05df \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e9\u05e8\u05d3\u05d9", "\u05d1\u05ea\u05d9 \u05db\u05e0\u05e1\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d5\u05ea \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea", "\u05d4\u05d3\u05e8\u05db\u05d4 \u05d5\u05d4\u05db\u05e9\u05e8\u05ea \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8 \u05e2\u05ea\u05d9\u05d3\u05d9\u05dd \u05dc\u05de\u05d2\u05d6\u05e8", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05ea\u05db\u05e0\u05d9\u05ea - \"\u05e6\u05d5\u05e2\u05e8\u05d9\u05dd", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1 (000421)", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 (000423)", "\u05ea\u05db\u05e0\u05d5\u05df \u05ea\u05e7\u05e6\u05d9\u05d1\u05d9", "\u05d4\u05d0\u05d2\u05e3 \u05dc\u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05de\u05d9\u05d3\u05e2,", "\u05d1\u05d9\u05ea \u05d4\u05e1\u05e4\u05e8 \u05d4\u05de\u05e8\u05db\u05d6\u05d9 \u05dc\u05d4\u05db\u05e9\u05e8\u05ea", "\u05e7\u05e9\u05e8\u05d9\u05dd \u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9\u05d9\u05dd", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d5\u05de\u05e9\u05e7 \u05d1\u05de\u05d5\u05e1\u05d3\u05d5\u05ea", "\u05e0\u05db\u05d9\u05dd \u05d1\u05de\u05e1\u05d2\u05e8\u05d5\u05ea \u05d7\u05d5\u05e5", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd - \u05db\u05d5\u05d7", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd \u05dc\u05e0\u05db\u05d9\u05dd", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e9\u05d9\u05d7\u05d5\u05ea \u05d8\u05dc\u05e4\u05d5\u05df", "\u05d0\u05d1\u05d7\u05d5\u05df \u05d0\u05e0\u05e9\u05d9\u05dd \u05e2\u05dd \u05e4\u05d9\u05d2\u05d5\u05e8", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05d7\u05d5\u05e5 \u05d1\u05d9\u05ea\u05d9", "\u05db\u05e4\u05e8 \u05dc\u05e0\u05d5\u05e4\u05e9\u05d9\u05dd \u05dc\u05d0\u05e0\u05e9\u05d9\u05dd \u05e2\u05dd", "\u05e4\u05e8\u05d8 \u05d5\u05de\u05e9\u05e4\u05d7\u05d4 - \u05e6\u05e8\u05db\u05d9\u05dd", "\u05e4\u05e8\u05d8 \u05d5\u05de\u05e9\u05e4\u05d7\u05d4 - \u05d8\u05d9\u05e4\u05d5\u05dc", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d9\u05dc\u05d3 \u05d5\u05e0\u05d5\u05e2\u05e8 \u05d7\u05d5\u05e5-", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d9\u05dc\u05d3 \u05d5\u05e0\u05d5\u05e2\u05e8 \u05d8\u05d9\u05e4\u05d5\u05dc", "\u05d4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d9\u05dc\u05d3 \u05d5\u05dc\u05e0\u05d5\u05e2\u05e8 -", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d6\u05e7\u05df- \u05d8\u05d9\u05e4\u05d5\u05dc \u05d7\u05d5\u05e5", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d6\u05e7\u05df \u05d8\u05d9\u05e4\u05d5\u05dc", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05d1\u05e2\u05d5\u05dc\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05de\u05e4\u05d5\u05e0\u05d9 \u05d7\u05d1\u05dc \u05e2\u05d6\u05d4", "\u05e7\u05e6\u05d9\u05e0\u05d9 \u05de\u05d1\u05d7\u05df \u05e0\u05d5\u05e2\u05e8", "\u05e0\u05d5\u05e2\u05e8 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d5\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 (002311)", "\u05de\u05e2\u05d5\u05e0\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd - \u05e8\u05e9\u05d5\u05ea", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc", "\u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05e6\u05e2\u05d9\u05e8\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd \u05dc\u05de\u05e4\u05d2\u05e8", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05de\u05d2\u05d6\u05e8", "\u05e9\u05d5\u05e4\u05d8\u05d9 \u05ea\u05e2\u05d1\u05d5\u05e8\u05d4 \u05d1\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea", "\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d5\u05e6\u05d0\u05d4 \u05dc\u05e4\u05d5\u05e2\u05dc (000821)", "\u05de\u05e9\u05db\u05e0\u05ea\u05d0\u05d5\u05ea \u05dc\u05d6\u05db\u05d0\u05d9\u05dd \u05e2\u05dc- \u05e4\u05d9", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05d0\u05d6\u05d5\u05e8\u05d9 \u05e2\u05d3\u05d9\u05e4\u05d5\u05ea", "\u05e2\u05de\u05dc\u05d5\u05ea \u05e0\u05d9\u05d4\u05d5\u05dc \u05ea\u05d9\u05e7\u05d9 \u05e9\u05db\u05e8", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (004301)", "\u05de\u05d9\u05db\u05d5\u05df \u05d5\u05de\u05d7\u05e9\u05d5\u05d1", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d9\u05e2\u05d5\u05d3\u05d9\u05d5\u05ea", "\u05e2\u05d1\u05d5\u05d3\u05d5\u05ea \u05e2\u05d1\u05d5\u05e8 \u05d2\u05d5\u05e8\u05de\u05d9 \u05d7\u05d5\u05e5", "\u05e8\u05d9\u05e9\u05d5\u05dd \u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05d1\u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05d4\u05d0\u05e6\u05ea \u05e8\u05d9\u05e9\u05d5\u05dd \u05d6\u05db\u05d5\u05d9\u05d5\u05ea", "\u05d4\u05e1\u05d3\u05e8 \u05e7\u05e8\u05e7\u05e2\u05d5\u05ea", "\u05e8\u05e9\u05ea \u05d1\u05e7\u05e8\u05d4", "\u05de\u05d7\u05e7\u05e8\u05d9\u05dd \u05d5\u05e1\u05e7\u05e8\u05d9\u05dd", "\u05e2\u05d3\u05db\u05d5\u05df \u05e9\u05db\u05d1\u05d5\u05ea \u05de\u05de\"\u05d2", "\u05e8\u05d6\u05e8\u05d1\u05d4 - \u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea", "\u05de\u05e8\u05db\u05d6\u05d9 \u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05e0\u05d7\u05d5\u05ea \u05dc\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd", "\u05de\u05d9\u05de\u05d5\u05df \u05e8\u05db\u05d9\u05e9\u05ea \u05d0\u05d5\u05d8\u05d5\u05d1\u05d5\u05e1\u05d9\u05dd", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05e9\u05d9\u05e4\u05d5\u05e8 \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05ea\u05e7\u05e9\u05d5\u05d1 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea", "\u05de\u05e0\u05d4\u05dc\u05ea \u05dc\u05d9\u05e9\u05d5\u05dd \u05d4\u05e9\u05d9\u05e0\u05d5\u05d9", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05e2\u05d9\u05d1\u05d5\u05d3\u05d9\u05dd \u05de\u05de\u05d5\u05db\u05e0\u05d9\u05dd (000510)", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05de\u05d7\u05e9\u05d1 \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e4\u05e9\u05d9\u05e2\u05d4", "\u05de\u05d9\u05e0\u05d4\u05dc \u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea", "\u05d5\u05d9\u05e1\u05d5\u05ea \u05e4\u05e2\u05d9\u05dc\u05d5\u05d9\u05d5\u05ea", "\u05d4\u05de\u05e8\u05db\u05d6 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9 \u05dc\u05d1\u05e7\u05e8\u05ea", "\u05d4\u05de\u05db\u05d5\u05df \u05d4\u05e8\u05e4\u05d5\u05d0\u05d9 \u05dc\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea", "\u05d4\u05db\u05e9\u05e8\u05ea \u05e8\u05d5\u05e4\u05d0\u05d9 \u05e9\u05d9\u05e0\u05d9\u05d9\u05dd", "\u05e2\u05d9\u05e8\u05d5\u05e0\u05d9 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05d7\u05d9\u05e4\u05d4 \u05e2\"\u05e9", "\u05e2\"\u05e9 \u05de\u05d8\u05d9\u05d5\u05e1 \u05d7\u05d3\u05e8\u05d4 - \u05d1\u05d9\"\u05e1", "\u05e2\"\u05e9 \u05e9\u05d9\u05e0\u05d1\u05d5\u05e8\u05df-\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9", "\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9", "\u05d1\u05d9\u05d4\"\u05d7 \u05ea\u05dc-\u05d4\u05e9\u05d5\u05de\u05e8 \u05d1\u05d9\"\u05e1", "\u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05ea\u05dc \u05d2\u05d9\u05d1\u05d5\u05e8\u05d9\u05dd", "\u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05d1\u05d9\u05ea \u05e1\u05e4\u05e8", "\u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0- \u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8", "\u05e7\u05e0\u05d9\u05d9\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d0\u05e9\u05e4\u05d5\u05d6", "\u05e4\u05dc\u05d9\u05de\u05df \u05d7\u05d9\u05e4\u05d4 - \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd (002410)", "\u05e4\u05e8\u05d3\u05e1 \u05d7\u05e0\u05d4 - \u05de\u05e8\u05db\u05d6 \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9", "\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05de\u05e8\u05db\u05d6 \u05d2\u05e8\u05d9\u05d0\u05d8\u05e8\u05d9", "\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea\u05d9 \u05de\u05db\u05d1\u05e1\u05d4-\u05dc\u05d9\u05d3", "\u05e9\u05de\u05d5\u05d0\u05dc \u05d4\u05e8\u05d5\u05e4\u05d0, \u05d1\u05d0\u05e8 \u05d9\u05e2\u05e7\u05d1", "\u05e9\u05de\u05d5\u05d0\u05dc \u05d4\u05e8\u05d5\u05e4\u05d0 - \u05e9\u05e8\u05d5\u05ea\u05d9", "\u05e8\u05d0\u05e9\u05d5\u05df \u05dc\u05e6\u05d9\u05d5\u05df - \u05de\u05e8\u05db\u05d6", "\u05de\u05e8\u05db\u05d6\u05d9\u05dd \u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea (002413)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea \u05d5\u05e7\u05e0\u05d9\u05d9\u05ea", "\u05de\u05d6\u05e8\u05e2 - \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05dc\u05d7\u05d5\u05dc\u05d9", "\u05e2\u05db\u05d5 \u05d5\u05e0\u05d4\u05e8\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea", "\u05d8\u05d9\u05e8\u05ea \u05d4\u05db\u05e8\u05de\u05dc - \u05ea\u05d7\u05e0\u05d4", "\u05d7\u05d9\u05e4\u05d4-\u05e2\u05dc \u05d9\u05d3 \u05d1\u05d9\"\u05d7 \u05e8\u05de\u05d1\"\u05dd", "\u05d8\u05d9\u05e8\u05ea \u05d4\u05db\u05e8\u05de\u05dc - \u05de\u05e8\u05db\u05d6", "\u05d7\u05d9\u05e4\u05d4 - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05e9\u05e2\u05e8 \u05de\u05e0\u05e9\u05d4 - \u05de\u05e8\u05db\u05d6", "\u05d7\u05d3\u05e8\u05d4 - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05dc\u05d1 \u05d4\u05e9\u05e8\u05d5\u05df - \u05d1\u05d9\u05ea-\u05d7\u05d5\u05dc\u05d9\u05dd", "\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05e9\u05d9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05d1\u05ea-\u05d9\u05dd - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05d9\u05e4\u05d5 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d2\u05de\u05d9\u05dc\u05d4 \u05de\u05e1\u05de\u05d9\u05dd", "\u05d9\u05e4\u05d5 - \u05de\u05e8\u05db\u05d6 \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05d2\u05d5\u05e9 \u05d3\u05df - \u05e9\u05e8\u05d5\u05ea \u05e7\u05d4\u05d9\u05dc\u05ea\u05d9", "\u05d1\u05d0\u05e8 \u05d9\u05e2\u05e7\u05d1 - \u05de\u05e8\u05db\u05d6", "\u05e8\u05de\u05dc\u05d4 \u05dc\u05d5\u05d3 - \u05ea\u05d7\u05e0\u05d5\u05ea", "\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05e8\u05d0\u05e9\u05dc\"\u05e6 \u05d5\u05d9\u05d1\u05e0\u05d4-", "\u05e8\u05de\u05dc\u05d4 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05db\u05e4\u05e8 \u05e9\u05d0\u05d5\u05dc - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05d1\u05d9\"\u05d7 \u05de\u05d0\u05d5\u05d7\u05d3 \u05dc\u05d7\u05d5\u05dc\u05d9 \u05e0\u05e4\u05e9", "\u05d0\u05d9\u05ea\u05e0\u05d9\u05dd - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd", "\u05d1\u05d0\u05e8-\u05e9\u05d1\u05e2 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05d1\u05d0\u05e8 \u05e9\u05d1\u05e2 - \u05de\u05e8\u05db\u05d6 \u05dc\u05d2\u05de\u05d9\u05dc\u05d4", "\u05de\u05e2\u05d1\u05d3\u05d5\u05ea \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8", "\u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8 - \u05de\u05e2\u05d1\u05d3\u05d4 \u05de\u05e8\u05db\u05d6\u05d9\u05ea", "\u05d7\u05d9\u05e4\u05d4 - \u05ea\u05d7\u05e0\u05d4 \u05dc\u05d4\u05ea\u05e4\u05ea\u05d7\u05d5\u05ea", "\u05dc\u05e9\u05db\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05de\u05d7\u05d5\u05d6", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d5\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05d1\u05ea\u05d9", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9\u05dd", "\u05d9\u05e2\u05d5\u05d3\u05d4 \u05dc\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e7\u05d5\u05e4\u05d5\u05ea", "\u05d9\u05d9\u05e2\u05d5\u05d3\u05d4 \u05dc\u05d4\u05e9\u05dc\u05de\u05ea \u05e2\u05dc\u05d5\u05ea \u05e1\u05dc", "\u05d4\u05e9\u05dc\u05de\u05ea \u05e2\u05dc\u05d5\u05ea \u05e1\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9", "\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd \u05dc\u05e0\u05e4\u05d2\u05e2\u05d9\u05dd \u05d5\u05e0\u05d6\u05e7\u05d9", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05d9\u05d5\u05ea \u05d5\u05ea\u05e8\u05d5\u05de\u05d5\u05ea", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05dc\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05e9\u05e4\u05d8\u05d9\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d5\u05d4\u05e4\u05e2\u05dc\u05ea \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea", "\u05e4\u05d3\u05d9\u05d5\u05df \u05d0\u05d2\"\u05d7 \u05d5\u05e0\u05d9\u05d4\u05d5\u05dc", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05e7\u05e8\u05e0\u05d5\u05ea \u05d4\u05d5\u05df \u05e1\u05d9\u05db\u05d5\u05df", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05d5\u05ea", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05dc \u05e4\u05d9", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05dc \u05e4\u05d9 (002701)", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05dc\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7 (002703)", "\u05d4\u05e1\u05db\u05de\u05d9\u05dd \u05dc\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d5\u05ea", "\u05d0\u05e9\u05e8\u05d0\u05d9 \u05de\u05e1\u05d5\u05d1\u05e1\u05d3 \u05d5\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea", "\u05e9\u05d9\u05e7\u05d5\u05dd \u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d5\u05d4\u05e9\u05dc\u05de\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d1\u05d9\u05e9\u05d5\u05d1\u05d9", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05e7\u05de\u05ea", "\u05d7\u05d9\u05d3\u05d5\u05e9, \u05d0\u05d7\u05d6\u05e7\u05d4, \u05d5\u05d4\u05e8\u05d7\u05d1\u05ea", "\u05e1\u05d1\u05e1\u05d5\u05d3 \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8\u05d9", "\u05de\u05d1\u05e6\u05e2 \u05de\u05db\u05d9\u05e8\u05ea \u05d3\u05d9\u05e8\u05d5\u05ea \u05d4\u05d3\u05d9\u05d5\u05e8", "\"\u05e8\u05d9\u05db\u05d5\u05d6 \u05de\u05d0\u05de\u05e5\" - \u05e9\u05d9\u05e7\u05d5\u05dd", "\u05e0\u05d9\u05e6\u05df", "\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05ea\u05d7\u05d9\u05d9\u05d1\u05d5\u05d9\u05d5\u05ea \u05e2\u05d3", "\u05de\u05d9\u05de\u05d5\u05df \u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d4\u05de\u05e9\u05db\u05d9\u05ea (007072)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05dc\u05e9\u05db\u05ea \u05d4\u05d3\u05d5\u05d1\u05e8", "\u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05de\u05d8\u05d4 (002021)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05d7\u05e9\u05d1", "\u05e4\u05e8\u05e1\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9 \u05d4\u05d5\u05e8\u05d9\u05dd", "\u05de\u05d7\u05e7\u05e8\u05d9\u05dd \u05d5\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d4", "\u05e7\u05e9\u05e8\u05d9 \u05d7\u05d5\u05e5", "\u05d4\u05ea\u05d0\u05de\u05ea \u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05d0\u05d2\u05e3 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d4\u05d3\u05ea\u05d9", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d5\u05d9\u05d5\u05d6\u05de\u05d5\u05ea \u05d1\u05de\u05e2\u05e8\u05db\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05e8\u05e6\u05d9\u05ea \u05dc\u05de\u05d3\u05d9\u05d3\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d1\u05e9\u05d9\u05ea\u05d5\u05e3 \u05de\u05e9\u05e8\u05d3", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e9\u05db\u05e8", "\u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea \u05de\u05d5\u05ea\u05e0\u05d5\u05ea \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9", "\u05e7\u05d5\u05e8\u05e1\u05d9\u05dd \u05d5\u05d9\u05de\u05d9 \u05e2\u05d9\u05d5\u05df \u05dc\u05e2\u05d5\"\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05e0\u05d4\u05d9\u05d2\u05d5\u05ea \u05d1\u05d9\u05ea", "\u05ea\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05d4\u05d8\u05de\u05e2\u05ea \u05d4\u05e8\u05e4\u05d5\u05e8\u05de\u05d4 \u05d1\u05de\u05e2\u05e8\u05db\u05ea", "\u05d2\u05d9\u05d3\u05d5\u05dc \u05d8\u05d1\u05e2\u05d9 \u05d1\u05de\u05e2\u05e8\u05db\u05ea", "\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d1\u05e4\u05e0\u05d9\u05de\u05d9\u05d5\u05ea \u05d5\u05de\u05e8\u05db\u05d6\u05d9", "\u05d1\u05d9\u05d4\"\u05e1 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05d1\u05d9\u05de\u05d4", "\u05d9\u05d9\u05e2\u05d5\u05e5 \u05d5\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05d1\u05e0\u05d9\u05d4", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05de\u05d1\u05e0\u05d9", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05e2\u05d1\u05e8\u05d4 \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d5\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea", "\u05de\u05dc\u05d2\u05ea \u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05dd", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea (007941)", "\u05ea\u05d0\u05d2\u05d9\u05d3 \u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea\u05d9\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05ea", "\u05d0\u05d5\u05e8\u05d7\u05d9\u05dd \u05d5\u05e9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4", "\u05d1\u05e7\u05d5\u05e8\u05ea \u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05de\u05e9\u05dc\u05d4", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05d1\u05d7\u05d5\"\u05dc", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea", "\u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e2\u05dc \u05de\u05d9\u05de\u05d5\u05df \u05d1\u05d7\u05d9\u05e8\u05d5\u05ea", "\u05d4\u05e7\u05de\u05ea \u05dc\u05e9\u05db\u05d4 \u05d1\u05e8\u05de\u05dc\u05d4 \u05d5\u05e9\u05dc\u05d5\u05d7\u05d4", "\u05d0\u05d2\u05e3 \u05d4\u05e1\u05e4\u05e7\u05d8\u05e8\u05d5\u05dd (003906)", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05de\u05d7\u05e7\u05e8 \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e2\u05e4\"\u05d9", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e9\u05dc\u05d1\u05d9 \u05de\u05d5\"\u05e4", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7", "\u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d4\u05d5\u05df (003803)", "\u05e4\u05ea\u05d5\u05d7 \u05e9\u05d5\u05d5\u05e7\u05d9\u05dd \u05dc\u05d9\u05e6\u05d5\u05d0 \u05d9\u05d3\u05e2", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 (003804)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e9\u05d9\u05d5\u05d5\u05e7 \u05dc\u05d7\u05d5\"\u05dc", "\u05de\u05d9\u05de\u05d5\u05e9\u05d9 \u05e2\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea \u05de\u05d3\u05d9\u05e0\u05d4", "\u05d4\u05d8\u05d1\u05d5\u05ea \u05dc\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea (003819)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05d1\u05d8\u05d7\u05d5\u05df (001501)", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea \u05e9\u05d5\u05d8\u05e3", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea (001401)", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea \u05dc\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea", "\u05d4\u05db\u05e0\u05d5\u05ea \u05dc\u05e7\u05e8\u05d0\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05dc\u05db\u05e0\u05e1\u05ea (001430)", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea -", "\u05de\u05d8\u05d4 \u05e6\u05d1\u05d0\u05d9", "\u05d4\u05de\u05e0\u05d4\u05dc \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9 \u05d1\u05d0\u05d6\u05d5\u05e8 (001731)", "\u05e9\u05db\u05e8 \u05d0\u05d6\u05e8\u05d7\u05d9\u05dd", "\u05d0\u05e8\u05db\u05d9\u05d0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4", "\u05de\u05d9\u05dd", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05e4\u05d9\u05e7\u05d5\u05d7", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05d9\u05d5\u05ea \u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05de\u05e4\u05e7\u05d3\u05ea \u05ea\u05d9\u05d0\u05d5\u05dd \u05d5\u05e7\u05d9\u05e9\u05d5\u05e8 \u05d7\u05d1\u05dc (001733)", "\u05d4\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d7\u05d9\u05e4\u05d4", "\u05de\u05d7\u05e7\u05e8\u05d9\u05dd, \u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd", "\u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05de\u05d7\u05e7\u05e8", "\u05e9\u05db\u05e8 \u05d5\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d4\u05d2\u05d1\u05dc\u05d9\u05dd \u05d4\u05e2\u05e1\u05e7\u05d9\u05d9\u05dd (005401)", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd (005402)", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05e2\u05e1\u05e7\u05d4", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05d0\u05de\u05e0\u05d9\u05dd \u05d5\u05e1\u05e4\u05d5\u05e8\u05d8\u05d0\u05d9\u05dd", "\u05e7\u05dc\u05d9\u05d8\u05ea \u05d4\u05d1\u05d0\u05d9\u05dd \u05de\u05d0\u05ea\u05d9\u05d5\u05e4\u05d9\u05d4", "\u05d3\u05de\u05d9 \u05e7\u05d9\u05d5\u05dd \u05d1\u05e7\u05d5\u05e8\u05e1\u05d9\u05dd,", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e7\u05dc\u05d9\u05d8\u05d4 \u05d1\u05e7\u05d4\u05d9\u05dc\u05d4", "\u05e7\u05dc\u05d9\u05d8\u05d4 \u05d9\u05e9\u05d9\u05e8\u05d4 \u05de\u05d0\u05e8\u05e6\u05d5\u05ea", "\u05de\u05e7\u05d1\u05e6\u05d9 \u05d3\u05d9\u05d5\u05e8 - \u05d4\u05e9\u05dc\u05de\u05ea \u05e9\u05db\u05e8", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05e0\u05d4\u05d5\u05dc", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05de\u05dc\u05d2\u05d5\u05ea \u05dc\u05de\u05d3\u05e2\u05e0\u05d9\u05dd", "\u05ea\u05db\u05e0\u05d9\u05ea \u05e7\u05dc\u05d9\u05d8\u05ea \u05de\u05d3\u05e2\u05e0\u05d9\u05dd", "\u05de\u05e2\u05e8\u05da \u05d4\u05e1\u05d1\u05e8\u05d4", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 - \u05e9\u05e8\u05d5\u05ea\u05d9\u05dd (003602)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05de\u05e0\u05d4\u05dc\u05d9 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05de\u05e8\u05db\u05d6", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05e1\u05d7\u05e8 \u05e4\u05e0\u05d9\u05dd", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05dc\u05de\u05d7\u05e7\u05e8", "\u05e8\u05e9\u05d5\u05ea \u05dc\u05e9\u05d9\u05ea\u05d5\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4", "\u05e4\u05d9\u05e7\u05d5\u05d7 \u05d5\u05d0\u05db\u05d9\u05e4\u05d4 \u05d1\u05e9\u05d5\u05e7 (003613)", "\u05e9\u05d9\u05dc\u05d5\u05d1 \u05de\u05d5\u05d2\u05d1\u05dc\u05d9\u05dd \u05e9\u05d5\u05e7", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05dc\u05db\u05d7 \u05d0\u05d3\u05dd \u05d1\u05e9\u05e2\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05e9\u05d9\u05dc\u05d5\u05d1 \u05de\u05e7\u05d1\u05dc\u05d9", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05e9\u05d9\u05dc\u05d5\u05d1", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05d4\u05d7\u05d5\u05de\u05e9 \u05dc\u05de\u05d2\u05d6\u05e8", "\u05d4\u05db\u05e9\u05e8\u05d4 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05ea \u05dc\u05de\u05d5\u05d1\u05d8\u05dc\u05d9\u05dd", "\u05d1\u05d7\u05d9\u05e0\u05d5\u05ea \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05d5\u05ea", "\u05d4\u05db\u05e9\u05e8\u05ea \u05db\"\u05d0 \u05d1\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05e2\u05d1\u05d5\u05d3\u05d4 (003624)", "\u05e2\u05ea\u05d5\u05d3\u05d4 \u05dc\u05e4\u05e8\u05d9\u05e9\u05d5\u05ea", "\u05e9\u05d9\u05e4\u05d5\u05e8 \u05de\u05d1\u05e0\u05d9 \u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8 (005301)", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9\u05dd \u05d1\u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e4\u05d9\u05ea\u05d5\u05d7 - \u05de\u05e9\u05e8\u05d3 (005210)", "\u05e4\u05e8\u05d5\u05d9\u05d9\u05e7\u05d8\u05d9\u05dd \u05dc\u05d1\u05d9\u05e0\u05d5\u05d9", "\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd \u05de\u05db\u05d7 \u05d4\u05e1\u05de\u05db\u05d5\u05ea", "\u05e4\u05d9\u05e6\u05d5\u05d9 \u05e2\u05e4\"\u05d9 \u05d7\u05d5\u05e7 \u05e0\u05e4\u05d2\u05e2\u05d9", "\u05d9\u05d7\u05d9\u05d3\u05ea \u05d4\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05e6\u05d5\u05de\u05d7", "\u05e9\u05d9\u05ea\u05d5\u05e4\u05d9 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d1\u05d9\u05df (003325)", "\u05d7\u05d5\u05e7 \u05d4\u05de\u05d5\u05e9\u05d1\u05d9\u05dd", "\u05d4\u05e1\u05d3\u05e8\u05d9\u05dd \u05dc\u05de\u05d2\u05d6\u05e8 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d9 (003326)", "\u05e2\u05ea\u05d5\u05d3\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea", "\u05e2\u05ea\u05d5\u05d3\u05d4", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e9\u05d9\u05e7\u05d5\u05dd \u05d4\u05e6\u05e4\u05d5\u05df", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05d4\u05ea\u05d9\u05d9\u05e2\u05dc\u05d5\u05ea \u05d1\u05e2\u05e0\u05e3", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05d7\u05d8\u05d9\u05d1\u05d4", "\u05de\u05d3\u05e2\u05df \u05e8\u05d0\u05e9\u05d9 - \u05de\u05d7\u05e7\u05e8\u05d9\u05dd \u05e8\u05d1", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05db\u05e4\u05e8 - \u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea", "\u05e9\u05d9\u05de\u05d5\u05e8 \u05e7\u05e8\u05e7\u05e2 - \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e8\u05d1", "\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05d4\u05d3\u05e8\u05db\u05d4 \u05d5\u05d4\u05de\u05e7\u05e6\u05d5\u05e2 -", "\u05d4\u05e9\u05e7\u05e2\u05d5\u05ea \u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05d0\u05d7\u05d6\u05e7\u05ea", "\u05e2\u05ea\u05d5\u05d3\u05d4 \u05dc\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e8\u05d1 \u05e9\u05e0\u05ea\u05d9\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05d9\u05e1\u05d9\u05dd (005510)", "\u05de\u05e2\u05e8\u05db\u05d5\u05ea \u05ea\u05e9\u05ea\u05d9\u05ea \u05d5\u05e6\u05d9\u05d5\u05d3 \u05e7\u05e6\u05d4", "\u05d8\u05d9\u05d4\u05d5\u05e8, \u05d2\u05d9\u05dc\u05d5\u05d9, \u05d6\u05d9\u05d4\u05d5\u05d9", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05dc\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 \u05e9\u05db\u05d9\u05e8\u05d9\u05dd", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 (0001)", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 \u05e1\u05e7\u05d8\u05d5\u05e8 \u05e2\u05e1\u05e7\u05d9", "\u05de\u05e2\"\u05de \u05e2\u05dc \u05de\u05dc\u05db\u05e8\u05d9\u05dd", "\u05de\u05d9\u05e1\u05d9\u05dd \u05e2\u05dc \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8 (0002)", "\u05de\u05e2\"\u05de \u05e2\u05dc \u05e4\u05d9\u05e0\u05e0\u05e1\u05d9\u05dd", "\u05de\u05e1 \u05e9\u05d1\u05d7", "\u05de\u05e1 \u05e9\u05d1\u05d7 (0003)", "\u05de\u05e1 \u05e8\u05db\u05d9\u05e9\u05d4", "\u05de\u05e1 \u05e8\u05db\u05d9\u05e9\u05d4 (0004)", "\u05de\u05e1 \u05de\u05e2\u05e1\u05d9\u05e7\u05d9\u05dd", "\u05de\u05e1 \u05de\u05e2\u05e1\u05d9\u05e7\u05d9\u05dd (0007)", "\u05de\u05db\u05e1 \u05d5\u05d4\u05d9\u05d8\u05dc \u05e2\u05dc \u05d4\u05d9\u05d1\u05d5\u05d0", "\u05de\u05db\u05e1 \u05d5\u05d4\u05d9\u05d8\u05dc \u05e2\u05dc \u05d4\u05d9\u05d1\u05d5\u05d0 (0011)", "\u05de\u05e1 \u05e7\u05e0\u05d9\u05d4 \u05de\u05d5\u05e6\u05e8\u05d9 \u05d9\u05d1\u05d5\u05d0", "\u05de\u05e1 \u05e7\u05e0\u05d9\u05d4 (0013)", "\u05de\u05e1 \u05e7\u05e0\u05d9\u05d4 \u05de\u05e7\u05d5\u05de\u05d9", "\u05ea\u05e7\u05d1\u05d5\u05dc\u05d9 \u05de\u05e2\"\u05de \u05d1\u05e8\u05d5\u05d8\u05d5", "\u05ea\u05e7\u05d1\u05d5\u05dc\u05d9 \u05de\u05e2\"\u05de \u05d1\u05e8\u05d5\u05d8\u05d5 (0014)", "\u05de\u05e1 \u05d8\u05d1\u05e7 - \u05d1\u05dc\u05d5", "\u05de\u05e1 \u05d8\u05d1\u05e7 - \u05d1\u05dc\u05d5 (0015)", "\u05de\u05e1 \u05d3\u05dc\u05e7", "\u05de\u05e1 \u05d3\u05dc\u05e7 (0018)", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea \u05d5\u05e8\u05e9\u05d9\u05d5\u05e0\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea \u05d5\u05e8\u05e9\u05d9\u05d5\u05e0\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05dd (0025)", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05d1\u05de\u05d8\"\u05d7", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05d1\u05de\u05d8\"\u05d7 (0034)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e8\u05d9\u05d1\u05d9\u05ea", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e8\u05d9\u05d1\u05d9\u05ea (0035)", "\u05ea\u05de\u05dc\u05d5\u05d2\u05d9\u05dd \u05de\u05de\u05e4\u05e2\u05dc\u05d9\u05dd \u05e2\u05e1\u05e7\u05d9\u05d9\u05dd", "\u05ea\u05de\u05dc\u05d5\u05d2\u05d9\u05dd \u05de\u05de\u05e4\u05e2\u05dc\u05d9\u05dd \u05e2\u05e1\u05e7\u05d9\u05d9\u05dd (0042)", "\u05ea\u05de\u05dc\u05d5\u05d2\u05d9\u05dd \u05de\u05d0\u05d5\u05e6\u05e8\u05d5\u05ea \u05d8\u05d1\u05e2", "\u05ea\u05de\u05dc\u05d5\u05d2\u05d9\u05dd \u05de\u05d0\u05d5\u05e6\u05e8\u05d5\u05ea \u05d8\u05d1\u05e2 (0043)", "\u05ea\u05de\u05dc\u05d5\u05d2\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d5\u05ea", "\u05ea\u05de\u05dc\u05d5\u05d2\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d5\u05ea (0044)", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9 (0045)", "\u05d4\u05d7\u05d6\u05e8 \u05e2\"\u05d7 \u05e9\u05e0\u05d9\u05dd \u05e7\u05d5\u05d3\u05de\u05d5\u05ea", "\u05d4\u05d7\u05d6\u05e8 \u05e2\"\u05d7 \u05e9\u05e0\u05d9\u05dd \u05e7\u05d5\u05d3\u05de\u05d5\u05ea (0046)", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea (0047)", "\u05d4\u05db\u05e0\u05e1\u05d4 \u05de\u05d9\u05d5\u05e2\u05d3\u05ea \u05de\u05e2\u05dc \u05d4\u05d0\u05d5\u05de\u05d3\u05df", "\u05d4\u05db\u05e0\u05e1\u05d4 \u05de\u05d9\u05d5\u05e2\u05d3\u05ea \u05de\u05e2\u05dc \u05d4\u05d0\u05d5\u05de\u05d3\u05df (0048)", "\u05d3\u05de\u05d9 \u05e9\u05d9\u05de\u05d5\u05e9 \u05d1\u05e0\u05db\u05e1\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05d3\u05de\u05d9 \u05e9\u05d9\u05de\u05d5\u05e9 \u05d1\u05e0\u05db\u05e1\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9 (0050)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df (0051)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df \u05d1\u05de\u05d8\"\u05d7", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df \u05d1\u05de\u05d8\"\u05d7 (0053)", "\u05d4\u05db. \u05de\u05de\u05e0\u05d4\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05db. \u05de\u05de\u05e0\u05d4\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc (0063)", "\u05d4\u05e4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e0\u05e1\u05d9\u05d4-\u05d9\u05d7'\u05de\u05e9\u05e7\u05d9\u05d5\u05ea", "\u05d4\u05e4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e0\u05e1\u05d9\u05d4-\u05d9\u05d7'\u05de\u05e9\u05e7\u05d9\u05d5\u05ea (0071)", "\u05d4\u05e4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e0\u05e1\u05d9\u05d4 - \u05d7\u05d1\u05e8\u05d5\u05ea", "\u05d4\u05e4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e0\u05e1\u05d9\u05d4 - \u05d7\u05d1\u05e8\u05d5\u05ea (0073)", "\u05de\u05db\u05d9\u05e8\u05ea \u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05d5\u05df (0075)", "\u05de\u05db\u05d9\u05e8\u05ea \u05d1\u05e0\u05e7\u05d9\u05dd \u05e9\u05d1\u05d4\u05e1\u05d3\u05e8", "\u05de\u05dc\u05d5\u05d4 \u05de\u05d4\u05de\u05d5\u05e1\u05d3 \u05dc\u05d1\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05de\u05dc\u05d5\u05d4 \u05de\u05d4\u05de\u05d5\u05e1\u05d3 \u05dc\u05d1\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9 (0081)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05e4\u05e0\u05d9\u05dd (0083)", "\u05de\u05dc\u05d5\u05d5\u05ea \u05d7\u05d5\u05e5 (0084)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d7\u05d5\"\u05dc", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05d7\u05d5\"\u05dc (0090)", "\u05d0\u05d2\"\u05d7 \u05de\u05d9\u05d5\u05e2\u05d3\u05d5\u05ea-\u05d7\u05d1\u05e8\u05d5\u05ea \u05d1\u05d9\u05d8\u05d5\u05d7", "\u05de\u05dc\u05d5\u05d5\u05ea \u05dc\u05d0 \u05e1\u05d7\u05d9\u05e8\u05d9\u05dd (008302)", "\u05d0\u05d2\"\u05d7 \u05de\u05d9\u05d5\u05e2\u05d3\u05d5\u05ea-\u05e7\u05e8\u05e0\u05d5\u05ea \u05e4\u05e0\u05e1\u05d9\u05d4", "\u05db\u05e1\u05e4\u05d9 \u05d0\u05de\u05d9\u05e1\u05d9\u05d5\u05ea,\u05d4\u05e4\u05e7\u05d3\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea,\u05d1\u05e0\u05e7\u05d9\u05dd \u05d5\u05e2\u05de\u05dc\u05d5\u05ea", "\u05de\u05e1 \u05e8\u05db\u05d5\u05e9", "\u05de\u05e1 \u05e8\u05db\u05d5\u05e9 (0005)", "\u05de\u05e1 \u05de\u05db\u05d9\u05e8\u05d4", "\u05de\u05e1 \u05de\u05db\u05d9\u05e8\u05d4 (0006)", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05db\u05dc\u05d9 \u05e8\u05db\u05d1", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05db\u05dc\u05d9 \u05e8\u05db\u05d1 (0024)", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea \u05d5\u05e8\u05e9\u05d9\u05d5\u05e0\u05d5\u05ea", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea \u05d5\u05e8\u05e9\u05d9\u05d5\u05e0\u05d5\u05ea (0025)", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05ea\u05d3\u05e8\u05d9\u05dd", "\u05e8\u05e9\u05d9\u05d5\u05df \u05e9\u05e0\u05ea\u05d9 \u05dc\u05d1\u05e0\u05e7\u05d9\u05dd", "\u05d0\u05d2\u05e8\u05d5\u05ea", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05d1\u05d2\u05d9\u05df \u05db\u05e1\u05e4\u05d9 \u05e2\u05e8\u05d1\u05d5\u05d9\u05d5\u05ea", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e8\u05d9\u05d1\u05d9\u05ea \u05de\u05d7' \u05d4\u05d2\u05d1\u05d9\u05d9\u05d4", "\u05ea\u05e7\u05d1\u05d5\u05dc\u05d9 \u05e8\u05d1\u05d9\u05ea \u05de\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e9\u05d5\u05e0", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05de\u05d1\u05e0\u05e7 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05e8\u05d9\u05d1\u05d9\u05ea \u05de\u05d1\u05e0\u05e7 \u05d9\u05e9\u05e8\u05d0\u05dc (0041)", "\u05d3\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d5", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea", "\u05d4\u05e2\u05d1\u05e8\u05d4 \u05de\u05d7\u05dc\u05e7 \u05d1'", "\u05d4\u05e2\u05d1\u05e8\u05d4 \u05de\u05d7\u05dc\u05e7 \u05d1' (0049)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df - \u05de\u05d7' \u05d4\u05d2\u05d1\u05d9\u05d9\u05d4", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df- \u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e9\u05d5\u05e0\u05d9\u05dd", "\u05d4\u05e4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e0\u05e1\u05d9\u05d4 \u05de. \u05e2\u05e1\u05e7\u05d9\u05d9\u05dd", "\u05d4\u05e4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e0\u05e1\u05d9\u05d4 \u05de. \u05e2\u05e1\u05e7\u05d9\u05d9\u05dd (0072)", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05d5\u05df", "\u05d4\u05db\u05e0\u05e1\u05d4 \u05de\u05d0\u05de\u05d9\u05e1\u05d9\u05d5\u05ea \u05d5\u05d4\u05e4\u05e7\u05d3\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d4 \u05de\u05d0\u05de\u05d9\u05e1\u05d9\u05d5\u05ea \u05d5\u05d4\u05e4\u05e7\u05d3\u05d5\u05ea (0082)", "\u05e1\u05d9\u05d5\u05e2 \u05d1\u05d8\u05d7\u05d5\u05e0\u05d9 \u05de\u05d0\u05e8\u05d4\"\u05d1", "\u05d0\u05d2\"\u05d7 \u05de\u05d9\u05d5\u05e2\u05d3\u05d5\u05ea-\u05d7\u05d1\u05e8\u05d5\u05ea", "\u05d0\u05d2\"\u05d7 \u05de\u05d9\u05d5\u05e2\u05d3\u05d5\u05ea-\u05e7\u05e8\u05e0\u05d5\u05ea", "\u05db\u05e1\u05e4\u05d9 \u05d0\u05de\u05d9\u05e1\u05d9\u05d5\u05ea,\u05d4\u05e4\u05e7\u05d3\u05d5\u05ea", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 \u05d7\u05d1\u05e8\u05d5\u05ea", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 \u05e1\u05e7\u05d8\u05d5\u05e8 \u05e2\u05e1\u05e7\u05d9 (000103)", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 \u05e2\u05e6\u05de\u05d0\u05d9\u05dd", "\u05de\u05e1 \u05d4\u05db\u05e0\u05e1\u05d4 \u05de\u05e0\u05d4\u05dc\u05d9 \u05d7\u05d1\u05e8\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e9\u05d5\u05e7 \u05d4\u05d4\u05d5\u05df", "\u05d0\u05d2\u05e8\u05d5\u05ea (002507)", "\u05db\u05d9\u05d1\u05d5\u05d9 \u05d0\u05e9", "\u05e9\u05d5\u05d8\u05e8\u05d9\u05dd \u05d1\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8 - \u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05db\u05d1\u05d0\u05d5\u05ea \u05d5\u05d4\u05e6\u05dc\u05d4", "\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05db\u05d1\u05d0\u05d5\u05ea \u05d5\u05d4\u05e6\u05dc\u05d4 (000730)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05de\u05db\u05dc\u05dc\u05d4 \u05dc\u05db\u05d1\u05d0\u05d5\u05ea", "\u05d4\u05d5\u05d5\u05e2\u05d3\u05d4 \u05dc\u05d1\u05d3\u05d9\u05e7\u05ea \u05ea\u05d7\u05dc\u05d9\u05e4\u05d9 \u05e0\u05e4\u05d8 \u05d1\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05d4\u05ea\u05d0\u05de\u05ea \u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05dc\u05de\u05d0\u05d4 \u05d4-21", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d5\u05d9\u05d5\u05d6\u05de\u05d5\u05ea \u05d1\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05e8\u05e6\u05d9\u05ea \u05dc\u05de\u05d3\u05d9\u05d3\u05d4 \u05d5\u05d4\u05e2\u05e8\u05db\u05d4 (\u05e8\u05d0\u05de\"\u05d4)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d1\u05e9\u05d9\u05ea\u05d5\u05e3 \u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05d3\u05e2 \u05d4\u05ea\u05e8\u05d1\u05d5\u05ea \u05d5\u05d4\u05e1\u05e4\u05d5\u05e8\u05d8", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05e2\u05dc \u05e4\u05d9 \u05d7\u05d5\u05e7 \u05e2\u05d9\u05d3\u05d5\u05d3", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea (007802)", "\u05de\u05e2\u05e0\u05e7\u05d9\u05dd \u05de\u05e0\u05d4\u05dc\u05d9\u05d9\u05dd", "\u05e1\u05d9\u05d5\u05e2 \u05dc\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05db\u05e4\u05e8\u05d9\u05ea", "\u05d4.\u05de. \u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df", "\u05d4.\u05de. \u05d7\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05d4\u05d3\u05e8\u05d5\u05dd (003810)", "\u05d8\u05d9\u05e4\u05d5\u05dc \u05de\u05de\u05d5\u05e7\u05d3", "\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 (003813)", "\u05e0\u05e2\"\u05de - \u05d0\u05d6\"\u05ea", "\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1", "\u05ea\u05d5\u05db\u05e0\u05d9\u05d5\u05ea \u05dc\u05d7\u05d9\u05d6\u05d5\u05e7 \u05d4\u05e6\u05e4\u05d5\u05df, \u05d5\u05d7\u05d9\u05e4\u05d4, \u05d0\u05e9\u05e7\u05dc\u05d5\u05df \u05d5\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4\u05d5\u05dc\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05e0\u05d2\u05d1 (003610)", "\u05de\u05d9\u05db\u05d5\u05df \u05d0\u05d5\u05e6\u05e8", "\u05d0\u05d5\u05e6\u05e8-\u05e4\u05d9\u05ea\u05d5\u05d7 (005501)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05e9\u05e2\"\u05de", "\u05de\u05d9\u05db\u05d5\u05df \u05e1\u05d7\u05e8 \u05d7\u05d5\u05e5", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05de\u05d3\u05e4\u05d9\u05e1 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05d4\u05e7\u05de\u05ea \u05de\u05ea\u05e7\u05df \u05e9\u05d9\u05e7\u05d5\u05e3", "\u05de\u05e1 \u05e7\u05e0\u05d9\u05d4", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d1\u05e0\u05e7\u05d9\u05dd \u05e9\u05d1\u05d4\u05e1\u05d3\u05e8", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05d5\u05df \u05d0\u05d7\u05e8\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05d5\u05df \u05d0\u05d7\u05e8\u05d5\u05ea (0076)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e8\u05d9\u05d1\u05d9\u05ea \u05de\u05de\u05e9\u05db\u05e0\u05ea\u05d0\u05d5\u05ea", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e8\u05d9\u05d1\u05d9\u05ea \u05de\u05d7' \u05d4\u05d2\u05d1\u05d9\u05d9\u05d4 (003502)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05d4\u05e6\u05de\u05d3\u05d4 \u05dc\u05e8\u05d1\u05d9\u05ea -", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e8\u05d9\u05d1\u05d9\u05ea- \u05de\u05d7' \u05d4\u05d2\u05d1\u05d9\u05d9\u05d4", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05d4\u05e6\u05de\u05d3\u05d4 \u05dc\u05e8\u05d9\u05d1\u05d9\u05ea", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d7\u05d1\u05e8\u05d5\u05ea (004502)", "\u05d3\u05d9\u05d5\u05d9\u05d3\u05e0\u05d3\u05d9\u05dd \u05de\u05d1\u05d6\u05e7", "\u05d0\u05d2\u05e8\u05d5\u05ea, \u05e7\u05e0\u05e1\u05d5\u05ea \u05d5\u05e8\u05e9\u05d9\u05d5\u05e0\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05d0\u05d2\u05e8\u05d5\u05ea \u05e7\u05e0\u05e1\u05d5\u05ea \u05d5\u05e8\u05e9\u05d9\u05d5\u05e0\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05dd (002501)", "\u05e7\u05e0\u05e1\u05d5\u05ea", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df \u05de\u05e9\u05db\u05e0\u05ea\u05d0\u05d5\u05ea", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df - \u05de\u05d7' \u05d4\u05d2\u05d1\u05d9\u05d9\u05d4 (005102)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05d4\u05e6\u05de\u05d3\u05d4-\u05e7\u05e8\u05df \u05de\u05e9\u05db\u05e0\u05ea\u05d0\u05d5", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05e7\u05e8\u05df- \u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e9\u05d5\u05e0\u05d9\u05dd (005103)", "\u05d2\u05d1\u05d9\u05d9\u05ea \u05d4\u05e6\u05de\u05d3\u05d4 \u05dc\u05e7\u05e8\u05df- \u05e9\u05d5\u05e0\u05d9\u05dd", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e2\u05de\u05d9\u05d3\u05d4 \u05d1\u05d9\u05e2\u05d3 \u05d4\u05d4\u05d5\u05e6\u05d0\u05d4", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9\u05dd \u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd", "\u05d4\u05de\u05d3\u05e4\u05d9\u05e1 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05d5\u05de\u05e9\u05e8\u05d3 \u05d4\u05d0\u05d5\u05e6\u05e8 (0089)", "\u05dc\u05e9\u05db\u05ea \u05e4\u05e8\u05e1\u05d5\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e4\u05e2\u05dc\u05d9 \u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05d5\u05de\u05e9\u05e8\u05d3 \u05d4\u05d0\u05d5\u05e6\u05e8", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05de\u05d3\u05e4\u05d9\u05e1", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05dc\u05e9\u05db\u05ea \u05d4\u05e4\u05e8\u05e1\u05d5\u05dd \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05e8\u05de\u05d1\"\u05dd \u05d7\u05d9\u05e4\u05d4 (898+51 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05e0\u05d4\u05e8\u05d9\u05d4 (627+17 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05d7\u05d5\u05dc\u05d5\u05df (655+30 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05e6\u05e8\u05d9\u05e4\u05d9\u05df (797+116 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05e2\"\u05e9 \u05d4\u05dc\u05dc \u05d9\u05e4\u05d4 \u05d7\u05d3\u05e8\u05d4 (410+14 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\"\u05e9 \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9 \u05d0\u05e9\u05e7\u05dc\u05d5\u05df (490+45 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d9\"\u05d7 \u05d7\u05d5\u05dc\u05d9\u05dd \u05e4\u05d5\u05e8\u05d9\u05d4 \u05d8\u05d1\u05e8\u05d9\u05d4 (284+12 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05e2\"\u05e9 \u05d6\u05d9\u05d5 \u05e6\u05e4\u05ea (301+20 \u05de\u05d9\u05d8\u05d5\u05ea)", "\u05d4\u05e2\u05d1\u05e8\u05ea \u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd \u05dc\u05de\u05d0\u05d2\u05e8 \u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea", "\u05de\u05d0\u05d2\u05e8 \u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05d9\u05dd", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\"\u05e9 \u05d3\"\u05e8 \u05e9\u05d9\u05d1\u05d0 \u05ea\u05dc-\u05d4\u05e9\u05d5\u05de\u05e8", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05e8\u05de\u05d1\"\u05dd", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05ea\u05dc-\u05d2\u05d9\u05d1\u05d5\u05e8\u05d9\u05dd", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e0\u05d4\u05e8\u05d9\u05d4", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05e6\u05e8\u05d9\u05e4\u05d9\u05df", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05d4\u05dc\u05dc \u05d9\u05e4\u05d4 \u05d7\u05d3\u05e8\u05d4", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\"\u05e9 \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9 \u05d0\u05e9\u05e7\u05dc\u05d5\u05df", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e4\u05d5\u05e8\u05d9\u05d4", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e6\u05e4\u05ea", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05d7\u05d9\u05e4\u05d4", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9 \u05de\u05de\u05e9\u05dc\u05ea\u05d9 \u05ea\"\u05d0 \u05d9\u05e4\u05d5", "\u05d4\u05e9\u05dc\u05de\u05ea \u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e0\u05de\u05dc \u05d7\u05d3\u05e8\u05d4", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05e0\u05de\u05dc \u05d7\u05d3\u05e8\u05d4", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05ea\u05db\u05e0\u05d5\u05df \u05ea\u05e9\u05ea\u05d9\u05ea \u05d5\u05e4\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd", "\u05e8\u05db\u05d9\u05e9\u05ea \u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05d1\u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05d4\u05e0\u05d7\u05d5\u05ea \u05d1\u05e7\u05e8\u05e7\u05e2", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d1\u05d2\u05d9\u05df \u05e9\u05d9\u05d5\u05d5\u05e7 \u05d1\u05dc\u05ea\u05d9 \u05e6\u05e4\u05d5\u05d9", "\u05ea\u05e9\u05dc\u05d5\u05de\u05d9\u05dd \u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05d4\u05e1\u05d3\u05e8\u05ea \u05d4\u05ea\u05d9\u05d9\u05e9\u05d1\u05d5\u05ea \u05d4\u05d1\u05d3\u05d5\u05d0\u05d9\u05dd \u05d1\u05e0\u05d2\u05d1", "\u05d4\u05e7\u05e8\u05df \u05dc\u05e9\u05d8\u05d7\u05d9\u05dd \u05e4\u05ea\u05d5\u05d7\u05d9\u05dd", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05e9\u05d5\u05d8\u05e4\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d1\u05d2\u05d9\u05df \u05e9\u05d9\u05d5\u05d5\u05e7\u05d9\u05dd \u05d1\u05dc\u05ea\u05d9 \u05e6\u05e4\u05d5\u05d9\u05d9\u05dd \u05de\u05e8\u05d0\u05e9", "\u05e2\u05d9\u05d3\u05d5\u05d3 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea \u05e4\u05e0\u05d9\u05dd", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05ea\u05db\u05e0\u05d5\u05df, \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d5\u05db\u05dc\u05db\u05dc\u05d4", "\u05d4\u05de\u05d3\u05e4\u05d9\u05e1 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9 (008903)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05de\u05d3\u05e4\u05d9\u05e1", "\u05dc\u05e9\u05db\u05ea \u05e4\u05e8\u05e1\u05d5\u05dd \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea (008910)", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05d4\u05dc\u05e9\u05db\u05d4", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05e8\u05e4\u05d5\u05e8\u05de\u05d4 \u05d1\u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05d1\u05e0\u05d9\u05d4 2011", "\u05d5\u05e2\u05d3\u05ea \u05d4\u05d9\u05d2\u05d5\u05d9 \u05dc\u05d1\u05d5\u05e8\u05d5\u05ea \u05d9\u05dd \u05d4\u05de\u05dc\u05d7", "\u05dc\u05e9\u05db\u05ea \u05d0\u05e9\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0 \u05dc\u05e9\u05e2\u05d1\u05e8 \u05d4\u05e8\u05e6\u05d5\u05d2", "\u05dc\u05e9\u05db\u05ea \u05d0\u05e9\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0 \u05dc\u05e9\u05e2\u05d1\u05e8 \u05d5\u05d9\u05e6\u05de\u05df", "\u05dc\u05e9\u05db\u05ea \u05d4\u05e0\u05e9\u05d9\u05d0 \u05dc\u05e9\u05e2\u05d1\u05e8 \u05de\u05e9\u05d4 \u05e7\u05e6\u05d1", "\u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05d4\u05d0\u05e8\u05e6\u05d9\u05ea \u05dc\u05e4\u05d9\u05e7\u05d5\u05d7 \u05e2\u05dc \u05d4\u05d1\u05e0\u05d9\u05d4 (000609)", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea- \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d3\u05ea", "\u05e9\u05d5\u05d8\u05e8\u05d9\u05dd \u05d1\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8 - \u05e9\u05db\u05e8", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05d5\u05e2\u05de\u05d9\u05d3\u05d4 \u05d1\u05d9\u05e2\u05d3 \u05d4\u05d4\u05d5\u05e6\u05d0\u05d4", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05d5\u05dc\u05e2\u05de\u05d9\u05d3\u05d4 \u05d1\u05d9\u05e2\u05d3 \u05d4\u05d4\u05d5\u05e6\u05d0\u05d4", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05ea\u05db\u05e0\u05d9\u05ea - \"\u05e6\u05d5\u05e2\u05e8\u05d9\u05dd \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05de\u05d3\u05d9\u05e0\u05d4\"", "\u05de\u05e0\u05d4\u05dc\u05ea \u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05de\u05e7\u05e6\u05d5\u05e2\u05d9\u05d5\u05ea", "\u05e8\u05d6\u05e8\u05d1\u05d5\u05ea \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05d5\u05dc\u05e2\u05de\u05d9\u05d3\u05d4 \u05d1\u05d9\u05e2\u05d3 \u05d4\u05d4\u05d5\u05e6\u05d0\u05d4", "\u05d4\u05d0\u05e6\u05ea \u05e8\u05d9\u05e9\u05d5\u05dd \u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05d1\u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05e2\u05d3\u05db\u05d5\u05df \u05e9\u05db\u05d1\u05d5\u05ea \u05de\u05e8\u05db\u05d6 \u05de\u05d9\u05d3\u05e2 \u05d2\u05d9\u05d0\u05d5\u05d2\u05e8\u05e4\u05d9", "\u05e8\u05d6\u05e8\u05d1\u05d4 - \u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea \u05dc\u05de\u05d9\u05dd \u05d5\u05dc\u05d1\u05d9\u05d5\u05d1", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea - \u05d5\u05e2\u05d3\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05d4\u05de\u05e8\u05db\u05d6\u05d9\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05e9\u05ea\u05d9\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05ea \u05de\u05e2\u05d5\u05e8\u05d1\u05ea", "\u05de\u05e0\u05d4\u05dc \u05d4\u05d3\u05d9\u05d5\u05e8 \u05d4\u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05de\u05e0\u05d4\u05dc\u05ea \u05dc\u05d9\u05e9\u05d5\u05dd \u05d4\u05e9\u05d9\u05e0\u05d5\u05d9 \u05d4\u05de\u05d1\u05e0\u05d9 \u05d1\u05de\u05e9\u05e7 \u05d4\u05d7\u05e9\u05de\u05dc", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05e9\u05db\u05e8", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea (002430)", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea- \u05e7\u05e0\u05d9\u05d5\u05ea", "\u05d4\u05e4\u05d7\u05ea\u05d5\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05db\u05d1\u05e1\u05d4", "\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd \u05dc\u05e0\u05e4\u05d2\u05e2\u05d9\u05dd \u05d5\u05e0\u05d6\u05e7\u05d9 \u05e8\u05db\u05d5\u05e9 \u05d1\u05de\u05e7\u05e8\u05d9\u05dd \u05d7\u05e8\u05d9\u05d2\u05d9\u05dd", "\u05ea\u05d7\u05d5\u05dd \u05e4\u05e2\u05d5\u05dc\u05d4 \u05db\u05dc\u05dc\u05d9 (009801)", "\u05de\u05d9\u05e0\u05d4\u05dc", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d0\u05de\u05e8\u05db\u05dc\u05d5\u05ea", "\u05e0\u05d9\u05d4\u05d5\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df (009802)", "\u05de\u05d9\u05e4\u05d5\u05d9 \u05d5\u05de\u05d3\u05d9\u05d3\u05d5\u05ea", "\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05de\u05d9\u05d3\u05e2 (\u05de\u05d9\u05db\u05d5\u05df)", "\u05e9\u05de\u05d9\u05e8\u05d4 \u05e2\u05dc \u05e7\u05e8\u05e7\u05e2", "\u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05ea\u05db\u05e0\u05d5\u05df \u05ea\u05e9\u05ea\u05d9\u05ea \u05d5\u05e4\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd (009803)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05d7\u05d1\u05e8\u05d5\u05ea", "\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05e4\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05db\u05dc\u05db\u05dc\u05d9\u05d9\u05dd", "\u05e4\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05d4\u05d7\u05d6\u05e8\u05d9\u05dd \u05d1\u05d2\u05d9\u05df \u05d1\u05d9\u05d8\u05d5\u05dc \u05e2\u05e1\u05e7\u05d0\u05d5\u05ea \u05d5\u05e9\u05d5\u05e0\u05d5\u05ea", "\u05ea\u05de\u05d5\u05e8\u05ea \u05d4\u05d9\u05d8\u05dc \u05d4\u05e9\u05d1\u05d7\u05d4", "\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd \u05d1\u05e2\u05d3 \u05d4\u05e4\u05e7\u05e2\u05d5\u05ea", "\u05e8\u05db\u05d9\u05e9\u05ea \u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05d1\u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df (009804)", "\u05d4\u05d7\u05d6\u05e8 \u05d7\u05d5\u05d1 \u05d4\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1 \u05d5\u05d1\u05e6\u05d5\u05e2 \u05d7\u05d5\u05e7 \u05e8\u05db\u05d9\u05e9\u05ea \u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05e8\u05db\u05d9\u05e9\u05d5\u05ea", "\u05d4\u05e0\u05d7\u05d5\u05ea \u05d1\u05e7\u05e8\u05e7\u05e2 \u05dc\u05de\u05d2\u05d5\u05e8\u05d9\u05dd", "\u05d4\u05e0\u05d7\u05d5\u05ea \u05d1\u05e7\u05e8\u05e7\u05e2 (009806)", "\u05d4\u05e7\u05e6\u05d0\u05d4 \u05dc\u05de\u05e4\u05d5\u05e0\u05d9 \u05d2\u05d5\u05e9 \u05e7\u05d8\u05d9\u05e3", "\u05d4\u05dc\u05d5\u05d5\u05d0\u05d5\u05ea \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 \u05e8\u05e9\u05d5\u05ea \u05d4\u05e4\u05d9\u05ea\u05d5\u05d7", "\u05ea\u05e9\u05dc\u05d5\u05de\u05d9\u05dd \u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd (009808)", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d4\u05e2\u05d1\u05e8\u05d5\u05ea \u05dc\u05e7\u05e8\u05df \u05e7\u05d9\u05de\u05ea \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d3\u05de\u05d9 \u05d7\u05db\u05d9\u05e8\u05d4 \u05e9\u05e0\u05ea\u05d9\u05d9\u05dd", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05e9\u05d5\u05d8\u05e4\u05d5\u05ea (009872)", "\u05d3\u05de\u05d9 \u05d4\u05d9\u05ea\u05e8", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05d4\u05d5\u05df (009873)", "\u05d3\u05de\u05d9 \u05d4\u05e1\u05db\u05de\u05d4", "\u05d3\u05de\u05d9 \u05d7\u05db\u05d9\u05e8\u05d4 \u05de\u05d4\u05d5\u05d5\u05e0\u05d9\u05dd \u05de\u05d1\u05e0\u05d9\u05d4\u05e2\"\u05d9 \u05d7\u05d1\u05e8\u05d5\u05ea \u05d1\u05d4\u05de\u05dc\u05e6\u05ea \u05de\u05e9\u05d1\"\u05e9", "\u05d3\u05de\u05d9 \u05d7\u05db\u05d9\u05e8\u05d4 \u05de\u05d4\u05d5\u05d5\u05e0\u05d9\u05dd \u05de\u05d4\u05e7\u05e6\u05d0\u05ea \u05e7\u05e8\u05e7\u05e2 \u05d1\u05de\u05db\u05e8\u05d6\u05d9\u05dd", "\u05d3\u05de\u05d9 \u05d7\u05db\u05d9\u05e8\u05d4 \u05de\u05d4\u05d5\u05d5\u05e0\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd", "\u05de\u05db\u05d9\u05e8\u05ea \u05de\u05e7\u05e8\u05e7\u05e2\u05d9\u05df", "\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9\u05dd", "\u05d0\u05e9\u05e8\u05d0\u05d9 \u05de\u05e1\u05d5\u05d1\u05e1\u05d3 \u05d5\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d1\u05d0\u05e9\u05e8\u05d0\u05d9 \u05de\u05e1\u05d5\u05d1\u05e1\u05d3 \u05de\u05e1\u05e2\u05d9\u05e3 42", "\u05ea\u05db\u05e0\u05d5\u05df \u05d5\u05e4\u05d9\u05e7\u05d5\u05d7", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 (007067)", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05dc\u05d1\u05e0\u05d9\u05d9\u05d4 \u05d7\u05d3\u05e9\u05d4", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05dc\u05d1\u05e0\u05d9\u05d4 \u05d7\u05d3\u05e9\u05d4 \u05d1\u05de\u05d2\u05d6\u05e8\u05d9 \u05d4\u05de\u05d9\u05e2\u05d5\u05d8\u05d9\u05dd", "\u05d3\u05d9\u05d5\u05e8 \u05dc\u05e7\u05e9\u05d9\u05e9", "\u05d4\u05e9\u05dc\u05de\u05d5\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05dc\u05d1\u05e0\u05d9\u05d9\u05d4", "\u05ea\u05e7\u05df \u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e0\u05d9\u05d9\u05d4 \u05de\u05e9\u05e0\u05ea 1995 \u05d5\u05d0\u05d9\u05dc\u05da", "\u05e4\u05d9\u05e0\u05d5\u05d9 \u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05d4\u05ea\u05d7\u05d3\u05e9\u05d5\u05ea \u05e2\u05d9\u05e8\u05d5\u05e0\u05d9\u05ea", "\u05d7\u05d1\u05e8\u05d5\u05ea \u05de\u05e0\u05d4\u05dc\u05d5\u05ea \u05de\u05d9\u05e0\u05d4\u05dc \u05de\u05e7\u05e8\u05e7\u05e2\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc", "\u05d9\u05e9\u05df \u05de\u05d5\u05dc \u05d7\u05d3\u05e9", "\u05d4\u05e1\u05db\u05dd \u05e2\u05de\u05d9\u05d2\u05d5\u05e8", "\u05de\u05d5\u05d3\u05d9\u05e2\u05d9\u05df", "\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8\u05d9\u05dd \u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd (007070)", "\u05d0\u05dc\u05e2\u05d3", "\u05de\u05e2\u05dc\u05d4 \u05d0\u05d3\u05d5\u05de\u05d9\u05dd 07", "\u05e8\u05d0\u05e9 \u05d4\u05e2\u05d9\u05df", "\u05d7\u05d5\u05de\u05ea \u05e9\u05de\u05d5\u05d0\u05dc", "\u05d9\u05d1\u05e0\u05d4", "\u05d7\u05e8\u05d9\u05e9", "\u05de\u05d9\u05de\u05d5\u05df \u05d4\u05ea\u05d7\u05d9\u05d9\u05d1\u05d5\u05d9\u05d5\u05ea \u05e2\u05d3 \u05e9\u05e0\u05ea 2006", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05dc\u05d7\u05d9\u05e0\u05d5\u05da \u05d5\u05ea\u05e8\u05d1\u05d5\u05ea", "\u05d2\u05d9\u05d3\u05d5\u05dc \u05d8\u05d1\u05e2\u05d9 \u05d1\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05e2\u05d1\u05e8\u05d4 \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05e6\u05d9\u05d1\u05d5\u05e8", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05e8\u05de\u05d1\"\u05dd \u05d7\u05d9\u05e4\u05d4 \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05e8\u05de\u05d1\"\u05dd \u05d7\u05d9\u05e4\u05d4 (898+51 \u05de\u05d9\u05d8\u05d5\u05ea) (009402)", "\u05e7\u05e0\u05d9\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e8\u05de\u05d1\"\u05dd \u05d7\u05d9\u05e4\u05d4", "\u05d4\u05e2\u05d1\u05e8\u05d4 \u05dc\u05d4\u05db\u05e0\u05e1\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea", "\u05d1\u05d9\"\u05d7 \u05e0\u05d4\u05e8\u05d9\u05d4 - \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05e0\u05d4\u05e8\u05d9\u05d4 (627+17 \u05de\u05d9\u05d8\u05d5\u05ea) (009403)", "\u05e7\u05e0\u05d9\u05d5\u05ea \u05d1\u05d9\"\u05d7 \u05e0\u05d4\u05e8\u05d9\u05d4", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05d7\u05d5\u05dc\u05d5\u05df \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05d7\u05d5\u05dc\u05d5\u05df (655+30 \u05de\u05d9\u05d8\u05d5\u05ea) (009404)", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d5\u05d5\u05dc\u05e4\u05e1\u05d5\u05df \u05d7\u05d5\u05dc\u05d5\u05df \u05e7\u05e0\u05d9\u05d5\u05ea", "\u05d1\u05d9\"\u05d7 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05e6\u05e8\u05d9\u05e4\u05d9\u05df \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05e6\u05e8\u05d9\u05e4\u05d9\u05df (797+116 \u05de\u05d9\u05d8\u05d5\u05ea) (009405)", "\u05d1\u05d9\"\u05d7 \u05e2\"\u05e9 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0 \u05e6\u05e8\u05d9\u05e4\u05d9\u05df - \u05e7\u05e0\u05d9\u05d5\u05ea", "\u05d1\u05d9\"\u05d7 \u05d4\u05dc\u05dc \u05d9\u05e4\u05d4 \u05d7\u05d3\u05e8\u05d4 - \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05e2\"\u05e9 \u05d4\u05dc\u05dc \u05d9\u05e4\u05d4 \u05d7\u05d3\u05e8\u05d4 (410+14 \u05de\u05d9\u05d8\u05d5\u05ea) (009406)", "\u05d1\u05d9\"\u05d7 \u05d4\u05dc\u05dc-\u05d9\u05e4\u05d4 \u05d7\u05d3\u05e8\u05d4 - \u05e7\u05e0\u05d9\u05d5\u05ea", "\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\"\u05e9 \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9 \u05d0\u05e9\u05e7\u05dc\u05d5\u05df - \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\"\u05e9 \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9 \u05d0\u05e9\u05e7\u05dc\u05d5\u05df (490+45 \u05de\u05d9\u05d8\u05d5\u05ea) (009407)", "\u05de\u05e8\u05db\u05d6 \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e2\"\u05e9 \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9 \u05d0\u05e9\u05e7\u05dc\u05d5\u05df - \u05e7\u05e0\u05d9\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8 \u05d1\u05d9\"\u05d7 \u05e4\u05d5\u05e8\u05d9\u05d4", "\u05d1\u05d9\"\u05d7 \u05d7\u05d5\u05dc\u05d9\u05dd \u05e4\u05d5\u05e8\u05d9\u05d4 \u05d8\u05d1\u05e8\u05d9\u05d4 (284+12 \u05de\u05d9\u05d8\u05d5\u05ea) (009408)", "\u05d1\u05d9\"\u05d7 \u05d6\u05d9\u05d5-\u05e6\u05e4\u05ea - \u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05db\u05e8", "\u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05e2\"\u05e9 \u05d6\u05d9\u05d5 \u05e6\u05e4\u05ea (301+20 \u05de\u05d9\u05d8\u05d5\u05ea) (009409)", "\u05e7\u05e0\u05d9\u05d5\u05ea \u05d1\u05d9\"\u05d7 - \u05e6\u05e4\u05ea", "\u05ea\u05d0\u05d2\u05d9\u05d3 \u05d4\u05e8\u05e9\u05d5\u05ea \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05d1\u05d8\u05d9\u05d7\u05d5\u05ea \u05d1\u05d3\u05e8\u05db\u05d9\u05dd", "\u05e2\u05e8\u05d1\u05d5\u05ea \u05de\u05d3\u05d9\u05e0\u05d4 (\u05ea\u05d9\u05e7\u05d5\u05df 39)", "\u05d4\u05e8\u05e9\u05d5\u05ea \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05e6\u05d9\u05d1\u05d5\u05e8\u05d9\u05d9\u05dd- \u05d7\u05e9\u05de\u05dc (005402)", "\u05ea\u05db\u05e0\u05d5\u05df - \u05d5\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea", "\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05d5\u05ea (005102)", "\u05e8\u05d9\u05e9\u05d5\u05dd \u05de\u05d4\u05e0\u05d3\u05e1\u05d9\u05dd \u05d5\u05d0\u05d3\u05e8\u05d9\u05db\u05dc\u05d9\u05dd", "\u05ea\u05de\u05d5\u05e8\u05d5\u05ea \u05de\u05d9\u05d9\u05e7\u05d5\u05e8 \u05d4\u05de\u05d9\u05dd", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea \u05d7\u05d8\u05d9\u05d1\u05d4 (\u05ea\u05d5\u05e8\u05e0\u05d9\u05ea)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05d4\u05de\u05e9\u05e8\u05d3", "\u05e8\u05d6\u05e8\u05d1\u05d4 \u05dc\u05d4\u05ea\u05d9\u05d9\u05e7\u05e8\u05d5\u05d9\u05d5\u05ea (003335)", "\u05ea\u05e7\u05e6\u05d9\u05d1 \u05de\u05d9\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05e7\u05e8", "\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d5\u05de\u05e2\u05e0\u05e7\u05d9 \u05d4\u05e9\u05e7\u05e2\u05d5\u05ea", "\u05d4\u05db\u05e0\u05e1\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d0\u05d5\u05e6\u05e8", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05e4\u05e0\u05d9\u05dd", "\u05de\u05e9\u05e8\u05d3 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e4\u05e0\u05d9\u05dd", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05e9\u05e4\u05d8\u05d9\u05dd", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5", "\u05de\u05d1\u05e7\u05e8 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05d5\u05e4\u05d9\u05e6\u05d5\u05d9\u05d9\u05dd", "\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05d5\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d7\u05d9\u05e8\u05d5\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d5\u05ea", "\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05de\u05e7\u05d5\u05de\u05d9\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05de\u05d3\u05e2, \u05d4\u05ea\u05e8\u05d1\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da", "\u05d4\u05e9\u05db\u05dc\u05d4 \u05d2\u05d1\u05d5\u05d4\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05e8\u05d5\u05d5\u05d7\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05d4\u05d2\u05e0\u05ea \u05d4\u05e1\u05d1\u05d9\u05d1\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05d4\u05e9\u05d9\u05db\u05d5\u05df", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea \u05d4\u05e2\u05dc\u05d9\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05d5\u05ea", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 \u05d4\u05de\u05e1\u05d7\u05e8", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e2\u05e0\u05e4\u05d9 \u05d4\u05de\u05e9\u05e7", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea", "\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05e8\u05e9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea \u05dc\u05de\u05d9\u05dd", "\u05de\u05e2\u05e0\u05e7\u05d9 \u05d1\u05d9\u05e0\u05d5\u05d9 \u05d5\u05e9\u05d9\u05db\u05d5\u05df", "\u05ea\u05e9\u05dc\u05d5\u05dd \u05e8\u05d9\u05d1\u05d9\u05ea \u05d5\u05e2\u05de\u05dc\u05d5\u05ea", "\u05d3\u05d9\u05d5\u05e8 \u05de\u05de\u05e9\u05dc\u05ea\u05d9", "\u05de\u05e9\u05e4\u05d8\u05d9\u05dd \u05d5\u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8", "\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05e4\u05d9\u05e7\u05d5\u05d7", "\u05d7\u05d9\u05e0\u05d5\u05da", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df, \u05d4\u05d4\u05d2\u05d9\u05e8\u05d4", "\u05e9\u05d9\u05db\u05d5\u05df", "\u05de\u05e4\u05e2\u05dc\u05d9 \u05de\u05d9\u05dd", "\u05ea\u05e2\u05e9\u05d9\u05d4", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05e4\u05d9\u05ea\u05d5\u05d7 \u05d0\u05d7\u05e8\u05d5\u05ea", "\u05ea\u05e9\u05dc\u05d5\u05dd \u05d7\u05d5\u05d1\u05d5\u05ea", "\u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 (0001)", "\u05de\u05e9\u05e8\u05d3 \u05de\u05d1\u05e7\u05e8 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05de\u05d1\u05e7\u05e8 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 (0011)", "\u05de\u05d9\u05de\u05d5\u05df \u05de\u05e4\u05dc\u05d2\u05d5\u05ea (0014)", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d7\u05e8\u05d5\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d5\u05ea", "\u05d4\u05d5\u05e6\u05d0\u05d5\u05ea \u05d7\u05e8\u05d5\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d5\u05ea (0016)", "\u05de\u05d3\u05e2, \u05ea\u05e8\u05d1\u05d5\u05ea \u05d5\u05e1\u05e4\u05d5\u05e8\u05d8", "\u05de\u05d3\u05e2, \u05ea\u05e8\u05d1\u05d5\u05ea \u05d5\u05e1\u05e4\u05d5\u05e8\u05d8 (0019)", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05dc\u05e0\u05e6\u05d5\u05dc\u05d9 \u05d4\u05e9\u05d5\u05d0\u05d4", "\u05d2\u05de\u05dc\u05d0\u05d5\u05ea \u05dc\u05e0\u05e6\u05d5\u05dc\u05d9 \u05d4\u05e9\u05d5\u05d0\u05d4 (0025)", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9", "\u05d4\u05e7\u05e6\u05d1\u05d5\u05ea \u05dc\u05d1\u05d9\u05d8\u05d5\u05d7 \u05dc\u05d0\u05d5\u05de\u05d9 (0027)", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea \u05d4\u05e2\u05dc\u05d9\u05d9\u05d4", "\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05e7\u05dc\u05d9\u05d8\u05ea \u05d4\u05e2\u05dc\u05d9\u05d9\u05d4 (0030)", "\u05d4\u05ea\u05e2\u05e9\u05d9\u05d4 \u05d4\u05de\u05e1\u05d7\u05e8 \u05d5\u05d4\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4", "\u05d4\u05ea\u05e2\u05e9\u05d9\u05d4 \u05d4\u05de\u05e1\u05d7\u05e8 \u05d5\u05d4\u05ea\u05e2\u05e1\u05d5\u05e7\u05d4 (0036)", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e2\u05e0\u05e4\u05d9 \u05de\u05e9\u05e7", "\u05ea\u05de\u05d9\u05db\u05d5\u05ea \u05d1\u05e2\u05e0\u05e4\u05d9 \u05de\u05e9\u05e7 (0038)", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4", "\u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 (0040)", "\u05e8\u05e9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea \u05dc\u05de\u05d9\u05dd \u05d5\u05d1\u05d9\u05d5\u05d1", "\u05e8\u05e9\u05d5\u05ea \u05de\u05de\u05e9\u05dc\u05ea\u05d9\u05ea \u05dc\u05de\u05d9\u05dd \u05d5\u05d1\u05d9\u05d5\u05d1 (0041)", "\u05ea\u05e9\u05dc\u05d5\u05dd \u05e8\u05d9\u05d1\u05d9\u05ea", "\u05ea\u05e9\u05dc\u05d5\u05dd \u05e8\u05d9\u05d1\u05d9\u05ea (0045)", "\u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05d1\u05ea\u05d9 \u05e1\u05d5\u05d4\u05e8", "\u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05d1\u05ea\u05d9 \u05e1\u05d5\u05d4\u05e8 (0052)", "\u05d1\u05ea\u05d9 \u05de\u05e9\u05e4\u05d8 (0053)", "\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea", "\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea (0067)", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df", "\u05e8\u05e9\u05d5\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05df (0068)", "\u05e4\u05d9\u05ea\u05d5\u05d7 \u05d4\u05ea\u05e2\u05e9\u05d9\u05d9\u05d4 (0076)", "\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea", "\u05ea\u05d9\u05d9\u05e8\u05d5\u05ea (0078)", "\u05ea\u05d7\u05d1\u05d5\u05e8\u05d4 (0079)"];
